MGCAddTopic(["End-User License Agreement with EDA Software Supplemental Terms", "", 1850,         "End-User License Agreement with EDA Software Supplemental Terms", 0]);

//
// Load snippet data
MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Questa SIM provides you with a simulation, debug, and verification platform for validating FPGA and SoC designs.");
MGCAddSnippet(6, "A series of commands provides the structure and flow for verifying a design with Questa SIM.");
MGCAddSnippet(7, "You must have the proper files and library setup in order to use the commands necessary to simulate your design using Questa SIM. ");
MGCAddSnippet(8, "Questa SIM must have access to several specific file types in order to simulate your design.");
MGCAddSnippet(9, "A library is a location on your file system that contains data to be used for simulation. Questa SIM relies on and can manipulate the data in one or more libraries for simulation. A library also helps to streamline simulation invocation. ");
MGCAddSnippet(10, "A resource library is typically static, serving as a parts source for your design. You can create your own resource libraries, or the libraries may be supplied by another design team or a third party (for example, a silicon vendor). ");
MGCAddSnippet(11, "VHDL uses logical library names that you map to Questa SIM library directories. If you do not map libraries properly before invoking your simulation, the simulation will fail due to not loading the necessary components. Similarly, compilation does depend on proper library mapping.");
MGCAddSnippet(12, "Before you can compile your source files, you must create a working library in which to store the compilation results. ");
MGCAddSnippet(13, "Use the language-specific compiler command to compile your design files into your working directory.");
MGCAddSnippet(14, "Optimization is an optional step that can improve performance by limiting the visibility of design objects. Questa SIM performs global optimizations with the vopt command. ");
MGCAddSnippet(15, "Use the vsim command to load the design, as defined by specifying the names of any top-level modules (many designs contain only one top-level module). ");
MGCAddSnippet(16, "Once you have successfully loaded the design, simulation time is set to zero, and you must enter a run command to begin simulation. ");
MGCAddSnippet(17, "You can debug your design from the Questa SIM GUI.");
MGCAddSnippet(18, "You can use the three general modes of operation to interact with Questa SIM: GUI mode, command line mode, and batch mode.");
MGCAddSnippet(19, "Command line simulations are initiated from a Windows or shell command prompt and can be either interactive or non-interactive. ");
MGCAddSnippet(20, "In command line mode, Questa SIM runs any startup command specified by the Startup variable in the modelsim.ini file. If you invoke vsim with the -do  command_string  option, the DO file executed in this manner overrides any startup command in the modelsim.ini file.");
MGCAddSnippet(21, "You can use the  here-document  technique to enter a string of commands in a shell or Windows command window. You invoke vsim and redirect standard input using the exclamation character (!) to initiate and terminate a sequence of commands.");
MGCAddSnippet(22, "You can use a script with output and input redirection to and from user specified files. The script can be set up to run interactively or non-interactively.");
MGCAddSnippet(23, "Command line mode enables basic command line editing and navigation techniques that you may be familiar with from other command line environments.");
MGCAddSnippet(24, "GUI-based commands are not available for use with vsim -c. ");
MGCAddSnippet(25, "Batch Mode is an operational mode to perform simulations without invoking the GUI. ");
MGCAddSnippet(26, "Capture simulation data during batch mode for post-simulation analysis.");
MGCAddSnippet(27, "Control the batch-mode simulation using modelsim.ini variables and Tcl variables.");
MGCAddSnippet(28, "By default, the simulator sends information about the simulator, commands executed, start time, end time, warnings, errors, and other data to stdout.");
MGCAddSnippet(29, "Each time you enter a command, the tool prints and sends this information to the Transcript window and/or a logfile. ");
MGCAddSnippet(30, "Because Questa SIM supports a variety of design languages (SystemC, Unified Power Format (UPF), PSL, Verilog, VHDL, and SystemVerilog), the documentation and the interface use the word  object  to refer to any valid design element in those languages. ");
MGCAddSnippet(31, "Questa SIM supports most industry standards. ");
MGCAddSnippet(32, "The QuestaSim commands vlog, vopt, vsim, vcom, vlib, visualizer, and sccom have built in help on their arguments. Each command uses the same -help syntax.");
MGCAddSnippet(33, "This manual uses a set of textual conventions.");
MGCAddSnippet(34, "This section provides tables of features, commands, command arguments, and modelsim.ini variables that have been superseded by new versions. ");
MGCAddSnippet(35, "Questa SIM, by default, performs built-in optimizations on your design to maximize simulator performance. ");
MGCAddSnippet(36, "QIS in the tool enables full vopt simulations while providing debug or visibility capabilities. ");
MGCAddSnippet(37, "You can use either a three-step or a two-step flow to control optimizations for your simulation run.");
MGCAddSnippet(38, "The three-step flow includes using the vopt command, which provides you with the most control over the optimization process.");
MGCAddSnippet(39, "The two-step flow omits explicit use of the vopt command, although you can perform design optimizations using existing scripts because vsim automatically performs optimization. ");
MGCAddSnippet(40, "The vopt Three-Step and Two-Step flows are the primary usage models for Questa SIM optimization performance. These flows provide global visibility of the design, which the compiler takes advantage of to make aggressive optimization decisions. In addition, you can specify any of four -O arguments to control the aggressiveness of optimization decisions. ");
MGCAddSnippet(41, "Recompiling an inlined module with different coverage settings (such as +cover) than a previous compile forces a recompile of the inline parent modules. This is due to the fact that inlined modules inherit the coverage settings of their parent. This forced recompilation can result in an unexpected increase in compile time. ");
MGCAddSnippet(42, "For a debugging flow, preserve object visibility by using any of the various arguments to the vopt command. These vopt arguments specify which objects remain accessible for the simulation. ");
MGCAddSnippet(43, "Use the +acc and +noacc arguments to the vopt command to specify accessibility for the entire design or to specific design units and instances. Using both +acc and +noacc (negation of +acc) arguments introduces some negation effects, so it is important to understand the interaction of these arguments.");
MGCAddSnippet(44, "Using vopt commands that contain both +<command> and +no<command> arguments can introduce some negation effects, so it is important to understand their interaction. ");
MGCAddSnippet(45, "When you use vopt commands containing both +<command> and +no<command> arguments, Questa SIM applies resolution techniques for any conflicts that result.");
MGCAddSnippet(46, "You can use the vopt -f argument to specify a file that contains different values for multiple +acc arguments. The target of the -f argument is simply an external text file whose contents are multiple instances of the +acc argument. These instanes behave the same way as if you specified them as individual arguments to a vopt command. ");
MGCAddSnippet(47, "You can use the vopt command to create specialized designs where generics or parameters are predefined by using the -g or -G arguments. ");
MGCAddSnippet(48, "When you are running Questa SIM in full optimization mode, breakpoints cannot be set. To retain visibility of breakpoints, you should set the vopt +acc argument such that the object related to the breakpoint is visible. ");
MGCAddSnippet(49, "During the optimization step, you can use various arguments of the vopt command to control how parameters and generics affect the optimization of the design. ");
MGCAddSnippet(50, "A Preoptimized Design Unit (PDU) is a region of your design that you can identify for a one-time optimization by using the -pdu argument of the vopt command. You can then reuse the PDU and exclude it from being optimized. This reduces the amount of time for future optimization and simulation runs by preoptimizing (black-boxing) static or unchanging regions of your design. ");
MGCAddSnippet(51, "When using multiple test benches to simulate a design, you typically use vopt -pdu to optimize each design under test (DUT) as a preoptimized design unit (PDU). You would then use the Three-Step simulation on the different test benches, which prevents having to optimize each DUT. ");
MGCAddSnippet(52, "A PDU may contain objects within its hierarchy that need to retain visibility for a successful simulation. ");
MGCAddSnippet(53, "You can use a Verilog configuration with the ‑pdu argument to vopt. ");
MGCAddSnippet(54, "You can use a VHDL configuration with the ‑pdu argument to vopt. ");
MGCAddSnippet(55, "A Preoptimized Design Unit does not allow mapping of libraries inside the PDU, though you can use mapping to find the upper-level PDU library. Compiling libraries and optimizing design units on one machine and then simulating the design on another machine (such as in a grid environment) can lead to an error condition—most frequently resulting from a changed file dependency or library path. ");
MGCAddSnippet(56, "You can implement optimizations that use variations of the Three- and Two-Step flows. Although the Three-Step flow is recommended for most Questa SIM simulations, you may find these alternative variations to be useful in your environment.");
MGCAddSnippet(57, "In some cases, you and other users may require access to the same library. One conflict that can arise from this is that another user may try to recompile some design units in that library, which can negatively affect your environment. ");
MGCAddSnippet(58, "To debug designs with Liberty logic cells, you must specify the location of the Liberty cell library file before or during optimization. ");
MGCAddSnippet(59, "To ensure that you retain the proper level of design visibility when performing an optimized simulation (using vopt in the Three-Step flow), you can use the vsim -learn command. This command creates control files that include instructions for preserving visibility of the design. ");
MGCAddSnippet(60, "Optimization (vopt) in the GUI is controlled from the SimulateDesign Optimization dialog box. You can use the Visibility tab restore total design visibility during optimization. ");
MGCAddSnippet(61, "The optimization considerations for Verilog designs include design object visibility, standard delay formating, event ordering, timing checks, handling pre-compiled libraries, and reporting for gate-level optimizations.");
MGCAddSnippet(62, "Some of the optimizations performed by vopt affect design object visibility. For example, many objects do not have PLI Access handles, potentially affecting the operation of PLI (program language interface) applications. However, a handle is guaranteed to exist for any object that is an argument to a system task or function.");
MGCAddSnippet(63, "Both the Two-Step and the Three-Step optimization flows automatically perform standard delay format (SDF) compilation using the sdfcom command. ");
MGCAddSnippet(64, "You can use the write cell_report and the -debugCellOpt argument to the vopt command to obtain information about which cells have and have not been optimized. ");
MGCAddSnippet(65, "If the source code is unavailable for any of the modules referenced in a design, then you must search libraries for the precompiled modules using the -L or -Lf arguments to the vopt command. This command optimizes precompiled modules the same as if the source code is available and writes the optimized code to the default  work  library.");
MGCAddSnippet(66, "The Verilog language does not require that the simulator execute simultaneous events in any particular order. Optimizations performed by vopt may expose event order dependencies that cause a design to behave differently than when run unoptimized. ");
MGCAddSnippet(67, "When you run a simulation, Questa SIM performs timing checks whether you optimize the design or not. In either, you will generally see the same results of these checks. However, in a cell where there are both interconnect delays and conditional timing checks, you might see different timing check results.");
MGCAddSnippet(68, "Projects simplify the process of compiling and simulating a design and are useful for getting started with Questa SIM. ");
MGCAddSnippet(69, "A project is a collection of files and user-defined settings for designs under specification or test. At a minimum, a project has a root directory, a work library, and  metadata  which are stored in an .mpf file located in a project's root directory. The metadata include: compiler switch settings, compile order, and file mappings. ");
MGCAddSnippet(70, "Projects offer benefits to both new and advanced users. ");
MGCAddSnippet(71, "Projects are generally not backwards compatible for either number or letter releases. When you open a project created in an earlier version, you will see a message warning that the project will be converted to the newer version. You have the option of continuing with the conversion or canceling the operation.");
MGCAddSnippet(72, "Your initial setup, compilation, and simulation of a design consists of working with several windows and dialog boxes. ");
MGCAddSnippet(73, "To create a new Questa SIM project, you open one from scratch and specify the details of its initial configuration. ");
MGCAddSnippet(74, "Once you have created a project, you need to add the design files. You can either write and edit a new source file, or add a pre-existing file.");
MGCAddSnippet(75, "The question marks in the Status column in the Project window indicate that either the files have not been compiled into the project or that the source has changed since the last compile. ");
MGCAddSnippet(76, "The Compile Order dialog box is functional for HDL-only designs. When you compile all files in a project, Questa SIM by default compiles the files in the order in which they were added to the project. ");
MGCAddSnippet(77, "If you have an HDL-only design, you can automatically generate the compile order of its files. ");
MGCAddSnippet(78, "You can group two or more files in the Compile Order dialog so they are sent to the compiler at the same time. ");
MGCAddSnippet(79, "After you have finished compiling the files contained in your design, you can begin simulation. ");
MGCAddSnippet(80, "The Project window contains information about the objects in your project. By default the window is divided into five columns. You can display this window to create a new project or to work on an existing project that you have saved");
MGCAddSnippet(81, "A Simulation Configuration associates a design unit(s) and its simulation options. Ordinarily, you would have to specify simulation options each time you load the design. With a Simulation Configuration, you specify the design and simulation options and then save the configuration with a name. ");
MGCAddSnippet(82, "Adding more files to a project makes it more difficult o locate the item you need. You can add one or more folders to a project and use them to organize the files that you have added. ");
MGCAddSnippet(83, "Project folders are similar to directories in that they are containers that allow you to organize multiple levels of folders and sub-folders. However, no actual project directories are created in the file system—the folders are present only within the project file. ");
MGCAddSnippet(84, "You can set two types of properties in a project: file properties and project settings. File properties affect individual files; project settings affect the entire project.");
MGCAddSnippet(85, "The VHDL and Verilog compiler commands (vcom and vlog, respectively) have numerous arguments that affect how a design is compiled and subsequently simulated. You can use the arguments of these commands to customize the settings on individual files or a group of files.");
MGCAddSnippet(86, "To modify project settings, right-click anywhere within the Project window and choose Project Settings from the popup menu. This opens the Project Settings Dialog Box.");
MGCAddSnippet(87, "If you are using a location map, you can convert relative pathnames, full pathnames, and pathnames with an environment variable into a soft pathname. ");
MGCAddSnippet(88, "Use the Project Settings dialog box to control the double-click behavior of the Project window.");
MGCAddSnippet(89, "Generally, you access a project from within the Questa SIM GUI. However, you can access a project from a standalone tool if you invoke it in the project's root directory. ");
MGCAddSnippet(90, "VHDL designs are associated with libraries, which are objects that contain compiled design units. SystemC, Verilog and SystemVerilog designs simulated within Questa SIM are compiled into libraries as well.");
MGCAddSnippet(91, "A design library is a directory or archive that serves as a repository for compiled design units. ");
MGCAddSnippet(92, "Information about each design unit in a design library is stored as part of that library. ");
MGCAddSnippet(93, "You can designate a design library as a working library or as a resource library, depending on how you want to use it for the current simulation. ");
MGCAddSnippet(94, "The implementation of a design library is not defined within standard VHDL or Verilog. Questa SIM implements design libraries as directories, which can have any legal name allowed by the operating system, with one exception: Questa SIM does not support extended identifiers for library names.");
MGCAddSnippet(95, "You need to create a working design library before you run the compiler. This can be done from either the command line or from the Questa SIM graphic interface. ");
MGCAddSnippet(96, "The -smartdbgsym argument of the vcom and vlog commands helps to reduce the size of debugging database symbol files generated at compile time from the design libraries. When you specify ‑smartdbgsym, most design units have their debugging symbol files generated on-demand by vsim.");
MGCAddSnippet(97, "You can use either the graphic user interface (GUI) or the command line to view, delete, recompile, or edit the contents of a library. The GUI method is provided in the Library window. ");
MGCAddSnippet(98, "VHDL uses logical library names that you can map to Questa SIM library directories. By default, Questa SIM can find libraries in your current directory (assuming they have the right name), but for it to find libraries located elsewhere, you need to map a logical library name to the pathname of the library.");
MGCAddSnippet(99, "You can map a library with the GUI using the Edit Library Mapping dialog box.");
MGCAddSnippet(100, "Use the vmap command to map a library from the command line.");
MGCAddSnippet(101, "You can map a library by manually modifying the modelsim.ini file.");
MGCAddSnippet(102, "Individual design units in a design library cannot be moved. However, you can move an entire design library by using standard operating system commands for moving a directory or an archive.");
MGCAddSnippet(103, "By adding an  others  specification to your modelsim.ini file, you can establish a hierarchy of library mappings. These mappings can reside in other locations. In particular, you can identify a library in a common location that has been made available for group use.");
MGCAddSnippet(104, "All modules and UDPs in a Verilog design must be compiled into one or more libraries. One library is usually sufficient for a simple design, but you may want to organize your modules into various libraries for a complex design. If your design uses different modules having the same name, then you need to put those modules in different libraries because design unit names must be unique within a library.");
MGCAddSnippet(105, "Because instantiation bindings are not determined at compile time, you must instruct the simulator to search your libraries when loading the design. ");
MGCAddSnippet(106, "Sometimes in one design you need to reference two different modules that have the same name. This situation can occur if you have hierarchical modules organized into separate libraries, and multiple libraries have sub-modules that have the same name but with different definitions. ");
MGCAddSnippet(107, "The LibrarySearchPath variable in the modelsim.ini file (in the [vlog] section) defines a space-separated list of resource library paths and/or library path variables. This behavior is identical to the -L argument for the vlog command.");
MGCAddSnippet(108, "Within a VHDL source file, you use the VHDL library clause to specify logical names of one or more resource libraries to be referenced in the subsequent design unit. ");
MGCAddSnippet(109, "Certain resource libraries are predefined in standard VHDL. The library named std contains the packages standard, env, and textio. The contents of these packages and other aspects of the predefined language environment are documented in the IEEE Standard VHDL Language Reference Manual, Std 1076. Do not modify any contents of this predefined library. ");
MGCAddSnippet(110, "The installation directory may contain two or more versions of the IEEE library.");
MGCAddSnippet(111, "Depending on your current Questa SIM version, you may need to regenerate your design libraries before running a simulation. You do this by using the -refresh argument to either the vcom or vlog command. Check the installation README file to see if your libraries require an update. ");
MGCAddSnippet(112, "Questa SIM includes an import wizard for referencing and using vendor FPGA libraries. The wizard scans for and enforces dependencies in the libraries and determines the correct mappings and target directories.");
MGCAddSnippet(113, "The Protecting Your Source Code chapter provides details about protecting your internal model data. This allows a model supplier to provide pre-compiled libraries without providing source code and without revealing internal model variables and structure.");
MGCAddSnippet(114, "Questa SIM enables you to compile, optimize, load, and simulate VHDL designs. ");
MGCAddSnippet(115, "Using a VHDL design with Questa SIM consists of running the vcom, vopt, and vsim commands to compile, optimize, load, and simulate. Note that you need to be familiar with any setup requirements for running these commands, such as using the vlib command to create a design library. ");
MGCAddSnippet(116, "The basic operations for using VHDL with Questa SIM are establishing a library for compilation results, compilation, and simulation. ");
MGCAddSnippet(117, "Before you can compile your VHDL source files, you must create a library in which to store the compilation results. ");
MGCAddSnippet(118, "Questa SIM compiles one or more VHDL design units with a single invocation of the vcom command, which functions as the VHDL compiler.");
MGCAddSnippet(119, "A VHDL design is ready for simulation after you compile it with vcom. You can then use the vsim command to invoke the simulator with the name(s) of the configuration or entity/architecture pair.");
MGCAddSnippet(120, "Questa SIM supports the use of VHDL in compliance with the IEEE Standard VHDL Language Reference Manual (IEEE Std 1076), which was originally adopted in 1987. This standard has undergone several revisions, each of which is identified by a suffix indicating the year of its approval by the IEEE. There are considerations in using VHDL with Questa SIM that are not explicitly covered by the Language Reference Manual (LRM). ");
MGCAddSnippet(121, "The four different versions of the VHDL standard (IEEE Std 1076) have names that reflect the year each version was approved by the IEEE: 1076-1987, 1076-1993, 1076‑2002, and 1076-2008. The default language version supported for Questa SIM is 1076‑2002. ");
MGCAddSnippet(122, "A VHDL for … generate statement, when elaborated in a design, places a given number of for … generate equivalent blocks into the scope in which the statement exists; either an architecture, a block, or another generate block. The simulator constructs a design path name for each of these for … generate equivalent blocks based on the original generate statement's label and the value of the generate parameter for that particular iteration. ");
MGCAddSnippet(123, "Foreign language interface (FLI) routines are C programming language functions that provide procedural access to information within the HDL simulator, vsim. A user-written application can use these functions to traverse the hierarchy of an HDL design, get information about and set the values of VHDL objects in the design, get information about a simulation, and control (to some extent) a simulation run.");
MGCAddSnippet(124, "The simulator internally represents time as a 64-bit integer in units equivalent to the smallest unit of simulation time, also known as the simulator resolution limit. ");
MGCAddSnippet(125, "By default, Questa SIM performs binding when you load the design with the vsim command. The advantage of this default binding at load time is that it provides more flexibility for compile order, in that VHDL entities do not necessarily have to be compiled before other entities/architectures that instantiate them. ");
MGCAddSnippet(126, "Event-based simulators such as Questa SIM can process many events at a given simulation time. Multiple signals may need updating, statements that are sensitive to these signals must be executed, and any new events that result from these statements must then be queued and executed as well. The steps taken to evaluate the design without advancing simulation time are referred to as  delta times  or just  deltas. ");
MGCAddSnippet(127, "The TextIO package for VHDL is defined in the IEEE Std 1076-2002, IEEE Standard VHDL Language Reference Manual. This package allows human-readable text input from a declared source within a VHDL file during simulation. ");
MGCAddSnippet(128, "The syntax supported for Text IO can vary according to the version of IEEE Std 1076 you are using. ");
MGCAddSnippet(129, "STD_INPUT is a file_logical_name that refers to characters that you enter interactively from the keyboard, and STD_OUTPUT refers to text that displays on the screen. The syntax supported for STD_INPUT and STD_OUTPUT for Text IO can vary according to the version of IEEE Std 1076 you are using. ");
MGCAddSnippet(130, "Questa SIM does not fully implement all facets of the TextIO package, which can result in ambiguous results. ");
MGCAddSnippet(131, "To use the TextIO package to read and write to your own files, you declare an input or output file of type TEXT. ");
MGCAddSnippet(132, "Flushing of the TEXTIO buffer depends on whether VHDL files are open for writing. ");
MGCAddSnippet(133, "You can provide an input stimulus to a design by reading data vectors from a file and assigning their values to signals. You can then verify the results of this input. ");
MGCAddSnippet(134, "The VITAL (VHDL Initiative Towards ASIC Libraries) modeling specification is sponsored by the IEEE to promote the development of highly accurate, efficient simulation models for ASIC (Application-Specific Integrated Circuit) components in VHDL. ");
MGCAddSnippet(135, "The Questa SIM installation includes the source code for VITAL packages. ");
MGCAddSnippet(136, "VITAL 2000 accelerated packages are pre-compiled into the ieee library in the installation directory. VITAL 1995 accelerated packages are pre-compiled into the vital1995 library. If you need to use the older library, you either need to change the ieee library mapping or add a use clause to your VHDL code to access the VITAL 1995 packages. ");
MGCAddSnippet(137, "Questa SIM is compliant with IEEE Std 1076.4-2002, IEEE Standard for VITAL ASIC Modeling Specification. In addition, Questa SIM accelerates the VITAL_Timing, VITAL_Primitives, and VITAL_memory packages. The optimized procedures are functionally equivalent to the IEEE Std 1076.4 VITAL ASIC Modeling Specification (VITAL 1995 and 2000). ");
MGCAddSnippet(138, "When you run the vcom command, Questa SIM automatically recognizes that a VITAL function is being referenced from the ieee library and generates code to call the optimized built-in routines. ");
MGCAddSnippet(139, "The vcom command has several arguments that control and provide feedback on VITAL optimization. ");
MGCAddSnippet(140, "The util package contains various VHDL utilities that you can run as Questa SIM commands. The package is part of the modelsim_lib library, which is located in the /questasim tree of your installation directory and is mapped in the default modelsim.ini file. ");
MGCAddSnippet(141, "Modeling memory presents some challenges which careful plannning can address.");
MGCAddSnippet(142, "You should avoid using VHDL signals to model memory. For large memories especially, the run time for a VHDL model using a signal is many times longer than the run time for a VHDL model using variables in the memory process or as part of the architecture. A signal also uses much more memory. ");
MGCAddSnippet(143, "Simulation performance typically suffers if events are scheduled far into the future but then canceled before they take effect. Canceling scheduled events before they take effect acts as a memory leak and slows down simulation. ");
MGCAddSnippet(144, "VHDL does not have an objected‑oriented modeling capability, but VHDL variables of access type enable you to use Questa SIM to log and display dynamic simulation data. You enable this logging by specifying vsim ‑accessobjdebug. ");
MGCAddSnippet(145, "Using VHDL access type variables for logging dynamic data entails various names and descriptors.");
MGCAddSnippet(146, "Once you declare an access type, you can declare an access variable within a process or subprogram. When creating dynamic data in VHDL, the usual strict rules apply to assignment of newly constructed objects to an access type. ");
MGCAddSnippet(147, "Access object debugging has some limitations. ");
MGCAddSnippet(148, "By default, logging access objects by name is turned off. Access variables can be logged and displayed in the various display windows, but the access object(s) they point to are not logged. You can display the value of an access variable (the  name  of the access object it points to) but commands cannot use the value to reference the access variable. ");
MGCAddSnippet(149, "Logging an access variable logs both the variable value and any access object that the variable points to during the simulation. ");
MGCAddSnippet(150, "You can use the examine and describe commands to obtain a description of a variable s characteristics.");
MGCAddSnippet(151, "Introduction to the process of compiling and simulating Verilog and SystemVerilog designs with Questa SIM. ");
MGCAddSnippet(152, "SystemVerilog is an extension of IEEE Std 1364 for the Verilog HDL and improves the productivity, readability, and re-usability of Verilog-based code. ");
MGCAddSnippet(153, "Questa SIM enables you to use syntax variations of constructs that are not explicitly defined as being supported in the Verilog LRM (such as  shortcuts  supported for similar constructs in another language). ");
MGCAddSnippet(154, "Questa SIM allows you to use Verilog syntax that omits any or all three specifications of a for loop — initialization, termination, increment. These allowed omissions are also allowed in C.");
MGCAddSnippet(155, "The vlog command compiles macros named with integers in addition to identifiers. ");
MGCAddSnippet(156, "Basic Verilog usage include the steps of compiling, optimizing, loading, and simulating. ");
MGCAddSnippet(157, "Compiling your Verilog design for the first time is a two-step process.");
MGCAddSnippet(158, "Before you can compile your design, you must create a library in which to store the compilation results, which is compatible across all platforms.");
MGCAddSnippet(159, "The Verilog compiler compiles Verilog source code into retargetable, executable code. You can then simulate your design on any supported platform without having to recompile your design.");
MGCAddSnippet(160, "Note that Verilog and SystemVerilog are case-sensitive languages. For example, clk and CLK are regarded as different names that you can apply to different signals or variables. This differs from VHDL, which is case-insensitive. ");
MGCAddSnippet(161, "With standard Verilog files (<filename>.v), vlog does not automatically parse SystemVerilog keywords. ");
MGCAddSnippet(162, "If you use the -sv argument with the vlog command, Questa SIM assumes that all input files are SystemVerilog, regardless of their respective filename extensions. ");
MGCAddSnippet(163, "By default, to initialize enum variables Questa SIM uses the default value of the base type instead of the leftmost value. ");
MGCAddSnippet(164, "Questa SIM supports incremental compilation of Verilog designs—there is no requirement to compile an entire design in one invocation of the compiler.");
MGCAddSnippet(165, "You must compile all modules and UDPs in a Verilog design into one or more libraries. One library is usually sufficient for a simple design, but you may want to organize your modules into various libraries for a complex design. If your design uses different modules having the same name, then you need to put those modules in different libraries because design unit names must be unique within a library.");
MGCAddSnippet(166, "Questa SIM allows you to compile multiple SystemVerilog files at a time.");
MGCAddSnippet(167, "SystemVerilog allows the declaration of types, variables, functions, tasks, and other constructs in compilation unit scope ($unit). The visibility of declarations in $unit scope does not extend outside the current compilation unit. It is important to understand how the simulator defines compilation units during compilation. ");
MGCAddSnippet(168, "According to the IEEE Std 1800-2005, the visibility of macro definitions and compiler directives spans the lifetime of a single compilation unit. ");
MGCAddSnippet(169, "The Verilog compiler supports arguments that are equivalent to Verilog-XL arguments, simplifying the porting of a design to Questa SIM. ");
MGCAddSnippet(170, "The Verilog compiler provides arguments that support source libraries in the same manner as Verilog-XL. ");
MGCAddSnippet(171, "The `uselib compiler directive is a method of source library management that you can use as an alternative to the ‑v, -y, and +libext compiler arguments. It has the advantage that a design may reference different modules having the same name. ");
MGCAddSnippet(172, "The Verilog 2001 specification added support for configurations. Configurations specify how a design is  assembled  during the elaboration phase of simulation. A configuration consists of two pieces: the library mapping and the configuration itself. Library mapping is used at compile time to determine into which libraries the source files are to be compiled. ");
MGCAddSnippet(173, "Questa SIM treats the library named  work  in a special way for Verilog configurations. ");
MGCAddSnippet(174, "Questa SIM implements the rules for generate statements adopted for Verilog 2005. Most of the 2005 rules are backwards compatible, but there is one key difference related to name visibility. ");
MGCAddSnippet(175, "Consider the following code example.");
MGCAddSnippet(176, "For Verilog designs, you can initialize registers and memories with specific values or randomly generated values. ");
MGCAddSnippet(177, "When initializing registers and memories, it is important to understand the concepts of random stability and sequential UDPs.");
MGCAddSnippet(178, "You can enable initialization with specific values to occur during compilation.");
MGCAddSnippet(179, "You can enable initialization with specific values to occur during optimization.");
MGCAddSnippet(180, "You can enable initialization with random values to occur during compilation.");
MGCAddSnippet(181, "You can enable initialization with random values to occur during optimization.");
MGCAddSnippet(182, "You can save a report of the seed values generated by the +initmem and +initreg arguments by specifying the ‑initreport <filename> argument on the vsim command line. ");
MGCAddSnippet(183, "A Verilog design is ready for simulation after you compile it with vlog and, if desired, you optimize it with vopt. You can then invoke the simulator with the names of the top-level modules (many designs contain only one top-level module) or the name(s) you assigned to the optimized version(s) of the design.");
MGCAddSnippet(184, "The simulator internally represents time as a 64-bit integer, in units equivalent to the smallest unit of simulation time (also known as the simulator resolution limit). The resolution limit defaults to the smallest time units that you specify among all of the `timescale compiler directives in the design. ");
MGCAddSnippet(185, "Unexpected behavior may occur if your design contains some modules with timescale directives and others without. The simulator issues an elaboration error in this situation. You should make sure that all modules having delays also have timescale directives so that the timing of the design operates as you intend.");
MGCAddSnippet(186, "A design can have multiple timescale directives. Separately compiled modules can also have different timescales. The simulator compares the timescale of all of the modules in a design, and uses the smallest timescale as the simulator resolution. ");
MGCAddSnippet(187, "You should choose the coarsest simulator resolution limit possible that does not result in undesired rounding of your delays. For example, values smaller than the current Time Scale will be truncated to zero (0) and a warning issued. However, setting the time precision unnecessarily small can degrade performance.");
MGCAddSnippet(188, "Event-based simulators such as Questa SIM can process multiple events at a given simulation time. The Verilog language definition does not provide you control of the processing order of simultaneous events. Some designs rely on a particular event order, and these designs may behave differently than you expect.");
MGCAddSnippet(189, "Section 11 of IEEE Std 1364-2005 defines several event queues that determine how events are evaluated. ");
MGCAddSnippet(190, "The only control you have over event order is that you can assign an event to a particular queue. You do this with blocking or non-blocking assignments. ");
MGCAddSnippet(191, "Since many models have been developed on Verilog-XL, Questa SIM tries to duplicate Verilog-XL event ordering to ease the porting of those models to Questa SIM. However, Questa SIM does not match Verilog-XL event ordering in all cases, and if a model ported to Questa SIM does not behave as expected, there may be event order dependencies.");
MGCAddSnippet(192, "The -hazards argument for the vsim command detects event order hazards involving simultaneous reading and writing of the same register in concurrently executing processes. ");
MGCAddSnippet(193, "The optimization level you use in a simulation can have an affect on hazard detection results. ");
MGCAddSnippet(194, "If you attempt to access a SystemVerilog object that has not been constructed with the new operator, you will receive a fatal error called a signal segmentation violation (SIGSEGV). ");
MGCAddSnippet(195, "Questa SIM automatically detects cells with negative timing checks and causes timing checks to be performed on the delayed versions of input ports (used when there are negative timing check limits). ");
MGCAddSnippet(196, "The vsim command supports several timing check-related arguments.");
MGCAddSnippet(197, "By default, the simulator supports negative timing check limits in Verilog $setuphold and $recrem system tasks. ");
MGCAddSnippet(198, "The $setuphold check determines whether signals obey the timing constraints.");
MGCAddSnippet(199, "The $recrem timing check determines whether signals obey the timing constraints.");
MGCAddSnippet(200, "Your $setuphold() or $recrem() timing checks must follow the LRM defined syntax exactly. The simulator behaves in the following ways based on your commands.");
MGCAddSnippet(201, "The negative timing constraint algorithm of the simulator looks for a set of delays such that the data net is valid when the clock or control nets transition and the timing checks are satisfied. ");
MGCAddSnippet(202, "By default, the simulator performs timing checks on inputs specified in the timing check. You can use the +delayed_timing_checks argument with the vsim command to perform timing checks on the delayed inputs.");
MGCAddSnippet(203, "Minimize the use of zero-delay output schedules of gate-level cells without requiring the use of the ifnone construct with the vsim -glspath simuconddc argument.");
MGCAddSnippet(204, "You can specify the way the simulator handles negative timing checks, including conditional negative timing checks, to achieve the best timing results.");
MGCAddSnippet(205, "The Verilog Language Reference Manual IEEE Std 1800-2009. section 10.6.2, states that the left-hand side of a force statement cannot be a bit-select or part-select. Questa deviates from the LRM standard by supporting forcing of bit-selects, part-selects, and field-selects in your source code. The right-hand side of these force statements cannot be a variable. ");
MGCAddSnippet(206, "The simulator supports several arguments that are equivalent to Verilog-XL arguments make it easier to port a design to the Questa SIM simulator. ");
MGCAddSnippet(207, "the Questa SIM simulator recognizes and maintains Verilog escaped identifier syntax. ");
MGCAddSnippet(208, "In Tcl, the backslash is one of a number of characters that have a special meaning. ");
MGCAddSnippet(209, "Many ASIC and FPGA vendors  Verilog cell libraries are compatible with Questa SIM Verilog. ");
MGCAddSnippet(210, "Questa SIM Verilog supports timing annotation from Standard Delay Format (SDF) files. ");
MGCAddSnippet(211, "Verilog models can contain both distributed delays and path delays. Distributed delays appear on primitives, UDPs, and continuous assignments; path delays are the port-to-port delays specified in specify blocks. These delays interact to determine the actual delay observed. Most Verilog cells use path delays exclusively, with no distributed delays specified.");
MGCAddSnippet(212, "The Verilog standard (LRM, IEEE Std 1364‑2005) states that if a module contains both path delays and distributed delays, then the larger of the two delays for each path shall be used (Section 14.4). This is the default behavior of the Questa SIM simulator.");
MGCAddSnippet(213, "In distributed delay mode, the specify path delays are ignored in favor of the distributed delays. You can specify this delay mode with the +delay_mode_distributed compiler argument or the `delay_mode_distributed compiler directive.");
MGCAddSnippet(214, "In path delay mode, the distributed delays are set to zero in any module that contains a path delay. You can specify this delay mode with the +delay_mode_path compiler argument or the `delay_mode_path compiler directive. ");
MGCAddSnippet(215, "In unit delay mode, the nonzero distributed delays are set to one unit of simulation resolution (determined by the minimum time_precision argument in all  timescale directives in your design or the value specified with the -t argument to vsim), and the specify path delays and timing constraints are ignored. You can specify this delay mode with the +delay_mode_unit compiler argument or the `delay_mode_unit compiler directive.");
MGCAddSnippet(216, "In zero delay mode, the distributed delays are set to zero, and the specify path delays and timing constraints are ignored. You can specify this delay mode with the +delay_mode_zero compiler argument or the `delay_mode_zero compiler directive. ");
MGCAddSnippet(217, "The ability to approximate metastability for Verilog gate-level designs is useful for simulating synchronizer flops used to synchronize inputs from one clock domain to another, and allows a known random state to be latched when timing between domains is violated. ");
MGCAddSnippet(218, "This topic explains how to resolve racing conditions that you may encounter when moving between optimized and unoptimized cells with zero delays.");
MGCAddSnippet(219, "SystemVerilog system tasks and functions are built into the simulator, although some designs depend on user-defined system tasks implemented with the various programming and procedural interfaces. ");
MGCAddSnippet(220, "The following system tasks and functions are supported by Questa SIM and are described more completely in the Language Reference Manual (LRM) for SystemVerilog, IEEE Std 1800‑2012. ");
MGCAddSnippet(221, "The type name string returned by $typename() does not include class, struct and enum members, nor any class extensions. ");
MGCAddSnippet(222, "The $coverage_* functions allow SystemVerilog code to control and query coverage information, including assertions.");
MGCAddSnippet(223, "Implementation of the $coverage_save() SystemVerilog system function is compliant with the IEEE1800 standard. Calls to the SystemVerilog $coverage_save() function that worked in version 10.0 and earlier do not work in version 10.1 and higher, and will fail compilation checks. ");
MGCAddSnippet(224, "The IEEE 1800-2012 LRM does not clearly indicate what should happen when the argument for the $clog2() function contains 'X' or 'Z' values.");
MGCAddSnippet(225, "There are several system tasks and functions that are specific to Questa SIM, which are not included in the IEEE Std 1364, nor are they likely supported in other simulators. Their use may limit the portability of your code.");
MGCAddSnippet(226, "The $coverage_save_mti() system function saves only Code Coverage information to a file during a batch run. The batch run typically terminates with the $finish call. ");
MGCAddSnippet(227, "The $get_initial_random_seed system function returns the value of the initial random seed. ");
MGCAddSnippet(228, "The $messagelog system task allows you to create a message using text and specifiers.");
MGCAddSnippet(229, "The $psprintf() system function behaves like the $sformat() file I/O task, except that the string result is passed back to the user as the function return value for $psprintf(), and is not placed in the first argument as for $sformat(). Thus, you can use $psprintf() where a string is valid. Note that at this time, unlike other system tasks and functions, $psprintf() cannot be overridden by a user-defined system function in the PLI. ");
MGCAddSnippet(230, "This task is a  cleanup  function that removes internal buffers, called MIPDs, that have a delay value of zero. These MIPDs are inserted in response to the -v2k_int_delay argument for the vsim command. In general, the simulator automatically removes all zero delay MIPDs. However, if you have $sdf_annotate() calls in your design that are not getting executed, the zero-delay MIPDs are not removed. Adding the $sdf_done task after your last $sdf_annotate() removes any zero-delay MIPDs that have been created. ");
MGCAddSnippet(231, "Produces a call stack trace back from the point where the call is made. A successful $stacktrace() call returns a non-zero value, a failed call returns zero (0). ");
MGCAddSnippet(232, "This Verilog system task specifies variables to be logged in the current simulation's WLF file (default, vsim.wlf) and is called from within a Verilog design. It is equivalent to the Verilog system task $dumpvars, except it dumps values to the current simulation's WLF file instead of a VCD file. While it can not be called directly from within VHDL, it can log VHDL variables contained under a Verilog scope that is referenced by $wlfdumpvars. The modelsim.ini variable WildcardFilter will be used to filter types when a scope is logged by $wlfdumpvars. Multiple scopes and variables are specified as a comma separated list.");
MGCAddSnippet(233, "Strict compliance with the Language Reference Manual IEEE Std 1364 requires that all hierarchical task and function names have parentheses  ()  following the name to call the task or function. In Questa SIM 10.3 and later you may use hierarchical task and function names without parentheses. ");
MGCAddSnippet(234, "Questa SIM supports a number of Verilog-XL specific system tasks and functions.");
MGCAddSnippet(235, "The following supported system tasks and functions, though not part of the IEEE standard, are described in an annex of the IEEE Std 1364.");
MGCAddSnippet(236, "Some system tasks are also provided for compatibility with Verilog-XL, though they are not described in the IEEE Std 1364.");
MGCAddSnippet(237, "Additional functionality has been added to the $fopen, $setuphold, and $recrem system tasks.");
MGCAddSnippet(238, "The $fopen systemtask has been extended to create a new directory path if the path does not currently exist. ");
MGCAddSnippet(239, "The $setuphold and $recrem system tasks have been extended to provide additional functionality for negative timing constraints and an alternate method of conditioning, as in Verilog-XL. ");
MGCAddSnippet(240, "The following system tasks are Verilog-XL system tasks that are not implemented in Questa SIM Verilog, but have equivalent simulator commands. ");
MGCAddSnippet(241, "This group of functions are not a part of the SystemVerilog LRM. However, the Questa SIM simulator supports their use, unless you include the -pedanticerrors argument to vlog, in which case you will receive an error.");
MGCAddSnippet(242, "The Questa SIM simulator support of SystemVerilog includes all of the compiler directives defined in the IEEE Std 1800, some Verilog-XL compiler directives, and some that are proprietary.");
MGCAddSnippet(243, "The simulator supports SystemVerilog compiler directives, which are described in detail in the IEEE Std 1364. ");
MGCAddSnippet(244, "The `protect/`endprotect vlog directives are specific to the Questa SIM simulator and are not compatible with other simulators.");
MGCAddSnippet(245, "The Questa SIM simulator supports a number of compiler directives that are compatible with Verilog-XL. ");
MGCAddSnippet(246, "Questa SIM simulation allows you to model digital mixed-signal (DMS) behavior by supporting the constructs for modeling real numbers provided by both Verilog‑AMS and SystemVerilog. ");
MGCAddSnippet(247, "Verilog-AMS HDL is derived from IEEE Std 1364-2005. The definition and semantics of Verilog-AMS are provided by Accellera Systems Initiative in the Verilog-AMS Language Reference Manual. ");
MGCAddSnippet(248, "Modeling connectivity in an analog mixed-signal design entails several issues to be considered. ");
MGCAddSnippet(249, "Nets and ports of type wreal, and arrays of wreal are supported for SystemVerilog. The net data type of wreal represents a real-valued connection between structural entities—driver values on wreal nets are real numbers (as opposed to logic levels on wires). Like wires, a wreal net may have multiple drivers. ");
MGCAddSnippet(250, "To determine the effective value of multiple real values on a wreal net, Questa SIM passes wreal drivers on a network through a resolution function. You can select which function is used by specifying a value for the -wreal_resolution argument of the vsim command. ");
MGCAddSnippet(251, "Using wreal for SystemVerilog nets can include the use of structural vs. behavioral nets and wire as interconnect and hierarchical references. ");
MGCAddSnippet(252, "Sparse memories are a mechanism for allocating storage for memory elements only when they are needed. You mark which memories should be treated as sparse, and Questa SIM dynamically allocates memory for the accessed addresses during simulation.");
MGCAddSnippet(253, "You can enable sparse memories manually by inserting attributes or meta-comments in your code.");
MGCAddSnippet(254, "You can mark memories in your code as sparse using either the mti_sparse attribute or the sparse meta-comment. ");
MGCAddSnippet(255, "Using the SparseMemThreshold modelsim.ini variable, you can instruct Questa SIM to mark as sparse any memory that is a certain size. ");
MGCAddSnippet(256, "Because mti_sparse is a Verilog 2001 attribute that accepts values, you can enable automatic sparse memory modeling but still control individual memories within your code. ");
MGCAddSnippet(257, "The Questa SIM simulator labels memories as sparse or not sparse according to priority.");
MGCAddSnippet(258, "You can identify which memories were implemented as sparse with the write report command.");
MGCAddSnippet(259, "You can use either of two methods to initialize a sparse memory.");
MGCAddSnippet(260, "The use of sparse memories has some specific limitations.");
MGCAddSnippet(261, "The [1800-2012 SV] LRM does not address the relationship between interfaces as design elements and virtual interfaces as types. The Questa SIM flow allows virtual interfaces to exist even when the underlying interface design unit does not exist, even in the design libraries.");
MGCAddSnippet(262, "Questa SIM supports the use of several interfaces.");
MGCAddSnippet(263, "The Questa SIM simulator supports partial implementation of the Verilog VPI.");
MGCAddSnippet(264, "The Questa SIMsimulator supports various extensions to the SystemVerilog DPI.");
MGCAddSnippet(265, "Debugging your design starts with an understanding of how the design is put together; the hierarchy, the environments, the class types. The Questa SIM debug environment gives you a number of avenues for exploring your design, finding the areas of the design that are causing trouble, pinpointing the specific part of the code that is at fault, making the changes necessary to fix the code, then running the simulation again.");
MGCAddSnippet(266, "You can enable visibility of class instances in your design in two ways.");
MGCAddSnippet(267, "The Class Instance Identifier (CIID or Handle) is a unique name for every class instance created during a simulation. ");
MGCAddSnippet(268, "You can use the examine -handle command to return the CIID to the transcript. ");
MGCAddSnippet(269, "You can use the built in system function $get_id_from_handle( class_ref )  to obtain the string representing the class instance id for the specified class reference. ");
MGCAddSnippet(270, "You must log class variables, class types, or class instances in order to view them in the Wave and List windows, and to view them post-simulation. The data recorded depends on the type of class object you log. ");
MGCAddSnippet(271, "You can view the class types in your design in the Class Tree, Class Graph, Structure, and other windows. ");
MGCAddSnippet(272, "Questa SIM maintains two representations for class names: the authoritative class type name and the descriptive class type name.  This name mapping is specifically to support parameterized class specializations.");
MGCAddSnippet(273, "Authoritative names are used in most places in the user interface. They are also used as input to commands that take a class type argument.");
MGCAddSnippet(274, "Descriptive names more closely resemble the class definition, can be very long and difficult to read and parse. ");
MGCAddSnippet(275, "The <class_type> can be specified using the specific class type name or any path that resolves to the class type. ");
MGCAddSnippet(276, "You can view class types in several windows, including the Structure, Class Tree, and Class Graph windows.");
MGCAddSnippet(277, "The Class Tree window displays the class inheritance tree in various forms. You can expand objects to see parent/child relationships, properties, and methods. You can organize by extended class (default) or base class. ");
MGCAddSnippet(278, "The Class Graph window displays interactive relationships between SystemVerilog classes in a graphical form and includes extensions of other classes and related methods and properties. ");
MGCAddSnippet(279, "The Structure window displays the class types in your design. You must select a class type in the Structure window to view that class type s instances in the Class Instances window. ");
MGCAddSnippet(280, "Viewing class instances is helpful for finding class, OVM, and UVM components or subtypes that have been instantiated. ");
MGCAddSnippet(281, "The Class Instances window displays information about all instances of a selected class type that exist at the current simulation time. ");
MGCAddSnippet(282, "There is a suggested workflow for logging SystemVerilog class objects in the Wave window. ");
MGCAddSnippet(283, "The Locals window displays data objects that are immediately visible at the current execution point of the selected context. ");
MGCAddSnippet(284, "The Watch window displays signal or variable values at the current simulation time. It enables you to view a subset of local or class variables when stopped on a breakpoint. ");
MGCAddSnippet(285, "The Capacity-Object and Capacity-Line windows show data about current memory allocation. You can use them to find areas where memory usage is causing problems, and to display count, memory usage, and other information. ");
MGCAddSnippet(286, "The Call Stack window enables you to view your design when you are stopped at a breakpoint. You can go up the call stack to see the locals context at each stage of your design. ");
MGCAddSnippet(287, "A class path expression is a hierarchical path through a class hierarchy.");
MGCAddSnippet(288, "Class path expressions require a specific syntax.");
MGCAddSnippet(289, "You can add a class path expression to the Wave window with the add wave command. ");
MGCAddSnippet(290, "A class path expression can have one of several possible values.");
MGCAddSnippet(291, "You can cast a class variable to any of the class types that have been assigned to that class variable. The default is the declared type of the class variable.");
MGCAddSnippet(292, "By default, the user interface interprets paths that include class references as path expressions. There are cases where the interpreted object is what is desired and not the path expression.");
MGCAddSnippet(293, "Setting the MTI_DISABLE_PATHEXPR environment variable disables the interpretations of all class path expressions. This is equivalent to the behavior in version 10.2 and earlier.");
MGCAddSnippet(294, "Set a breakpoint or a conditional breakpoint at any place in your source code.");
MGCAddSnippet(295, "Stepping through your design is helpful once you have pinpointed the area of the design where you think there is a problem. In addition to stepping to the next line, statement, function or procedure, you have the ability to step within the current context (process or thread). This is helpful when debugging class based code since the next step may take you to a different thread or section of your code rather than to the next instance of a class type. ");
MGCAddSnippet(296, "To quickly and easily run to a specific line of code, you can use the  Run Until Here  feature. When you invoke Run Until Here, the simulation runs from the current simulation time and stops on the specified line of code.");
MGCAddSnippet(297, "You can enter commands on the command line in the Transcript window to interact with class instances. ");
MGCAddSnippet(298, "The examine command returns current values for classes or variables to the transcript while debugging. The examine command can help you debug by displaying the name of a class instance or the field values for a class instance before setting a conditional breakpoint.");
MGCAddSnippet(299, "Use the describe command to display data members, properties, methods, tasks, inheritance, and other information about class instances, and print it in the transcript window.");
MGCAddSnippet(300, "The call command calls SystemVerilog static functions and class functions directly from the Vsim command line in live simulation mode and Verilog interface system tasks and system functions. ");
MGCAddSnippet(301, "The classinfo commands give you high level information about the class types and class instances in your design. ");
MGCAddSnippet(302, "The classinfo descriptive command returns the descriptive class type name, given the authoritative class type name. ");
MGCAddSnippet(303, "The classinfo find command searches the currently active dataset for the state of the specified Class Instance Identifier; whether it exists, has not yet been created, or has been destroyed. You can specify an alternate dataset for the search and save the results of the search to a text file or to the transcript as a tcl string. ");
MGCAddSnippet(304, "The classinfo instances command reports the list of existing class instances for a specific class type. This can be useful in determining what class instances to log or examine. It can also help in debugging problems resulting from class instances not being cleaned up as they should be and causing run-away memory usage. ");
MGCAddSnippet(305, "The classinfo report command prints detailed statistics about class instances.");
MGCAddSnippet(306, "The classinfo stats command reports statistics about the total number of class types and total, peak, and current class instance counts during the simulation.");
MGCAddSnippet(307, "The classinfo trace command displays the active references to the specified class instance. This is useful in debugging situations where class instances are not being destroyed as expected because something in the design is still referencing the class instance. Finding those references can lead to uncovering bugs in managing these class references, which can lead to large memory savings.");
MGCAddSnippet(308, "The classinfo ancestry command shows the inheritance of a specific class type. With some designs and methodologies, class hierarchy can become quite deep. This command shows all of the super classes of a class type, back to its base class. ");
MGCAddSnippet(309, "The classinfo command lists the classes derived from the specified class type. When one class (X) extends another class (Y), class X inherits the characteristics of class Y. Class X, therefore, is a class Y. Class X is also a class X, of course. Class Y, however, is not a class X.");
MGCAddSnippet(310, "The classinfo types command searches for and analyses class types by matching a regular expression. Returns the inheritance hierarchy for classes, class extensions, and determines the full path of class types.");
MGCAddSnippet(311, "As your simulation run progresses, it creates and destroys class instances and stores the data in memory. Though a class instance ceases to be referenced, the data for that instance is retained in memory. The garbage collector (GC) deletes all un-referenced class objects from memory. ");
MGCAddSnippet(312, "Automatic execution of the garbage collector is dependent upon how your design is simulated.");
MGCAddSnippet(313, "You can change the default garbage collector settings for the current simulation in the Garbage Collector Configuration dialog box, on the command line, via modelsim.ini variables, or with vsim command arguments. ");
MGCAddSnippet(314, "You can run the garbage collector at any time.");
MGCAddSnippet(315, "OVM-aware debugging provides you, the verification or design engineer, with information, at the OVM abstraction level, that connects you to the OVM base-class library. ");
MGCAddSnippet(316, "This section describes the steps you must take to enable the OVM-aware debugging features in your OVM environment.");
MGCAddSnippet(317, "This section describes OVM-aware debugging tasks you can perform on your OVM environment.");
MGCAddSnippet(318, "If your OVM environment is in a state where there are blocking calls, the OVM Globals window contains a tree labeled Blockers. ");
MGCAddSnippet(319, "For a given OVM component you can view which get configurations have a matching set configuration, and vice versa.");
MGCAddSnippet(320, "This section describes the four OVM windows you can use during OVM-aware debug. The contents of these windows change as you advance through the simulation.");
MGCAddSnippet(321, "The OVM Globals window contains information that is not specific to an OVM component. Specifically it contains information about phases, barriers and blockers. ");
MGCAddSnippet(322, "The OVM Hierarchy window contains hierarchical information about your OVM environment.");
MGCAddSnippet(323, "The OVM Components window contains information about the specific component.");
MGCAddSnippet(324, "The OVM Sequence window contains textual information about the selected sequence and its current state.");
MGCAddSnippet(325, "UVM-Aware Debug provides information at the UVM abstraction level that connects you to the UVM base-class library. ");
MGCAddSnippet(326, "This section describes the steps you must take to compile the UVM libraries and the UVM-Aware Debug features together with your UVM testbench.");
MGCAddSnippet(327, "At design elaboration time, the simulator automatically detects the use of the ufm_pkg in your source code, and automatically pulls in the UVM DPI library and the questa_uvm_pkg. No special options are required. By default, the simulator pulls in UVM component hierarchy information to populate the Structure window. The simulation results do not change due to randomization issues, whether UVM debugging is turned on or off. The simulation results match between debug and non-debug mode. ");
MGCAddSnippet(328, "You can view UVM design units, component hierarchy, configuration database objects, and transaction streams in the GUI. ");
MGCAddSnippet(329, "The Structure window provides you with a hierarchical view of all UVM design components in your design.");
MGCAddSnippet(330, "You can view macros and expanded macros once your simulation has loaded by opening a source file and hovering your cursor over a declaration in the source code.");
MGCAddSnippet(331, "The UVM Details window displays information about UVM objects you select in the Structure window.");
MGCAddSnippet(332, "You can use the Processes window to display a class instance ID and UVM components with the UVM full name as well as the full path.");
MGCAddSnippet(333, "You can access, organize and analyze any UVM_INFO messages (shown in Questa SIM as Notes), Warnings, Errors, or other elaboration and runtime messages during the simulation run.");
MGCAddSnippet(334, "The UVM has the capability to automatically record transactions. The automation records a sequence execution as a transaction, and records a sequence item as a transaction. The execution of the sequence body() is the recorded transaction for a sequence, and the start_item/finish_item pair is the recorded transaction for a sequence item. If the body of a sequence consumes no time, then a zero time transaction is recorded. If the start_item/finish_item pair consumes no time, then a zero time transaction is recorded.");
MGCAddSnippet(335, "You can set breakpoints on UVM instances and function entrances. ");
MGCAddSnippet(336, "The bp command accepts UVM-style instance names for setting source breakpoints for class instances in a UVM hierarchy. You control this when the -inst <instance_name> argument is preceded by a -uvm argument.");
MGCAddSnippet(337, "The bp in command accepts function and task names to support a  stop in function entrance  capability. This allows you to set a breakpoint without needing the precise file and line number of a given function. The bp command places a breakpoint on the first executable line of the specified task or function.");
MGCAddSnippet(338, "Questa SIM allows you to set a breakpoint on a UVM Hierarchical instance by right-clicking a sequence in the Sequence mode of the UVM Details window.");
MGCAddSnippet(339, "Questa SIM provides a number of commands for use with UVM test benches.");
MGCAddSnippet(340, "Your installation of Questa SIM includes the UVM Framework, which provides a code base that you can use to implement a UVM verification infrastructure, interconnect, and operation environment. ");
MGCAddSnippet(341, "When a simulation enters a zero delay loop, and the iteration count exceeds the iteration limit setting, autofindloop (vsim –autofindloop) attempts to detect the loop and to create a report describing it. When possible, the report identifies the active processes and event and signal activity. ");
MGCAddSnippet(342, "This chapter describes how to compile and simulate SystemC designs with the Questa SIM simulator. The simulator implements the SystemC language based on the Open SystemC Initiative (OSCI) proof-of-concept SystemC simulator. The default supported version of SystemC is the IEEE 1666-2011 standard, SystemC-2.3.2. Release 2.3.2 of SystemC includes Release 2.0.3 of Transaction Level Modeling (TLM) code. It is recommended that you obtain the OSCI functional specification or the latest version of the IEEE Std 1666-2011, IEEE Standard SystemC Language Reference Manual.");
MGCAddSnippet(343, "SystemC runs on a subset of Questa SIM supported platforms. ");
MGCAddSnippet(344, "The gcc configuration for Questa SIM has been qualified only for default options. If you use advanced gcc configuration options, Questa SIM may not work with those options. ");
MGCAddSnippet(345, "Questa SIM allows users to simulate SystemC, either alone or in combination with other VHDL/Verilog modules. ");
MGCAddSnippet(346, "Generally, your design should include sc_main() at the top level in order for Questa SIM to run the SystemC/C++ source code. Questa SIM executes sc_main() as a thread process. This allows you to use test bench code and C++ variables (including SystemC primitive channels, ports, and modules) inside sc_main(). ");
MGCAddSnippet(347, "Simulating with sc_main at the top level of your design can be accomplished as described here.");
MGCAddSnippet(348, "Generally, if a design contains one or more SystemC modules, the checkpoint and restore feature is disabled for the entire design. However, with some SystemC modules, you can use the ‑scchkpntrestore argument of the vsim command to allow checkpoint and restore.");
MGCAddSnippet(349, "The simulator has the ability to create intermediate shared object files for SystemC. These intermediate shared object files can then be linked together to create the final shared object file for simulation use.");
MGCAddSnippet(350, "The SystemVerilog bind construct allows you to bind a Verilog or SystemVerilog design unit to a SystemC module.");
MGCAddSnippet(351, "Certain restrictions apply to actual expressions when you bind to SystemC targets. If the target of a bind is a SystemC module or an instance of a SystemC module, expressions and literals are not supported as actuals.");
MGCAddSnippet(352, "This section describes several methods you can use to distribute your SystemC IP for others to use in a Questa SIM environment.");
MGCAddSnippet(353, "The process of compiling the SystemC files contained in your design consists of several steps. ");
MGCAddSnippet(354, "Use vlib to create a new library in which to store the compilation results. For example:");
MGCAddSnippet(355, "SystemC templates are not supported as top level or boundary modules. For SystemC designs, you must export all top level modules in your design to Questa SIM. To accomplish this, use the SC_MODULE_EXPORT(<sc_module_name>) macro. ");
MGCAddSnippet(356, "Questa SIM compiles one or more SystemC design units with a single invocation of sccom, the SystemC compiler. The design units are compiled in the order that they appear on the command line.");
MGCAddSnippet(357, "Questa SIM can distribute the sccom compilation.You can instruct the compiler to run the specified source files in parallel on multiple cores of a single machine (the current machine running sccom) using the -j <value> option, where <value> is the maximum number of processes to be run in parallel.");
MGCAddSnippet(358, "By default, sccom invokes the C++ compiler (g++ or aCC) without any optimizations. If desired, you can enter any g++/aCC optimization arguments at the sccom command line.");
MGCAddSnippet(359, "Mentor Graphics recommends using the version of g++ that is shipped with Questa SIM on its various supported platforms.");
MGCAddSnippet(360, "Use the sccom command to retrieve information about the GNU compiler to be used for compilation.");
MGCAddSnippet(361, "If you intend to simulate on both Questa SIM and the OSCI proof-of-concept SystemC simulator, you can use the MTI_SYSTEMC macro to execute the Questa SIM specific code in your design only when running Questa SIM. Sccom defines this macro by default during compile time. ");
MGCAddSnippet(362, "When compiling complex C/C++ test bench environments, it is common to compile code with many separate runs of the compiler. Often, you may compile code into archives (.a files), and then link the archives at the last minute using the -L and -l link options.");
MGCAddSnippet(363, "The rules governing when and how you must use sccom are as follows.");
MGCAddSnippet(364, "You can use the standalone g++ compiler to help with migration from a non-Questa SIM environment, like OSCI-SystemC where existing make files using g++ already exist, or for creating compile scripts that have to work with and without Questa SIM. ");
MGCAddSnippet(365, "You can use sccom -incr to enable automatic incremental compilation so that only changed files are compiled. This allows Questa SIM to determine which source files have changed and recompile only those source files. ");
MGCAddSnippet(366, "Using a C++ template for a SystemC module has restrictions regarding location, member function visibility to the compiler, and template specialization for SystemC verification (SCV). ");
MGCAddSnippet(367, "Templatized SystemC modules are not supported for use in the following locations:");
MGCAddSnippet(368, "Suppose you have a class template, and it contains a certain number of member functions. All those member functions must be visible to the compiler when it compiles any instance of the class. ");
MGCAddSnippet(369, "The data introspection for SystemC verification (SCV) depends on partial template specialization of a template called scv_extensions. This template extends data objects with the abstract interface scv_extensions_if. Each specialization of the scv_extensions template implements the scv_extensions_if interface in a way appropriate to the type in the template parameter. ");
MGCAddSnippet(370, "This section explains the rules for generating SCV extensions for user-specified types such as structures, unions, classes, and enums. ");
MGCAddSnippet(371, "Note the following set of rules for generating a SCV extensions for a structure or class. ");
MGCAddSnippet(372, "Note the following set of rules for generating a SCV extensions for enumerated types.");
MGCAddSnippet(373, "The OSCI-SCV library has been modified to support Mentor Dynamic Extensions, which allow the following: ");
MGCAddSnippet(374, "The open SCV API supports the following macros for creating constraint data expression initializers data member fields of a user-defined constraint, based on a derivation of class scv_constraint_base: ");
MGCAddSnippet(375, "The data type for standard vectors (std::vector) has a data introspection capability in the same way that fixed arrays and other primitive data types do. This means you can define SCV extensions for vectors by specifying scv_extensions< vector > in a manner similar to what is supported for arrays: scv_extensions< T[N] >. ");
MGCAddSnippet(376, "This randomly sized  fixed-max  feature for array types was originally provided to test preliminary implementations of randomization support for the std::vector data type. However, it is also useful feature for randomization of the number of elements in an array up to a fixed maximum size denoted by the template N parameter of scv_extensions< T[N] >.");
MGCAddSnippet(377, "Once the design has been compiled, you must link it using the sccom command with the -link argument.");
MGCAddSnippet(378, "After compiling the SystemC source code, you can use the vsim command to simulate your design.");
MGCAddSnippet(379, "You can debug SystemC designs using all the debugging features of Questa SIM, with the exception of the Dataflow and Schematic windows. You must have compiled the design using the sccom -g argument in order to debug the SystemC objects in your design. ");
MGCAddSnippet(380, "Types (<type>) of the objects which may be viewed for debugging are the following:");
MGCAddSnippet(381, "Objects which may be viewed in SystemC for debugging purposes are as shown in the following table.");
MGCAddSnippet(382, "Waveform compare supports the viewing of SystemC signals and variables. You can compare SystemC objects to SystemC, Verilog or VHDL objects.");
MGCAddSnippet(383, "In order to debug your SystemC source code, you must compile the design for debug using the ‑g C++ compiler option.");
MGCAddSnippet(384, "You can set breakpoints in constructors and destructors of SystemC objects. Constructor breakpoints need to be set before the SystemC shared library is loaded. ");
MGCAddSnippet(385, "You can set breakpoints using Cdebug Init mode.");
MGCAddSnippet(386, "You can set breakpoints using the automated constructor breakpoint mode.");
MGCAddSnippet(387, "To set a SystemC breakpoints so it applies only to a specified instance, use the -inst argument to the bp command.");
MGCAddSnippet(388, "You can view and expand SystemC objects in the Objects window and processes in the Processes pane. ");
MGCAddSnippet(389, "This section contains information on how Questa SIM displays certain objects and types, as they may differ from other simulators.");
MGCAddSnippet(390, "Globals and statics are supported for Questa SIM debugging purposes, however some additional naming conventions must be followed to make them viewable.");
MGCAddSnippet(391, "Questa SIM supports aggregates of SystemC signals or ports. Three types of aggregates are supported: structures, classes, and arrays. Unions are not supported for debug. An aggregate of signals or ports will be shown as a signal of aggregate type. For example, an aggregate such as:");
MGCAddSnippet(392, "Questa SIM supports SystemC dynamic module arrays. ");
MGCAddSnippet(393, "In Questa SIM, the values contained in an sc_fifo appear in a definite order. The top-most or left-most value is always the next to be read from the FIFO. Elements of the FIFO that are not in use are not displayed.");
MGCAddSnippet(394, "The Questa SIM tool detects and displays SystemC memories. A memory is defined as any member variable of a SystemC module which is defined as an array of the following type: ");
MGCAddSnippet(395, "If you declare a pointer as a base class pointer, but actually assign a derived class object to it, Questa SIM still treats it as a base class pointer instead of a derived class pointer, as you intended. As such, it would be unavailable for debug. To make it available for debug, you must use the mti_set_typename member function to instruct that it should be treated as a derived class pointer.");
MGCAddSnippet(396, "Questa SIM offers a string-based debug solution for various simulation objects that are considered undebuggable by the SystemC compiler command, sccom. ");
MGCAddSnippet(397, "If your design does not have sc_main() at the top level, you must apply several modifications to your original SystemC source code. ");
MGCAddSnippet(398, "If your design does not have sc_main() at the top level, in order for Questa SIM to run the SystemC/C++ source code, you must replace the control function of sc_main() with a constructor, SC_CTOR(), placed within a module at the top level of the design.");
MGCAddSnippet(399, "Questa SIM uses the run command and its options in place of the sc_start() function. If sc_main() has multiple sc_start() calls mixed in with the test bench code, then use an SC_THREAD() with wait statements to emulate the same behavior. ");
MGCAddSnippet(400, "vsim calls sc_initialize() by default at the end of elaboration, so calls to sc_initialize() are unnecessary.");
MGCAddSnippet(401, "You can modify sc_main in a number of ways, which are demonstrated in the examples in this section.");
MGCAddSnippet(402, "Questa SIM is based upon the OSCI proof-of-concept SystemC simulator. However, there are some minor but key differences to be aware of.");
MGCAddSnippet(403, "The implementation details related to OSCI SystemC 2.3.2 release are provided in this section. ");
MGCAddSnippet(404, "OSCI SystemC 2.3.2 release has an integrated TLM implementation (not distributed as a separate release). If you are using TLM implementation not supplied with SystemC 2.3.2 release (older than TLM 2.0.2 release), you need to add the ‑DSC_DISABLE_VIRTUAL_BIND argument during compilation in order for it to work with SystemC-2.3.2. ");
MGCAddSnippet(405, "Several SystemC-2.3.2 features are not supported with the Questa SIM simulator.");
MGCAddSnippet(406, "Several backwards compatibility issues exist between SystemC 2.3.2 and SystemC 2.3.0.");
MGCAddSnippet(407, "The implementation details related to OSCI SystemC 2.2 release are provided in this section. ");
MGCAddSnippet(408, "Questa SIM includes the header files and examples from the OSCI SystemC TLM (Transaction Level Modeling) Library, Release 2.0.1. The TLM library can be used with simulation, and requires no extra switches or files. TLM objects are not debuggable, with the exception of tlm_fifo.");
MGCAddSnippet(409, "The following functions are supported for phase callbacks:");
MGCAddSnippet(410, "Several global functions allow you to gain access to command-line arguments.");
MGCAddSnippet(411, "When encountered during the simulation run in command line mode, the sc_stop() function stops the current simulation and causes Questa SIM to exit. ");
MGCAddSnippet(412, "The information in this section applies only to SystemC signals, ports, variables, or fifos that use one of the following fixed-point types: ");
MGCAddSnippet(413, "In the process of modifying your SystemC design to run on Questa SIM, you may encounter several common errors. This section highlights some actions you can take to correct such errors.");
MGCAddSnippet(414, "If your SystemC simulation behaves in otherwise unexplainable ways, you should determine whether you need to adjust the stack space Questa SIM allocates for threads in your design. The required size for a stack depends on the depth of functions on that stack and the number of bytes they require for automatic (local) variables.");
MGCAddSnippet(415, "When simulating your SystemC design, you might get a  failed to load sc lib  message because of an undefined symbol, looking something like this:");
MGCAddSnippet(416, "Questa SIM allows you to simulate designs that are written in VHDL, SystemC, Verilog, and SystemVerilog. While design units must be entirely of one language type, any design unit may instantiate other design units from another language. Any instance in the design hierarchy may be a design unit from another language without restriction. ");
MGCAddSnippet(417, "Simulating mixed-language designs with Questa SIM consists of a few basic steps. The actions you take for each step in the flow depend on which languages your design units are written in and where they are in the design hierarchy. ");
MGCAddSnippet(418, "Depending on the language of your design units, you need to use the appropriate compilation command before running a simulation on the mixed-language design. ");
MGCAddSnippet(419, "Note that VHDL and Verilog observe different rules for case sensitivity. ");
MGCAddSnippet(420, "Questa SIM supports the IEEE 1076-2008 standard  external name  syntax that allows you to make hierarchical references from VHDL to VHDL. Currently, these references can cross Verilog boundaries, but they must begin and end in VHDL. ");
MGCAddSnippet(421, "You cannot directly read or change a SystemC object with a hierarchical reference within a mixed-language design. Further, you cannot directly access a Verilog/SystemVerilog object up or down the hierarchy if there is an interceding SystemC block. ");
MGCAddSnippet(422, "The SystemVerilog bind construct allows you to bind a Verilog design unit to another Verilog design unit or to a VHDL design unit or to a SystemC module. This is especially useful for binding SystemVerilog assertions to your SystemC, VHDL, Verilog and mixed-language designs during verification. ");
MGCAddSnippet(423, "To bind a SystemVerilog assertion module to a VHDL design, the syntax of the bind statement is:");
MGCAddSnippet(424, "The following list provides examples of bindings you can make.");
MGCAddSnippet(425, "Questa SIM supports hierarchical references to VHDL Objects from a Verilog/SystemVerilog scope.");
MGCAddSnippet(426, "All SystemVerilog data types supported at the SystemVerilog-VHDL boundary are supported while binding to VHDL target scopes. This includes hierarchical references in actual expressions if they terminate in a VHDL scope. ");
MGCAddSnippet(427, "The SystemVerilog bind statement, when using the vopt command, is fully compatible with IEEE Std1800-2009 (the SystemVerilog Language Reference Manual). ");
MGCAddSnippet(428, "SystemVerilog infers an enumeration concept similar to VHDL enumerated types. In VHDL, the enumerated names are assigned to a fixed enumerated value, starting left-most with the value 0. In SystemVerilog, you can also explicitly define the enumerated values. As a result, you can use the bind construct for port mapping of VHDL enumerated types to Verilog port vectors. ");
MGCAddSnippet(429, "You can use the SystemVerilog bind statement to tie an assertion to VHDL design units that are defined by generate or configuration statements. ");
MGCAddSnippet(430, "If the target of a bind is a SystemC module or an instance of a SystemC module, expressions and literals are not supported as actuals. ");
MGCAddSnippet(431, "The vopt command performs global optimizations to improve simulator performance. You run vopt on the top-level design unit. ");
MGCAddSnippet(432, "In a mixed-language design with only one top-level design unit, the resolution for simulation time of the top design unit is applied to the whole design. ");
MGCAddSnippet(433, "The Questa SIM simulator is compliant with all pertinent Language Reference Manuals for each language of a mixed-language design. ");
MGCAddSnippet(434, "Hierarchical references to SystemVerilog properties and sequences are supported with the following restrictions. ");
MGCAddSnippet(435, "A SystemC signal (including sc_signal, sc_buffer, sc_signal_resolved, and sc_signal_rv) can control or observe an HDL signal using two member functions of sc_signal: ");
MGCAddSnippet(436, "You can use the scv_connect() API function to connect a SystemC signal (including sc_signal, sc_buffer, sc_signal_resolved, and sc_signal_rv) to an HDL signal. ");
MGCAddSnippet(437, "Cross-language (HDL) instantiation does not require additional effort on your part. As Questa SIM loads a design, it detects cross-language instantiations because it can determine the language type of each design unit as it is loaded from a library. Questa SIM then performs the necessary adaptations and data type conversions automatically. ");
MGCAddSnippet(438, "Verilog or SystemVerilog instantiations of VHDL may associate Verilog nets and values with VHDL ports and generics. ");
MGCAddSnippet(439, "VHDL instantiations of Verilog or SystemVerilog may associate VHDL ports and generics with Verilog nets and values. ");
MGCAddSnippet(440, "SystemC design units are interconnected by using hierarchical and primitive channels. An sc_signal<> is one type of primitive channel. ");
MGCAddSnippet(441, "SystemC has a more complex signal-level interconnect scheme than VHDL. Design units are interconnected with hierarchical and primitive channels. An sc_signal<> is one type of primitive channel. The following section discusses how various SystemC channel types map to VHDL types when connected to each other across the language boundary.");
MGCAddSnippet(442, "Once you have generated a component declaration for a Verilog module, you can instantiate the component just like any other VHDL component. You can reference a Verilog module in the entity aspect of a component configuration—all you need to do is specify a module name instead of an entity name. You can also specify an optional secondary name for an optimized sub-module. ");
MGCAddSnippet(443, "A Verilog design unit may be instantiated within VHDL if it meets the following criteria:");
MGCAddSnippet(444, "A Verilog module that is compiled into a library can be referenced from a VHDL design as though the module is a VHDL entity. Likewise, a Verilog configuration can be referenced as though it were a VHDL configuration. ");
MGCAddSnippet(445, "The vgencomp command generates a component declaration according to the following rules. ");
MGCAddSnippet(446, "Modules that have bidirectional pass switches (tran primitives) internally connected to their ports are not fully supported when the module is instantiated by VHDL. This is due to limitations imposed by the requirements of VHDL signal resolution. ");
MGCAddSnippet(447, "Verilog allows modules to have unnamed ports, whereas VHDL requires that all ports have names. If any of the Verilog ports are unnamed, then all are considered to be unnamed, and it is not possible to create a matching VHDL component. In such cases, the module may not be instantiated from VHDL.");
MGCAddSnippet(448, "You can reference a VHDL entity or configuration from Verilog or SystemVerilog as though the design unit is a module or a configuration of the same name. ");
MGCAddSnippet(449, "You can instantiate a VHDL design unit within Verilog or SystemVerilog if it meets the following criteria: ");
MGCAddSnippet(450, "An entity name is not case-sensitive in Verilog instantiations. The entity default architecture is selected from the work library unless specified otherwise. Since instantiation bindings are not determined at compile time in Verilog, you must instruct the simulator to search your libraries when loading the design. ");
MGCAddSnippet(451, "Port associations may be named or positional. Use the same port names and port positions that appear in the entity. ");
MGCAddSnippet(452, "Generic associations are provided via the module instance parameter value list. List the values in the same order that the generics appear in the entity. Parameter assignment to generics is not case sensitive. ");
MGCAddSnippet(453, "A mixed VHDL/Verilog design can also be annotated with SDF. ");
MGCAddSnippet(454, "You can use shared VHDL packages for both VHDL and Verilog/SystemVerilog. Each usage takes a different VHDL construct. ");
MGCAddSnippet(455, "With the  import  construct of SystemVerilog, you can implement user-defined types (records, enums, aliases, subtypes, types, and multi-dimensional arrays) and constants from VHDL in a SystemVerilog design. (Any other user-defined types are not supported.) ");
MGCAddSnippet(456, "With the  use  construct of VHDL, you can implement user-defined types (structures, enums, and multi-dimensional arrays) from SystemVerilog in a VHDL design. (Any other user-defined types are not supported.) ");
MGCAddSnippet(457, "To instantiate Verilog or SystemVerilog modules into a SystemC design, you must first create a SystemC foreign module declaration for each Verilog/SystemVerilog module. Once you have created the foreign module declaration, you can instantiate the foreign module just like any other SystemC module. ");
MGCAddSnippet(458, "A Verilog/SystemVerilog design unit may be instantiated within SystemC if it meets the following criteria:");
MGCAddSnippet(459, "In cases where you want to run a mixed simulation with SystemC and Verilog/SystemVerilog, you must generate and declare a foreign module that stands in for each Verilog module instantiated under SystemC. ");
MGCAddSnippet(460, "Because the SystemC language has no concept of parameters, parameterized values must be passed from a SystemC parent to a Verilog child through the SystemC foreign module (sc_foreign_module). ");
MGCAddSnippet(461, "You can reference a SystemC module from Verilog/SystemVerilog as though the design unit is a module of the same name.");
MGCAddSnippet(462, "A SystemC module can be instantiated in Verilog/SystemVerilog if it meets the following criteria:");
MGCAddSnippet(463, "To be able to instantiate a SystemC module from Verilog/SystemVerilog (or use a SystemC module as a top level module), the module must be exported.");
MGCAddSnippet(464, "You can pass and retrieve parameter values from a Verilog parent and a SystemC child using Verilog override syntax. ");
MGCAddSnippet(465, "To instantiate VHDL design units into a SystemC design, you must first generate a SystemC foreign module declaration for each VHDL design unit you want to instantiate. ");
MGCAddSnippet(466, "A VHDL design unit may be instantiated from SystemC if it meets the proper criteria.");
MGCAddSnippet(467, "In cases where you want to run a mixed simulation with SystemC and VHDL, you must create and declare a foreign module that stands in for each VHDL design unit instantiated under SystemC. You can create the foreign modules in one of two ways: ");
MGCAddSnippet(468, "Since the SystemC language has no concept of generics, generic values must be passed from a SystemC parent to an HDL child through the SystemC foreign module (sc_foreign_module). ");
MGCAddSnippet(469, "To instantiate SystemC in a VHDL design, you must create a component declaration for the SystemC module. Once you have generated the component declaration, you can instantiate the SystemC component just like any other VHDL component. ");
MGCAddSnippet(470, "You can instantiate a SystemC design unit within VHDL if it meets the following criteria:");
MGCAddSnippet(471, "A SystemC design unit can be referenced from a VHDL design as though it is a VHDL entity. The interface to the design unit can be extracted from the library in the form of a component declaration by running vgencomp. Given a library and a SystemC module name, vgencomp writes a component declaration to standard output.");
MGCAddSnippet(472, "The vgencomp command generates a component declaration according to the following rules. ");
MGCAddSnippet(473, "To be able to instantiate a SystemC module within VHDL (or use a SystemC module as a top level module), the module must be exported.");
MGCAddSnippet(474, "When you have a VHDL or Verilog module instantiating a SystemC module and want to pass generic information between the two levels, you must add custom macros to your SystemC module for registering and initializing the generic information.");
MGCAddSnippet(475, "SystemC designs can communicate with SystemVerilog through a procedural interface, the SystemVerilog Direct Programming Interface (DPI). In contrast to a hierarchical interface, where communication is advanced through signals and ports, DPI communications consists of task and function calls passing data as arguments. This type of interface can be useful in transaction level modeling, in which bus functional models are widely used.");
MGCAddSnippet(476, "The following terms are used in this section. ");
MGCAddSnippet(477, "The usage flow of SystemC DPI depends on the function modes, whether they are import or export. The import and export calls described here can be mixed with each other in any order. ");
MGCAddSnippet(478, "In order to make a SystemC import function callable from SystemVerilog, it needs to be registered from the SystemC code before it can be called from SystemVerilog. This can be thought of as exporting the function outside SystemC, thus making it callable from other languages. The registration must be done by passing a pointer to the function using an API. The registration can be done anywhere in the design but it must be done before the call happens in SystemVerilog, otherwise the call fails with undefined behavior. ");
MGCAddSnippet(479, "Unless an export call is made from an import function, you must set the scope of the export function explicitly to provide the SystemVerilog context information to the simulator. You do this by calling svSetScope() before each export function or task call. ");
MGCAddSnippet(480, "The SystemVerilog package  mti_scdpi  must be imported if a SystemC data type is used in the arguments of import and export functions.");
MGCAddSnippet(481, "A SystemC function prototype header file is automatically generated for each SystemVerilog compilation. By default, this header file is named sc_dpiheader.h. This header file contains the C function prototype statements consistent with the  DPI-SC  import/export function/task declarations. You can include this file in the SystemC source files where the prototypes are needed for SystemC compiles and use this file as a sanity check for the SystemC function arguments and return type declaration in the SystemC source files.");
MGCAddSnippet(482, "By default, only the DPI-SC usage in the current work library is processed at the SystemC link time. If you use additional SystemVerilog libraries that import or export SystemC DPI routines, the names of these libraries must be provided to the sccom command at link time using the‑dpilib argument. ");
MGCAddSnippet(483, "The following example shows how to create a top Verilog module that uses a simple file (hello.v) as input for a direct programming interface (DPI) to SystemC. ");
MGCAddSnippet(484, "Questa SIM allows you to use advanced simulation techniques to control and speed the simulation process.");
MGCAddSnippet(485, "The checkpoint and restore commands allow you to save and restore the simulation state within the same invocation of vsim or between vsim sessions. ");
MGCAddSnippet(486, "Several items are saved with the checkpoint command, and restored with the restore command. ");
MGCAddSnippet(487, "There are a few items upon which checkpoint/restore does not work.");
MGCAddSnippet(488, "Questa SIM allows you to determine whether the checkpoint file is compressed or uncompressed. The checkpoint file is normally compressed. ");
MGCAddSnippet(489, "The restart command resets the simulator to time zero, clears out any logged waveforms, and closes any files opened under VHDL and the Verilog $fopen system task. You can get the same effect by first doing a checkpoint at time zero and later doing a restore. Using restart, however, is likely to be faster and you do not have to save the checkpoint. To set the simulation state to anything other than time zero, you need to use checkpoint/restore. ");
MGCAddSnippet(490, "The restart command resets and restarts the simulation kernel, and zeros out any user-defined commands, but it does not touch the state of the macro interpreter. This lets you perform restart commands within macros.");
MGCAddSnippet(491, "If you are checkpointing foreign C code (FLI/PLI/VPI/DPI) that works with heap memory, use mti_Malloc() rather than raw malloc() or new. This guarantees the correct restoration of any memory allocated with mti_Malloc() is. When you allocate any memory with raw malloc() the simulator will not restore it correctly and a simulator crash may result.");
MGCAddSnippet(492, "In general you can invoke a checkpoint command only when the simulation is stopped. If you need to checkpoint without stopping the simulation, you need to write a script that utilizes the when command and variables from your code to trigger a checkpoint. The example below shows how this might be done with a simple Verilog design. ");
MGCAddSnippet(493, "The Questa SIM compiler generates a library format that is compatible across platforms. This means the simulator can load your design on any supported platform without having to recompile first. Though this architecture offers a benefit, it also comes with a possible disadvantage: the simulator has to generate platform-specific code every time you load your design. This affects the speed with which the design is loaded.");
MGCAddSnippet(494, "In many cases design loading time is not that important. For example, if you a re doing  iterative design,  where you simulate the design, modify the source, recompile and resimulate, the load time is just a small part of the overall flow. However, if your design is locked down and only the test vectors are modified between runs, loading time may have a significant effect on overall simulation time, particularly for large designs loading SDF files.");
MGCAddSnippet(495, "Elaboration file creation uses the same vsim settings or switches as a normal simulation plus an elaboration-specific argument. The elaboration file retains the simulation settings and dictates subsequent simulation behavior. You can modify some of these simulation settings at the time of loading the elaboration file, as detailed below.");
MGCAddSnippet(496, "By default the elaboration file will load in command-line mode or interactive mode depending on the argument (-c or -i) used during elaboration file creation. If no argument was used during creation, the -load_elab argument will default to the interactive mode.");
MGCAddSnippet(497, "A primary use of elaboration files is to simulate the same design multiple times using a different stimulus. ");
MGCAddSnippet(498, "PLI models do not require special code to function with an elaboration file as long as the model does not create simulation objects in its standard tf routines. The sizetf, misctf and checktf calls that occur during elaboration are played back at -load_elab to ensure the PLI model is in the correct simulation state. Registered user tf routines called from the Verilog HDL will not occur until -load_elab is complete and the PLI model's state is restored.");
MGCAddSnippet(499, "The simulator provides several commands to manage the propagation of X values that occur in RTL simulation (for both Verilog and VHDL models). These commands enable you to modify the simulation behavior so that it corresponds more closely to the silicon behavior. ");
MGCAddSnippet(500, "When you use xprop functionality to remove X-optimism, the removal mainly affects a limited set of Verilog or VHDL constructs used in the design. ");
MGCAddSnippet(501, "Questa SIM provides several features to control the propagation of X values. ");
MGCAddSnippet(502, "The simulator supports error detection and reporting related to X propagation.");
MGCAddSnippet(503, "Examples of X propagation can be divided into two categories; RTL x-optimism examples and RTL x-pessimism examples.");
MGCAddSnippet(504, "The goal of the simulator is to support X propagation management for synthesizable constructs of SystemVerilog and VHDL, but there are certain limitations and restrictions. ");
MGCAddSnippet(505, "Transactions provide a powerful means for debugging complex verification environments by giving you a high level view into your design. ");
MGCAddSnippet(506, "In order to understand transactions, you must also understand several underlying concepts.");
MGCAddSnippet(507, "A transaction is a statement of what the design is doing between one time and another during a simulation run. ");
MGCAddSnippet(508, "You create/record transactions through the Verilog/VHDL or SystemC API calls placed in your design source code.");
MGCAddSnippet(509, "Questa SIM records transactions on streams, much as it records values on wires and signals. Streams are debuggable objects that you can add to GUI windows such as the Objects or Wave windows. ");
MGCAddSnippet(510, "The simulator displays transactions in the Wave, List, and Object windows. The Wave window displays transactions unlike any other objects in the GUI. ");
MGCAddSnippet(511, "The simulator displays transactions consistently across all debugging windows and panes. ");
MGCAddSnippet(512, "The Structure windows allow you to navigate through the regions in the design, which is similar to using the env command in command line mode. ");
MGCAddSnippet(513, "The Wave window is where transactions can be viewed most effectively.");
MGCAddSnippet(514, "Retroactive recording refers to the recording of a transaction whose start and/or end time occurs before the current simulation time. ");
MGCAddSnippet(515, "You can select transactions or streams in the Wave window; or if the transactions are recorded with relations, from a pop-up menu.");
MGCAddSnippet(516, "You can customize the appearance of a transaction instance, or change the look of the entire transaction stream at debug time. You can apply these custom settings to either the current Wave window or all Wave windows. ");
MGCAddSnippet(517, "Customizing the color in the Wave window overrides colors set with add_color() (in the design code) during simulation ");
MGCAddSnippet(518, "You can use the GUI (or the tr order command) to change the order of transaction attributes and hide/show attributes in the stream.");
MGCAddSnippet(519, "You can use the List window to view transactions when you do not need to view transaction relationships.");
MGCAddSnippet(520, "Use the Objects window to view transactions— but not transaction streams.");
MGCAddSnippet(521, "In order to access attributes of transactions for debugging, you must know the full path to the specific stream, substream, or attribute you wish to access. After you set the path to the transaction, you can use Tcl commands and scripts to analyze your transactions.");
MGCAddSnippet(522, "The SystemVerilog and System C transactions discussed are distinct from the Verification IP transactions.");
MGCAddSnippet(523, "You must record SystemVerilog or SystemC transactions before you can view them in Questa SIM. ");
MGCAddSnippet(524, "Rules and guidelines apply to all transaction recording, regardless of the language in which the transaction is recorded. ");
MGCAddSnippet(525, "You must provide names for streams so they can be referenced for debug. ");
MGCAddSnippet(526, "When your design creates a stream, logging is enabled for that stream providing that logging is enabled at the simulation time when the design calls ::begin_transaction(). The effective start time of the transaction (the time passed by the design as a parameter to ::begin transaction()) does not affect the logging of the stream.");
MGCAddSnippet(527, "Each transaction created during simulation is assigned a 64-bit serial number. This serial number, along with the logical name of the dataset in which the transaction exists, comprises the transaction s unique identifier (UID). Within the simulation run, this number is unique. ");
MGCAddSnippet(528, "On any single transaction stream, Questa SIM associates an attribute name with a data type. ");
MGCAddSnippet(529, "Your design can set the same attribute (same type) many times during a single transaction. However, Questa SIM records only the most recently set value at the end of the transaction.");
MGCAddSnippet(530, "Questa SIM requires every transaction attribute to have a name. It is possible, however, to omit the name in the SystemC Verification (SCV) and Verilog/VHDL APIs for transaction recording. The simulator resolves the problem by inventing a name for the attribute.");
MGCAddSnippet(531, "In Questa SIM, a relationship is a pointer from one instance in the design to another. ");
MGCAddSnippet(532, "Any transaction has a life cycle that can be summarized in four distinct phases.");
MGCAddSnippet(533, "Global or static transaction handles remain in memory during a simulation, resulting in loss of memory. ");
MGCAddSnippet(534, "The procedures for recording transactions depend on the language you are using. ");
MGCAddSnippet(535, "Because there is currently no standard for transaction recording in Verilog or VHDL, Questa SIM includes a set of system tasks to perform transaction recording into a WLF file. ");
MGCAddSnippet(536, "This API code example of a recorded transaction is distributed with Questa SIM, and can be found in the following location of your installation directory <install_dir>/examples/systemverilog/transactions/simple.");
MGCAddSnippet(537, "If there is an error on a call to create_transaction_stream() or begin_transaction(), the handle returned will have the value zero.");
MGCAddSnippet(538, "Use the SystemC Verification (SCV) library s transaction recording API routines to define transactions, to start them, to end them, to create relationships between them, and to attach additional information (attributes) to them.");
MGCAddSnippet(539, "Before transactions can be recorded, the design must initialize the SCV library once, as part of its own initialization. ");
MGCAddSnippet(540, "Using Standard C and SystemC types for attributes enable transaction generators without additional preparation with SystemC Verification (SCV).");
MGCAddSnippet(541, "The steps for recording SystemC Verification (SCV) transactions require you to define a transaction stream, start a transaction, record special attributes, specify transaction start and end times, and end the transaction.");
MGCAddSnippet(542, "This SCV API code example is distributed with Questa SIM and can be found in the following location of your installation directory: install_dir/examples/systemc/transactions/simple");
MGCAddSnippet(543, "There are a couple limitations to SystemC and transaction recording.");
MGCAddSnippet(544, "A number of CLI commands are available for debugging your transactions.");
MGCAddSnippet(545, "System tasks are necessary for writing transactions for Verilog and VHDL API.");
MGCAddSnippet(546, "The add_attribute system task adds an attribute to a transaction.");
MGCAddSnippet(547, "The add_color system task is used to specify color on a per-transaction basis. By using information available to the design, this task sets the color from within the design to highlight different kinds of commands and error conditions. ");
MGCAddSnippet(548, "The add_relation system task adds a relation from the source transaction to the target transaction. ");
MGCAddSnippet(549, "The begin_transaction system task begins a transaction on the specified stream. ");
MGCAddSnippet(550, "The create_transaction_stream system task creates a transaction stream that you can use to record transactions. ");
MGCAddSnippet(551, "The delete_transaction system task removes a transaction from the transaction database. The transaction is not recorded in the WLF file. ");
MGCAddSnippet(552, "The end_transaction system task ends the specified transaction. ");
MGCAddSnippet(553, "The free_transaction system task frees a transaction and allows the memory allotted for this transaction to be freed. The handle will no longer be valid. Attributes can no longer be recorded for the transaction. Relations can no longer be made with the transaction. ");
MGCAddSnippet(554, "This chapter provides a brief introduction to Questa Verification IP transactions in Questa SIM, and discusses additional features of the Questa SIM GUI available when simulating a model that includes Questa Verification IP(s). ");
MGCAddSnippet(555, "A Questa Verification IP is a model used to verify a protocol or interface. These models bridge the gap between RTL, TLM, and system-level verification by using a hierarchy of transactions to create a link between different TLM and RTL abstraction levels. Questa Verification IPs include stimulus generation, reference checking and coverage measurements and are available for popular protocols and standard interfaces as part of the Questa Verification IP Library. ");
MGCAddSnippet(556, "A Questa Verification IP transaction is unique in that it represents communication at multiple levels of abstraction. ");
MGCAddSnippet(557, "Transactions can be viewed in several GUI windows.");
MGCAddSnippet(558, "The display of Questa Verification IP transactions in Questa SIM differs from  normal  (SystemC or SystemVerilog) transactions. Designs containing Questa Verification IPs can display transactions of many different object kinds. ");
MGCAddSnippet(559, "Questa Verification IP objects can be declared as arrays in specific protocols. Questa Verification IP arrays are created by the developer, solely for the sake of convenience, and do not have any effect on the behavior of the objects themselves. In other words, an element of an array is not aware of, nor is it affected by, any other element of the same array. ");
MGCAddSnippet(560, "The advantage of viewing Questa Verification IP transactions in the Wave window is that it allows you to easily view the relationships between transactions and the signals/wires that comprise them. ");
MGCAddSnippet(561, "When viewing transactions within a Questa Verification IP, the color of the transaction object indicates what caused it to exist. ");
MGCAddSnippet(562, "Multiple transactions recorded on a single stream at one time are known as concurrent transactions. They appear as overlapping in the Wave window.");
MGCAddSnippet(563, "Questa Verification IP protocols may create arrays of streams with one or more dimensions. In the wave window, these behave much like other array objects. Expanding the parent reveals the next level of detail and each sub-level name is the appropriate index value. ");
MGCAddSnippet(564, "Questa Verification IP stream arrays slightly modify the generic color scheme. This section explains how they are different.");
MGCAddSnippet(565, "Use the Objects window to browse the available objects in order to log them or add them to the Wave window.");
MGCAddSnippet(566, "Use the List window to view the values of all selected design elements at each time or delta advance. The list window allows for the easy creation of tabular reports for transactions.");
MGCAddSnippet(567, "Debugging of Verification IP transactions can be Questa Verification IP objects appear as transactions or signals in the Wave window, depending on the type of the object being displayed.");
MGCAddSnippet(568, "Relationships for Questa Verification IP transaction objects can be viewed by selecting them in the usual way, by clicking on an object in the Wave window. As well as highlighting related transactions, selecting a single instance of a Questa Verification IP object also highlights any related signal activity. Signals are highlighted for only the period of time that they are taking part in the selected transaction. You can also select a signal to highlight the transactions that are using that signal at that specific time.");
MGCAddSnippet(569, "The Transaction window displays information about a selected Questa Verification IP transaction instance. The window has an upper pane, called the main pane, and a lower pane with up to three tabs: the Data tab, the Relations tab, and the State History tab (if State History Logging is enabled).");
MGCAddSnippet(570, "Use the Transaction View window to look at the details of a transaction.");
MGCAddSnippet(571, "Use the Transaction Stream window to look at the details of an individual transaction stream.");
MGCAddSnippet(572, "You can update contents of the Transaction window, including transaction name in the label of the window, with data from a new instance.");
MGCAddSnippet(573, "This chapter describes how to save the results of a Questa SIM simulation and use them in your simulation flow. In general, any recorded simulation data that has been loaded into Questa SIM is called a dataset. ");
MGCAddSnippet(574, "If you add objects to the debugging windows in the graphic interface, or log objects with the log command, the results of each simulation run are automatically saved to a WLF file called vsim.wlf in the current directory.");
MGCAddSnippet(575, "Dataset Snapshot lets you periodically copy data from the current simulation WLF file to another file. This is useful for taking periodic  snapshots  of your simulation or for clearing the current simulation WLF file based on size or elapsed time.");
MGCAddSnippet(576, "By default, memories are not saved in the WLF file when you issue a  log -r /*  command. ");
MGCAddSnippet(577, "There are a number of WLF file parameters that you can control via the modelsim.ini file or a simulator argument. ");
MGCAddSnippet(578, "You can easily limit the WLF file size by setting a simulation control variable or with a vsim command switch.");
MGCAddSnippet(579, "Questa SIM allows you to open existing datasets.");
MGCAddSnippet(580, "Each dataset you open creates a structure tab in the Main window. The tab is labeled with the name of the dataset and displays a hierarchy of the design units in that dataset.");
MGCAddSnippet(581, "Structural information about datasets is presented in the Structure window.");
MGCAddSnippet(582, "Questa SIM allows you to manage multiple datasets using menu selections from the graphic interface or from the command line.");
MGCAddSnippet(583, "When you have one or more datasets open, you can manage them using the Dataset Browser. ");
MGCAddSnippet(584, "You can open multiple datasets when the simulator is invoked by specifying more than one vsim -view <filename> option. By default the dataset prefix will be the filename of the WLF file. ");
MGCAddSnippet(585, "You can turn dataset prefix viewing on or off by setting the value of a preference variable called DisplayDatasetPrefix. Setting the variable value to 1 displays the prefix, setting it to 0 does not. It is set to 1 by default. ");
MGCAddSnippet(586, "By default Questa SIM collapses delta steps. This means each logged signal that has events during a simulation delta has its final value recorded to the WLF file when the delta has expired. The event order in the WLF file matches the order of the first events of each signal.");
MGCAddSnippet(587, "Virtual objects are signal-like or region-like objects created in the GUI that do not exist in the Questa SIM simulation kernel.");
MGCAddSnippet(588, "Virtual signals are aliases for combinations or subelements of signals written to the WLF file by the simulation kernel. They can be displayed in the Objects, List, Watch, and Wave windows, accessed by the examine command, and set using the force command. ");
MGCAddSnippet(589, "Virtual functions behave in the GUI like signals but are not aliases of combinations or elements of signals logged by the kernel. They consist of logical operations on logged signals and can be dependent on simulation time. ");
MGCAddSnippet(590, "User-defined design hierarchy regions can be defined and attached to any existing design region or to the virtuals context tree. They can be used to reconstruct the RTL hierarchy in a gate-level design and to locate virtual signals. Thus, virtual signals and virtual regions can be used in a gate-level design to allow you to use the RTL test bench.");
MGCAddSnippet(591, "User-defined enumerated types can be defined in order to display signal bit sequences as meaningful alphanumeric names. The virtual type is then used in a type conversion expression to convert a signal to values of the new type. When the converted signal is displayed in any of the windows, the value will be displayed as the enumeration string corresponding to the value of the original signal.");
MGCAddSnippet(592, "The Wave window is the most commonly used tool for analyzing and debugging your design after simulation. It displays all signals in your design as waveforms and signal values and provides a suite of graphical tools for debugging. ");
MGCAddSnippet(593, "The Wave window opens in the Main window. Like all other windows, it may be undocked from the Main window by clicking the Undock button in the window header. When the Wave window is docked in the Main window, all menus and icons that were in the undocked Wave window move into the Main window menu bar and toolbar tabs.");
MGCAddSnippet(594, "The list below identifies the types of objects that you can view in the Wave window. Each object type is indicated by its own color-coded shape (such as a diamond or a triangle). ");
MGCAddSnippet(595, "You can add objects to the Wave window with mouse actions, menu selections, commands, and with a window format file.");
MGCAddSnippet(596, "New signals are inserted above the Insertion Point Bar located at the bottom of the Pathname Pane. You can change the location of the Insertion Point Bar by using the Insertion Point Column of the Pathname Pane.");
MGCAddSnippet(597, "Cursors mark simulation time in the Wave window. When Questa SIM first draws the Wave window, it places one cursor at time zero. Clicking anywhere in the waveform display brings the nearest cursor to the mouse location. You can use cursors to find transitions, a rising or falling edge, and to measure time intervals. ");
MGCAddSnippet(598, "To add cursors when the Wave window is active you can do one of the following.");
MGCAddSnippet(599, "After adding a cursor, you can alter its properties by using the Cursor Properties dialog box.");
MGCAddSnippet(600, "You can move the active (selected) cursor to the next or previous transition on the selected signal using these two toolbar icons located in the Debug Toolbar Tab. Refer to the following table.");
MGCAddSnippet(601, "Questa SIM uses cursors to measure time in the Wave window. Cursors extend a vertical line over the waveform display and identify a specific simulation time. ");
MGCAddSnippet(602, "You can synchronize the active cursors within all open Wave windows and the Wave viewers in the Dataflow and Schematic windows. ");
MGCAddSnippet(603, "Cursors within the Wave window can be linked together, allowing you to move two or more cursors together across the simulation timeline. You simply click one of the linked cursors and drag it left or right on the timeline. The other linked cursors will move by the same amount of time. ");
MGCAddSnippet(604, "The following list describes how cursors behave when you click in various panes of the Wave window unless you are in Two Cursor Mode:");
MGCAddSnippet(605, "There are a number of useful keyboard and mouse shortcuts related to the actions listed above:");
MGCAddSnippet(606, "Two Cursor Mode places two active cursors in the Wave window. Where default Wave window cursor behavior is for the closest cursor to snap to the location of the mouse when the left mouse button is pressed, in Two Cursor Mode the left mouse button controls movement of the first cursor and the middle mouse button controls the second cursor regardless of the proximity of the pointer to the closest cursor. Additional cursors may be added but are locked upon insertion. ");
MGCAddSnippet(607, "You can enable Two Cursor Mode by selecting WaveMouse ModeTwo Cursor Mode, or by selecting the Two Cursor Mode button in the Debug Toolbar Tab. ");
MGCAddSnippet(608, "Both cursors snap to the position of the mouse pointer when the mouse button controlling the cursor is released. Holding down a button and dragging changes the action from cursor placement to zooming in or out in the waveform pane: ");
MGCAddSnippet(609, "When analyzing a design using Questa SIM, you can see a value for each object at any time step in the simulation. If logged in the .wlf file, the values at any time step prior to and including the current simulation time are displayed in the Wave window or by using the examine command.");
MGCAddSnippet(610, "The following list provides definitions of the basic terms used when discussing expanded time in the Wave window.");
MGCAddSnippet(611, "You can use the vsim command, or the WLFCollpseMode variable in the modelsim.ini file, to control recording of expanded time information in the .wlf file.");
MGCAddSnippet(612, "Expanded time information is displayed in the Debug Toolbar Tab, the right portion of the Messages bar, the Waveform pane, the time axis portion of the Cursor pane, and the Waveform pane horizontal scroll bar as described below.");
MGCAddSnippet(613, "As noted above, the Wave window background color is blue instead of black for expanded sections in Delta Time mode and green for expanded sections in Event Time mode.");
MGCAddSnippet(614, "There are three Wave window expanded time display modes: Event Time mode, Delta Time mode, and Expanded Time off. These display modes are initiated by menu selections, toolbar selections, or via the command line.");
MGCAddSnippet(615, "The following table shows the menu selections for initiating expanded time display modes.");
MGCAddSnippet(616, "There are three exclusive toggle buttons in the Debug Toolbar Tab for selecting the time mode used to display expanded simulation time in the Wave window.");
MGCAddSnippet(617, "The command syntax for selecting the time mode used to display objects in the Wave window is:");
MGCAddSnippet(618, "If one or more simulation time steps have already been expanded to view event time or delta time, then toggling the Time mode by any means will cause all of those time steps to be redisplayed in the newly selected mode.");
MGCAddSnippet(619, "Simulation time may be expanded to view delta time steps or event time steps at a single simulation time or over a range of simulation times. Simulation time may be collapsed to hide delta time steps or event time steps at a single simulation time or over a range of simulation times. You can expand or collapse the simulation time with menu selections, toolbar selections, via commands, or with the mouse cursor.");
MGCAddSnippet(620, "The Wave window can expand time to show delta delays. You can use the examine, searchlog, and seetime commands to manipulate expanded time data.");
MGCAddSnippet(621, "Zooming lets you change the simulation range in the waveform pane. You can zoom using the context menu, toolbar buttons, mouse, keyboard, or commands. You can also save a specific zoom range and scroll position with Wave window bookmarks.");
MGCAddSnippet(622, "You can access Zoom commands in any of the following ways: ");
MGCAddSnippet(623, "Bookmarks save a particular zoom range and scroll position. This lets you return easily to a specific view later. You save the bookmark with a name and then access the named bookmark from the Bookmark menu. Bookmarks are saved in the Wave format file and are restored when the format file is read.");
MGCAddSnippet(624, "Once a bookmark exists, you can change its properties by selecting WaveBookmarksBookmarks if the Wave window is docked; or by selecting ToolsBookmarks if the Wave window is undocked.");
MGCAddSnippet(625, "The Wave window provides two methods for locating objects:");
MGCAddSnippet(626, "The search command lets you search for transitions or values on selected signals. When you select Edit > Signal Search, the Wave Signal Search dialog appears. ");
MGCAddSnippet(627, "The Expression Builder is a feature of the Wave Signal Search dialog box. You can use it to create a search expression that follows the GUI_expression_format, save an expression to a Tcl variable and use it in the Expression Builder to perform a search, and search for when a signal reaches a particular value. ");
MGCAddSnippet(628, "You can create a search expression that follows the GUI_expression_format. ");
MGCAddSnippet(629, "Clicking the Save button in the Expression Builder will save the expression to a Tcl variable. Once saved, this variable can be used in place of the expression. For example, say you save an expression to the variable  foo.  Here are some operations you could do with the saved variable:");
MGCAddSnippet(630, "You can use the Expression Builder to search for when a signal reaches a particular value.");
MGCAddSnippet(631, "You can use the Expression Builder to evaluate search expressions only on clock edges.");
MGCAddSnippet(632, "The Wave window includes a filtering function that allows you to filter the display to show only the desired signals and waveforms. ");
MGCAddSnippet(633, "The primary tool for formatting the Wave Window to fit your environment is the Wave Window Preferences dialog box.");
MGCAddSnippet(634, "You can set Wave window display preferences by selecting WaveWave Preferences (when the window is docked) or ToolsWindow Preferences (when the window is undocked). ");
MGCAddSnippet(635, "You can set how many elements of the object path display by changing the Display Signal Path value in the Wave Window Preferences dialog. ");
MGCAddSnippet(636, "You can set the default behavior for double-clicking a waveform in the Wave window. ");
MGCAddSnippet(637, "You can set the timeline of the Wave window to count clock cycles rather than elapsed time. ");
MGCAddSnippet(638, "You can adjust various object properties to create the view you find most useful. ");
MGCAddSnippet(639, "One common adjustment is changing the radix (base) of selected objects in the Wave window. When you right-click a selected object, or objects, and select Properties from the popup menu, the Wave Properties dialog appears. ");
MGCAddSnippet(640, "The Global Signal Radix feature allows you to change the radix for a selected object or objects in the Wave window and in every other window where the object appears.");
MGCAddSnippet(641, "Dividers serve as a visual aid for debugging, allowing you to separate signals and waveforms for easier viewing. In the graphic below, a bus is separated from the two signals above it with a divider called  Bus. ");
MGCAddSnippet(642, "The pathnames, values, and waveform panes of the Wave window display can be split to accommodate signals from one or more datasets.");
MGCAddSnippet(643, "You can create a wave group to collect arbitrary groups of items in the Wave window. Wave groups have the following characteristics: ");
MGCAddSnippet(644, "There are three ways to create a wave group.");
MGCAddSnippet(645, "If you have already added some signals to the Wave window, you can create a group of signals using the following procedure.");
MGCAddSnippet(646, "You can select a signal and create a group that contains the input signals to the process that drives the selected signal.");
MGCAddSnippet(647, "Add grouped signals to the Wave window from the command line use the following procedure.");
MGCAddSnippet(648, "If you have already added some signals to the Wave window, you can create a group of signals using the following procedure.");
MGCAddSnippet(649, "If a wave group is selected and cut or deleted the entire group and all its contents will be removed from the Wave window. ");
MGCAddSnippet(650, "There are three ways to add items to an existing wave group.");
MGCAddSnippet(651, "You can use any of the following methods to remove an item from a wave group.");
MGCAddSnippet(652, "Dragging a wave group from the Wave window to the List window will result in all of the items within the group being added to the List window.");
MGCAddSnippet(653, "You can create a composite signal or bus from arbitrary groups of items in the Wave window. Composite signals have the following characteristics: ");
MGCAddSnippet(654, "If you have already added some signals to the Wave window, you can create a composite signal or bus using the following procedure.");
MGCAddSnippet(655, "By default, all Wave window information is lost once you close the window. If you want to restore the window to a previously configured layout, you must save a window format file with the following procedure.");
MGCAddSnippet(656, "This section describes ways to save or print information from the Wave window. ");
MGCAddSnippet(657, "You can export the current view of the Wave window to a Bitmap (.bmp) image with the following procedure.");
MGCAddSnippet(658, "You can export the contents of the Wave window to a Postscript (.ps) or Extended Postscript file with the following procedure.");
MGCAddSnippet(659, "You can print the contents of the Wave window to a networked printer with the following procedure.");
MGCAddSnippet(660, "You can choose one or more objects or signals in the waveform pane and save a section of the generated waveforms to a separate WLF file for later viewing. Saving selected portions of the waveform pane allows you to create a smaller dataset file. ");
MGCAddSnippet(661, "You can save a waveform section between two cursors.");
MGCAddSnippet(662, "Call up and view saved waveform sections with the following procedure.");
MGCAddSnippet(663, "You can save a portion of your waveforms in a simulation that has multiple cursors set. The new dataset will start and end at the times indicated by the two cursors chosen, even if the time span includes another cursor. ");
MGCAddSnippet(664, "The suggested workflow for viewing SystemVerilog class objects in the Wave window is as follows.");
MGCAddSnippet(665, "You can log and display scalar and array virtual interface values in the Wave and List windows. ");
MGCAddSnippet(666, "You can perform the following actions with virtual interfaces:");
MGCAddSnippet(667, "You can add the real interfaces that are referenced by a virtual interface.");
MGCAddSnippet(668, "You can combine signals in the Wave window into buses. A bus is a collection of signals concatenated in a specific order to create a new virtual signal with a specific value.");
MGCAddSnippet(669, "You can create a new bus containing a slice of a selected bus using the following procedure. This action uses the virtual signal command.");
MGCAddSnippet(670, "Use the WaveExtract/Pad Slice menu selection to open the Wave Extract/Pad Bus dialog box.");
MGCAddSnippet(671, "You can split a bus into several equal-sized buses using the following procedure. This action uses the virtual signal command.");
MGCAddSnippet(672, "You can create, modify, and combine virtual signals and virtual functions and add them to the Wave window with the Virtual Signal Builder dialog box.Virtual signals are also added to the Objects window and can be dragged to the List, and Watch windows once they have been added to the Wave window. ");
MGCAddSnippet(673, "Use the following procedure to create a virtual signal with the Virtual Signal Builder.");
MGCAddSnippet(674, "The Wave window allows you to perform a wide variety of tasks, from examining waveform values, to displaying signal drivers and readers, to sorting objects.");
MGCAddSnippet(675, "You can use your mouse to display a dialog that shows the value of a waveform at a particular time. ");
MGCAddSnippet(676, "You can display the drivers of a signal selected in the Wave window in the Dataflowor the Schematic window. ");
MGCAddSnippet(677, "You can easily sort objects in the Wave window.");
MGCAddSnippet(678, "Questa SIM supports both signal (that is, when conditions) and file-line breakpoints. Breakpoints can be set from multiple locations in the GUI or from the command line.");
MGCAddSnippet(679, "Signal breakpoints ( when  conditions) instruct Questa SIM to perform actions when the specified conditions are met. For example, you can break on a signal value or at a specific simulator time. When a breakpoint is hit, a message in the Main window transcript identifies the signal that caused the breakpoint.");
MGCAddSnippet(680, "Questa SIM allows you to set a breakpoint with a simple command line instruction.");
MGCAddSnippet(681, "Signal breakpoints are most easily set in the Objects and Wave windows. ");
MGCAddSnippet(682, "You can easily modify the signal breakpoints you have created. ");
MGCAddSnippet(683, "You set file-line breakpoints on executable lines in your source files. ");
MGCAddSnippet(684, "Questa SIM allows you to set a file-line breakpoint with a simple command line instruction.");
MGCAddSnippet(685, "File-line breakpoints are most easily set using your mouse in the Source window.");
MGCAddSnippet(686, "You can easily modify a file-line breakpoints.");
MGCAddSnippet(687, "Command line instructions allow you to save and restore breakpoints.");
MGCAddSnippet(688, "The Questa SIM Waveform Compare feature allows you to compare simulation runs. Differences encountered in the comparison are summarized and listed in the Main window transcript and are shown in the Wave and List windows.");
MGCAddSnippet(689, "Mixed-language compares are supported as listed in the following table:");
MGCAddSnippet(690, "There are three options for setting up a comparison: ");
MGCAddSnippet(691, "The simplest method for setting up a comparison is using the Comparison Wizard. The wizard is a series of dialogs that walks you through the process. ");
MGCAddSnippet(692, "You can also set up a comparison via the GUI without using the Wizard. ");
MGCAddSnippet(693, "There are numerous commands that give you complete control over a comparison. These commands can be entered in the Transcript window or run via a DO file. The commands are detailed in the Reference Manual, but the following example shows the basic sequence:");
MGCAddSnippet(694, "Use the following procedure to setup a comparison with the GUI.");
MGCAddSnippet(695, "The Start Comparison dialog box allows you define the Reference and Test datasets. Select Tools >Waveform Compare > Start Comparison to open the dialog box.");
MGCAddSnippet(696, "The Reference Dataset is the .wlf file to which the test dataset will be compared. It can be a saved dataset, the current simulation dataset, or any part of the current simulation dataset.");
MGCAddSnippet(697, "The Test Dataset is the .wlf file that will be compared against the Reference Dataset. Like the Reference Dataset, it can be a saved dataset, the current simulation dataset, or any part of the current simulation dataset.");
MGCAddSnippet(698, "To designate the signals, regions, or clocks to be used in the comparison, click Tools > Waveform Compare > Add.");
MGCAddSnippet(699, "Add signals for a waveform comparison using the Structure Browser as follows.");
MGCAddSnippet(700, "Rather than comparing individual signals, you can also compare entire regions of your design.");
MGCAddSnippet(701, "You add clocks when you want to perform a clocked comparison. ");
MGCAddSnippet(702, "The Waveform Compare feature provides two comparison methods: ");
MGCAddSnippet(703, "Continuous comparisons are the default. You have the option of specifying leading and trailing tolerances and a when expression that must evaluate to true or 1 at the signal edge for the comparison to become effective. ");
MGCAddSnippet(704, "To specify a clocked comparison you must define a clock in the Add Clock dialog. You can access this dialog via the Clocks button in the Comparison Method tab or by selecting ToolsWaveform CompareAddClocks.");
MGCAddSnippet(705, "There are a few global options that you can set for a comparison. ");
MGCAddSnippet(706, "The Wave window provides a graphic display of comparison results. Pathnames of all test signals included in the comparison are denoted by yellow triangles. Test signals that contain timing differences when compared with the reference signals are denoted by a red X over the yellow triangle.");
MGCAddSnippet(707, "You can tag differences with textual notes that are included in the difference details popup and comparison reports. ");
MGCAddSnippet(708, "The Wave window includes six comparison icons that let you quickly jump between differences. From left to right, the icons do the following: find first difference, find previous annotated difference, find previous difference, find next difference, find next annotated difference, find last difference. ");
MGCAddSnippet(709, "Compare objects can be displayed in the List window too. Differences are highlighted with a yellow background. Tabbing on selected columns moves the selection to the next difference (actually difference edge). Shift-tabbing moves the selection backwards.");
MGCAddSnippet(710, "You can also view text output of the differences either in the Transcript pane of the Main window or in a saved file. ");
MGCAddSnippet(711, "To save comparison results for future use, you must save both the comparison setup rules and the comparison differences. ");
MGCAddSnippet(712, "If you are comparing a hierarchical RTL design simulation against a flattened synthesized design simulation, you may have different hierarchies, different signal names, and the buses may be broken down into one-bit signals in the gate-level design. All of these differences can be handled by Questa SIM s Waveform Compare feature.");
MGCAddSnippet(713, "The Schematic window provides an implementation view of your design, allowing you to see design structure, connectivity, and hierarchy without consulting the RTL. It allows you to explore the  physical  connectivity of your design; to trace events that propagate through the design; and to identify the cause of unexpected outputs.");
MGCAddSnippet(714, "The Schematic window can be used to debug the design during simulation, or to perform post-simulation debugging.");
MGCAddSnippet(715, "Set up your simulation to perform schematic debug tasks during a live simulation.");
MGCAddSnippet(716, "Set up your environment to perform schematic debug tasks after a simulation has been completed.");
MGCAddSnippet(717, "The Schematic window provides two views of the design — a Full View, which is a structural overview of the design hierarchy; and an Incremental View, which uses Click-and-Sprout actions to incrementally add to the selected net's fanout. All top level menus, pop-up menus, and preferences are the same for both modes.");
MGCAddSnippet(718, "The Schematic window provides the following features for getting design information from the Incremental view.");
MGCAddSnippet(719, "Common tasks for current and post-simulation debugging using the Schematic window include adding objects to the Incremental View, exploring the schematic connectivity of the design, folding and unfolding instances, using abstract blocks, tracing events, and finding objects.");
MGCAddSnippet(720, "You can add objects to the Incremental View by starting with only a net or block, and then double-clicking the net to sprout drivers and readers. This is an ideal method for design debugging, allowing you to explore design connectivity by tracing signal readers/drivers.");
MGCAddSnippet(721, "You can display a structural overview of your entire design, or a region of the design in the Schematic window s Full View.");
MGCAddSnippet(722, "A primary use of the Incremental view is to explore the  physical  connectivity of your design. ");
MGCAddSnippet(723, "When you hover the mouse over any signal it changes from a solid to a dashed line, giving you a quick visual indicator of where you are in your design and how design elements are connected. You can explore connectivity further by expanding the view from process to process, allowing you to see the drivers and readers of a particular signal, net, or register.");
MGCAddSnippet(724, "Some nets (such as a clock) in a design can have many readers. This can cause the display to draw numerous processes that you do not want to see when expanding the selected signal, net, or register. Use this procedure to limit the display of readers.");
MGCAddSnippet(725, "The Schematic window automatically traces a signal through buffers and inverters. This can cause chains of redundant buffers or inverters to be displayed in the Schematic window. You can collapse these chains of buffers or inverters to make the design displayed in the Schematic window more compact.");
MGCAddSnippet(726, "Schematic highlighting allows you to trace a path through the design.");
MGCAddSnippet(727, "The Fold/Unfold feature reduces schematic clutter and allows you to focus on the surrounding logic of interest. Contents of complex instances are folded (hidden) inside a box to maximize screen space and improve the readability of the schematic. ");
MGCAddSnippet(728, "Abstract blocks are implicitly created (tool-generated) hierarchies rendered in the Schematic window to encapsulate standard constructs like for-loop, for-generate, and so on. Like folded instances, they reduce clutter in the Schematic and make it more comprehensible and user-friendly. ");
MGCAddSnippet(729, "Another way of exploring your design is to use the embedded wave viewer for the Incremental view. ");
MGCAddSnippet(730, "Event Traceback features allow you to trace root causes of various results, typically unknown values, in your design.");
MGCAddSnippet(731, "You can use the Causality Traceback feature of the Schematic window to trace an unknown state (StX) back to its source. ");
MGCAddSnippet(732, "The Schematic Window includes an easy-to-use toolbar that allows you to find objects by name.");
MGCAddSnippet(733, "You can save the currently loaded design view in either the Full or the Incremental view to a file or to a disk. This can be reloaded at any future time to start debugging from that view.");
MGCAddSnippet(734, "You can annotate any selected design component with a sticky note.");
MGCAddSnippet(735, "If a design has power domain information and is simulated with the necessary power option, the Schematic window will display different power domains in different colors – that is, all design units belonging to one power domain will be shown in one color. ");
MGCAddSnippet(736, "This behavior is referred to as point-to-point tracing. It allows you to visualize all paths connecting two different nets in your schematic.");
MGCAddSnippet(737, "The Schematic window has built-in mappings for all Verilog primitive gates (for example, AND, OR, and so forth). You can also map VHDL entities and Verilog/SystemVerilog modules that represent a cell definition, or processes, to built-in gate symbols. ");
MGCAddSnippet(738, "This section answers several common questions about using the Schematic window s graphic user interface.");
MGCAddSnippet(739, "The Schematic window displays:");
MGCAddSnippet(740, "The Schematic window is dynamically linked to other debugging windows and panes.");
MGCAddSnippet(741, "You can print the Schematic window display from a saved .eps file in UNIX, or by simple menu selections in Windows. The Schematic Page Setup dialog boxallows you to configure the display for printing.");
MGCAddSnippet(742, "The SchematicPreferences menu selection allows you to configure several options that determine how the Incremental and Full views behave. Options are the same for both views. Any changes made to the schematic display options are saved for future simulation and debugging sessions.");
MGCAddSnippet(743, "The Schematic window offers tools for zooming and panning the display.");
MGCAddSnippet(744, "This section provides a complete list of keyboard shortcuts you can use with the Schematic window.");
MGCAddSnippet(745, "This chapter discusses how to use the Dataflow window for tracing signal values, browsing the physical connectivity of your design, and performing post-simulation debugging operations.");
MGCAddSnippet(746, "The Dataflow window allows you to explore the  physical  connectivity of your design; to trace events that propagate through the design; and to identify the cause of unexpected outputs.");
MGCAddSnippet(747, "The Dataflow window can be used to debug the design currently being simulated, or to perform post-simulation debugging of a design. For post-simulation debugging, a database is created at design load time, immediately after elaboration, and used later. ");
MGCAddSnippet(748, "The usage flow for debugging the live simulation is as follows.");
MGCAddSnippet(749, "The post-sim debug flow for Dataflow analysis is most commonly used when performing simulations of large designs in simulation farms, where simulation results are gathered over extended periods and saved for analysis at a later date. In general, the process consists of two steps: creating the database and then using it. ");
MGCAddSnippet(750, "Use the following procedure to create a post-simulation debug database. ");
MGCAddSnippet(751, "You can use the saved dataset to view objects and trace connectivity. Use the following procedure to open a saved dataset.");
MGCAddSnippet(752, "Common tasks for current and post-simulation debugging using the Dataflow window include adding objects to the window, exploring the connectivity of the design, tracing events, finding objects, and tracing paths between nets.");
MGCAddSnippet(753, "You can use any of the following methods to add objects to the Dataflow window:");
MGCAddSnippet(754, "A primary use of the Dataflow window is exploring the  physical  connectivity of your design. One way of doing this is by expanding the view from process to process. This allows you to see the drivers/readers of a particular signal, net, or register.");
MGCAddSnippet(755, "During design analysis you may need to trace a signal to a reader or driver through a wide bus. To prevent the Dataflow window from displaying all of the readers or drivers of the bus follow this procedure:");
MGCAddSnippet(756, "Some nets (such as a clock) in a design can have many readers. This can cause the display to draw numerous processes that you may not want to see when expanding the selected signal, net, or register. By default, nets with undisplayed readers or drivers are represented by a dashed line. If all the readers and drivers for a net are shown, the new will appear as a solid line. To draw the undisplayed readers or drivers, double-click the dashed line. ");
MGCAddSnippet(757, "The Dataflow Window limits the number of readers that are added to the display when you click the Expand Net to Readers button. By default, the limit is 10 readers, but you can change this limit with the  sproutlimit  Dataflow preference as follows: ");
MGCAddSnippet(758, "To restrict the expansion of readers and/or drivers to the hierarchical boundary of a selected signal select Dataflow > Dataflow Options to open the Dataflow Options dialog box then check Stop on port in the Miscellaneous field.");
MGCAddSnippet(759, "The Dataflow window automatically traces a signal through buffers and inverters. This can cause chains of redundant buffers or inverters to be displayed in the Dataflow window. You can collapse these chains of buffers or inverters to make the design displayed in the Dataflow window more compact. ");
MGCAddSnippet(760, "You can quickly traverse through many components in your design. To help mark your path, the objects that you have expanded are highlighted in green.");
MGCAddSnippet(761, "Another way of exploring your design is to use the Dataflow window s embedded wave viewer. This viewer closely resembles, in appearance and operation, the stand-alone Wave window. ");
MGCAddSnippet(762, "You can use the Dataflow window to trace an event to the cause of an unexpected output. This feature uses the Dataflow window s embedded wave viewer. First, you identify an output of interest in the dataflow pane, then use time cursors in the wave viewer pane to identify events that contribute to the output. ");
MGCAddSnippet(763, "Another useful Dataflow window debugging tool is the ability to trace an unknown state (StX) back to its source. Unknown values are indicated by red lines in the Wave window (Figure 6-9) and in the wave viewer pane of the Dataflow window.");
MGCAddSnippet(764, "Select EditFind from the menu bar, or click the Find icon in the toolbar, to search for signal, net, or register names or an instance of a component. This opens the search toolbar at the bottom of the Dataflow window.");
MGCAddSnippet(765, "This behavior is referred to as point-to-point tracing. It allows you to visualize all paths connecting two different nets in your dataflow.");
MGCAddSnippet(766, "This section provides an introduction to the following important Dataflow concepts:");
MGCAddSnippet(767, "The Dataflow window has built-in mappings for all Verilog primitive gates (for example, AND, OR, and so forth). You can also map VHDL entities and Verilog/SystemVerilog modules that represent a cell definition, or processes, to built-in gate symbols. ");
MGCAddSnippet(768, "You can also define your own symbols using an ASCII symbol library file format for defining symbol shapes. This capability is delivered via Concept Engineering s NlviewTM widget Symlib format. The symbol definitions are saved in the dataflow.sym file.");
MGCAddSnippet(769, "Questa SIM includes driver and readers commands that can be invoked from the command line to provide information about signals displayed in the Dataflow window. In live simulation mode, the drivers and readers commands will provide both topological information and signal values. In post-simulation mode, however, these commands will provide only topological information. Driver and reader values are not saved in the post-simulation debug database.");
MGCAddSnippet(770, "This section answers several common questions about using the Dataflow window s graphic user interface.");
MGCAddSnippet(771, "The Dataflow window displays processes, signals, nets, interconnects, and registers. ");
MGCAddSnippet(772, "The Dataflow window is dynamically linked to other debugging windows and panes as described in the table below. ");
MGCAddSnippet(773, "You can print the Dataflow window display from a saved .eps file in UNIX, or by simple menu selections in Windows. The Page Setup dialog allows you to configure the display for printing.");
MGCAddSnippet(774, "With the Dataflow window active, select FilePrint Postscript to setup and print the Dataflow display in UNIX, or save the waveform as an .eps file on any platform.");
MGCAddSnippet(775, "With the Dataflow window active, select FilePrint to print the Dataflow display or to save the display to a file. ");
MGCAddSnippet(776, "With the Dataflow window active, select FilePage setup to open the Page Setup dialog. You can also open this dialog by clicking the Setup button in the Print Postscript dialog. This dialog allows you to configure page view, highlight, color mode, orientation, and paper options.");
MGCAddSnippet(777, "You can configure several options that determine how the Dataflow window behaves. The settings affect only the current session.");
MGCAddSnippet(778, "This chapter discusses the uses of the Source Window for editing, debugging, causality tracing, and code coverage.");
MGCAddSnippet(779, "You can open several file types in the Source window for editing and debugging. ");
MGCAddSnippet(780, "If a file is protected you must create a copy of the file or change file permissions in order to make changes to your source documents. Protected files can be edited in the Source window but the changes must be saved to a new file. To edit the original source document(s) you must change the read/write file permissions outside of Questa SIM. ");
MGCAddSnippet(781, "The following preference variables control how Questa SIM works with source files that have been edited outside of the simulator s Source window.");
MGCAddSnippet(782, "When debugging your design from within the GUI, Questa SIM keeps a log of all areas of the design environment you have examined or opened, similar to the functionality in most web browsers. This log allows you to easily navigate through your design hierarchy, returning to previous views and contexts for debugging purposes. ");
MGCAddSnippet(783, "The Source window allows you to display the current value of objects, trace connectivity information, and display coverage data during a simulation run. ");
MGCAddSnippet(784, "You can obtain data on objects displayed in the Source window. ");
MGCAddSnippet(785, "Source annotation displays simulation values, including transitions, for each signal in your source file. With source annotation you can interactively debug your design by analyzing your source files in addition to using the Wave and Objects windows. ");
MGCAddSnippet(786, "The Source window includes a time indicator in the top right corner that displays the current simulation time, the time of the active cursor in the Wave window, or a user-designated time. ");
MGCAddSnippet(787, "The Source window includes a Find function that allows you to search for specific code. You can search for one instance of a string, multiple instances, and the original declaration of a specified object.");
MGCAddSnippet(788, "You can search for one instance of a string. This search procedure starts from the current location in the open source file and finds the next instance of the specified search string.");
MGCAddSnippet(789, "You can search for and bookmark every instance of a search string making it easier to track specific objects throughout a source file. ");
MGCAddSnippet(790, "You can also search for the original declaration of an object, signal, parameter, and so on.");
MGCAddSnippet(791, "The Source window provides you with several tools for analyzing and debugging your code. You can jump to the declaration of an object with hyperlinked text from the Source and other windows. You can also determine the cause of any signal event or possible drivers or readers for a signal.");
MGCAddSnippet(792, "The Source window supports hyperlinked navigation. When you double-click hyperlinked text the selection jumps from the usage of an object to its declaration and highlights the declaration. ");
MGCAddSnippet(793, "The Source window can display text that is highlighted as a result of various conditions or operations, such as the following. ");
MGCAddSnippet(794, "Questa SIM allows you to drag and drop objects from the Source window to the Wave and List windows. Double-click an object to highlight it, then drag the object to the Wave or List window. To place a group of objects into the Wave and List windows, drag and drop any section of highlighted code.");
MGCAddSnippet(795, "The Source window includes two columns for code coverage statistics – the Hits column and the BC (Branch Coverage) column. These columns provide an immediate visual indication about how your source code is executing. The code coverage indicators are check marks, Xs and Es, the complete variety of which are described in Source Window Code Coverage Indicator Icons.");
MGCAddSnippet(796, "Questa SIM provides several tools for controlling coverage data display in a Source window. ");
MGCAddSnippet(797, "You can set a breakpoint on an executable file, file-line number, signal, signal value, or condition in a source file. When the simulation hits a breakpoint, the simulator stops, the Source window opens, and a blue arrow marks the line of code where the simulation stopped. You can change this behavior by editing the PrefSource(OpenOnBreak) variable. ");
MGCAddSnippet(798, "You can set individual file-line breakpoints in the Line number column of the Source Window.");
MGCAddSnippet(799, "You can set a file-line breakpoints with the bp command to add a file-line breakpoint from the VSIM> prompt. ");
MGCAddSnippet(800, "Your C Debug settings must be in place prior to setting a breakpoint since C Debug is invoked when you set a breakpoint within a SystemC module. Once invoked, C Debug can be exited using the C Debug menu.");
MGCAddSnippet(801, "There are several ways to edit a breakpoint in a source file. ");
MGCAddSnippet(802, "The Modify Breakpoints dialog box provides a list of all breakpoints in the design organized by ID number. ");
MGCAddSnippet(803, "You can permanently delete individual file-line breakpoints using the breakpoint context menu.");
MGCAddSnippet(804, "You can delete groups of breakpoints with the Modify Breakpoints Dialog.");
MGCAddSnippet(805, "You can save your breakpoints in a separate breakpoints.do file or save the breakpoint settings as part of a larger .do file that recreates all debug windows and includes breakpoints. ");
MGCAddSnippet(806, "In dynamic class-based code, an expression can be executed by more than one object or class instance during the simulation of a design. You set a conditional breakpoint on the line in the source file that defines the expression and specifies a condition of the expression or instance you want to examine. You can write conditional breakpoints to evaluate an absolute expression or a relative expression. ");
MGCAddSnippet(807, "You can set a breakpoint for a value of specific instance from the GUI or from the command line. ");
MGCAddSnippet(808, "You can set a breakpoint for a specific value of any instance from the GUI or from the command line. ");
MGCAddSnippet(809, "The Source window allows you to run the simulation to a specified line of code with the  Run Until Here  feature. When you invoke Run Until Here, the simulation will run from the current simulation time and stop on the specified line unless:");
MGCAddSnippet(810, "Source window bookmarks are graphical icons that give you reference points within your code. The blue flags mark individual lines of code in a source file and can assist visual navigation through a large source file by marking certain lines. Bookmarks can be added to currently open source files only and are deleted once the file is closed. ");
MGCAddSnippet(811, "You can set bookmarks in the following ways.");
MGCAddSnippet(812, "You can customize a variety of settings for Source windows. You can change the appearance and behavior of the window in several ways. ");
MGCAddSnippet(813, "The Causality Traceback feature helps you determine the cause of any signal event or all possible drivers of a signal. It allows you to trace backward through simulation time to find both event drivers and the logic behind the drivers. Causality Traceback uses the Questa SIM optimization utility to detect combinatorial and sequential logic events, and saves data about those events to your working library in a .dbg file. The .dbg file is a connectivity and structure database you can use for current simulation and post simulation analysis.");
MGCAddSnippet(814, "Before you can initiate a causality trace, you must create the connectivity and structure database required for the trace. ");
MGCAddSnippet(815, "You can initiate causality traceback from the command line with the find drivers command. This command is used for current or post-simulation debugging. ");
MGCAddSnippet(816, "The find drivers command traces backward in time to find the active driver(s), processes, or first elements of the specified signal or signal event. ");
MGCAddSnippet(817, "The command line arguments to the find drivers command enable you to set the destination for reporting causality trace results.");
MGCAddSnippet(818, "Command line arguments for the find drivers command are available for reporting causality trace results into the Transcript window. ");
MGCAddSnippet(819, "Perform post-simulation causality traceback after completing a simulation and logging the waveform and debug information. ");
MGCAddSnippet(820, "You can initiate causality traceback from several debugging windows (Wave, Source, Objects, Schematic, Structure) using menu or toolbar button selections. In addition, you may designate any arbitrary time as the start time for the trace.");
MGCAddSnippet(821, "You can initiate a causality trace to the first sequential process from the Wave, Objects, Schematic, or Source windows.");
MGCAddSnippet(822, "You can use Wave window menus and toolbar button selections to trace from a signal event to the sequential process(es) that caused the event.");
MGCAddSnippet(823, "The Source window includes a Current Time indicator in the top right corner that displays the current simulation time, the time of the active cursor in the Wave window, or a user-designated time. You can use this time indicator to designate a start time for a causality trace.");
MGCAddSnippet(824, "The Objects and Schematic windows use either the time of the selected cursor in the Wave window or the Time indicator in the Source window—whichever was set last—as the starting time for the event trace.");
MGCAddSnippet(825, "You can trace to the immediate driving process(es) of any signal of interest in the Wave Window.");
MGCAddSnippet(826, "Causality Traceback allows you to trace an event back to the root cause of that event, crossing multiple clock cycles and even multiple clock domains. ");
MGCAddSnippet(827, "Causality Traceback can be used to search for the source of an unknown 'X' signal value. This analysis provides the automatic identification of the root cause of an  X  over multiple cycles and clock domains. ");
MGCAddSnippet(828, "You can find and display all possible driving assignments of a selected signal.");
MGCAddSnippet(829, "The Causality Traceback feature allows you to initiate a trace to the cause of a signal event from any arbitrary time. ");
MGCAddSnippet(830, "Depending on the complexity of the design, some signal events may be driven by multiple processes. When this occurs, the number of drivers is shown in the Show Drivers Control Bar at the top of the Source window. ");
MGCAddSnippet(831, "The Active Driver Path Details window provides two options for viewing causality path details: the Schematic window and the Wave window.");
MGCAddSnippet(832, "You can set Causality Traceback preferences to fit your work environment.");
MGCAddSnippet(833, "Code coverage is the only verification metric generated automatically from design source in RTL or gates. While most verification plans require a high level of code coverage, it does not necessarily indicate correctness of your design. Code coverage measures only how often a suite of tests exercises certain aspects of the source.");
MGCAddSnippet(834, "Questa SIM code coverage provides graphical and report file feedback on the following.");
MGCAddSnippet(835, "Questa SIM code coverage supports VHDL and Verilog/SystemVerilog language constructs.");
MGCAddSnippet(836, "To collect coverage data for a design, you must actively select the type of code coverage you want to collect, and then enable the coverage collection mechanism for the simulation run.");
MGCAddSnippet(837, "When you specify coverage types for data collection, you are essentially instructing the code to collect coverage statistics when coverage collection is enabled at run time. Since extra instructions reduce simulation performance, enable only code for which you intend to collect coverage statistics. ");
MGCAddSnippet(838, "Arguments you specify with +cover are applied in union with all of the previous arguments for each specific module or design unit. ");
MGCAddSnippet(839, "Once you specify the coverage types for coverage, you must enable the simulation for code collection.");
MGCAddSnippet(840, "When you run a design with coverage enabled, you can save the code coverage that was collected for later use, either on demand or at the end of simulation.");
MGCAddSnippet(841, "By default, coverage data is saved to the default test name, which is derived from the basename of the output filename you specify in the coverage save command. You can use this method to create the coverage database with a UVM/OVM testname.");
MGCAddSnippet(842, "You can use a form of coverage storage called a coverstore to improve merge performance while automatically saving coverage data without specifying the coverage save command. A coverstore is a storage location (directory) that holds both design and coverage results, and which you access in a way similar to the way you access a UCDB file.  The coverstore auto-save functionality improves merge performance, when compared with the normal situation flow that uses the coverage save command. When vsim is run with -coverstore, the coverstore directory holds results from multiple tests that share the same design objects and hierarchy; in the normal situation flow, every leaf level UDCB file holds the test record data, the design objects, and the results.");
MGCAddSnippet(843, "Questa SIM stores saved coverage statistics in a Unified Coverage DataBase (UCDB) file, a single persistent database that is the repository for all coverage data — both code coverage and functional coverage. ");
MGCAddSnippet(844, "When you simulate a design with code coverage enabled, various windows display the coverage data. ");
MGCAddSnippet(845, "You can display a summary of each coverage category in the Structure window. The summary appears at the top of each coverage column.");
MGCAddSnippet(846, "When you encounter unexpected coverage results, it may be helpful to keep in mind the following special circumstances related to collecting coverage statistics:");
MGCAddSnippet(847, "Code coverage types include statement, branch, condition, expression, toggle, FSM, and SystemVerilog Class coverage.");
MGCAddSnippet(848, "Statement coverage is the most basic form of coverage supported by Questa SIM. The metric for statement coverage is the count of how many times a given statement is executed during simulation.");
MGCAddSnippet(849, "Branch coverage relates to branching constructs such as  if  and  case  statements. It measures true branch and false branch execution.");
MGCAddSnippet(850, "You can analyze Verilog and SystemVerilog 'if … else if … [else]' chains with a code coverage model.");
MGCAddSnippet(851, "For  case  statements, the case expression itself is not considered a branch. Rather, each case item is considered a separate and independent branch. To achieve 100% branch coverage in a  case  statement, each case item must have been executed during simulation.");
MGCAddSnippet(852, "For if statements without a corresponding else, an implicit AllFalse branch is measured. If the if condition is executed and found to be false, the all false branch is considered to be hit.");
MGCAddSnippet(853, "By default, Questa SIM optimizes any VHDL process serving as an edge-triggered flip-flop so that it is activated only on the rising edge of the clock. Because this process is never activated on the falling edge of the clock, that branch is not executed and is excluded from code coverage. ");
MGCAddSnippet(854, "Condition coverage analyzes the decision made in  if  and ternary statements and can be considered an extension to branch coverage.");
MGCAddSnippet(855, "By default, Questa SIM enables only the collection of Focused Expression Coverage (FEC) style metrics. ");
MGCAddSnippet(856, "Questa SIM includes expression coverage for multibit operands and output, giving you the ability to do coverage analysis on each bit of the expression.");
MGCAddSnippet(857, "The guidelines and usage associated with condition and expression coverage reporting are based on the individual metrics being applied. ");
MGCAddSnippet(858, "Focused expression coverage (FEC) measures coverage for each input of an expression. If all inputs are fully covered, the expression has reached 100% coverage. ");
MGCAddSnippet(859, "You can examine examples of the default report tables that are generated for focused expression coverage (FEC). Examples show both unimodal and bimodal expressions. ");
MGCAddSnippet(860, "Some expressions do not require evaluation of all of the inputs within the expression, once the output has been determined. Skipping evaluation of some of the inputs is known as short-circuiting.");
MGCAddSnippet(861, "Exclusions are row based for both unimodal and bimodal expressions within the FEC report. ");
MGCAddSnippet(862, "Questa SIM implements Rapid Expression Coverage (REC) processing as the default mode for FEC condition and expression coverage. ");
MGCAddSnippet(863, "Condition and expression coverage supports bit, boolean and std_logic types. Arbitrary types are supported when they involve a relational operator with a boolean result. ");
MGCAddSnippet(864, "For Verilog/SystemVerilog condition and expression coverage, as in VHDL, arbitrary types are supported when they involve a relational operator with a boolean result.");
MGCAddSnippet(865, "Toggle coverage is the ability to count and collect changes of state on specified nodes for various Verilog, SystemVerilog, and VHDL signal types.");
MGCAddSnippet(866, "Toggle coverage can be expensive in terms of performance, since it applies to many objects in simulations. It also turns off several important optimizations used by Questa SIM. Collecting toggle coverage indiscriminately across an entire design can cause slowdowns of 10x or more.");
MGCAddSnippet(867, "Supported types for toggle coverage are: boolean, bit, enum, integer, std_logic/std_ulogic, and arrays and records of these types, including multi-dimensional arrays and arrays-of-arrays.");
MGCAddSnippet(868, "Toggle coverage type support for Verilog and SystemVerilog includes wire, reg, bit, logic, fixed-size multi-dimensional array (both packed and unpacked), real, enum, integer atoms (that is, integer, time, byte, shortint, int, and longint), packed unions, and structures (both packed and unpacked) with fields of types supported for toggle coverage. Each bit of non-scalar object types is counted and recorded. Dynamic arrays, associative arrays, queues, unpacked unions, classes, class-like objects such as mailbox and semaphore, and events do not participate in toggle coverage collection.");
MGCAddSnippet(869, "At times the amount of data collected during Toggle Coverage can be overwhelming. It is possible to limit the amount of data by collecting coverage only on ports. Internal signals can be left out of the UCDB, thus reducing both storage and processing requirements. ");
MGCAddSnippet(870, "To view toggle coverage data, right-click in the Objects window to open a context popup menu, and mouse-over the Toggle Coverage selection to open the sub-menu.");
MGCAddSnippet(871, "This section defines what is considered as a  toggle  during a simulation.");
MGCAddSnippet(872, "Standard (2-state) toggle coverage only counts 0L->1H and 1H->0L transitions, while extended (3-state) toggle coverage counts these transitions plus four possible Z transitions (0L->Z, 1H->Z, Z->0L, Z->1H)");
MGCAddSnippet(873, "It is common in extended toggle coverage that not all togglenodes in a given scope are capable of producing Z values.");
MGCAddSnippet(874, "Both regular and extended toggle coverage are calculated using the general coverage calculation algorithm: cover = {# covered bins} / {# total bins}. In regular mode, each togglenode has two bins. In extended mode, there are a different number of bins based on the exact extended toggle mode.");
MGCAddSnippet(875, "In hierarchical designs, many signals span multiple levels of hierarchy through port connections. At each level of the design, such signals have different hierarchical names.");
MGCAddSnippet(876, "A signal that spans multiple levels of hierarchy can have different toggle modes applied to it. ");
MGCAddSnippet(877, "You can specify that toggle coverage statistics be collected for a design.");
MGCAddSnippet(878, "The toggle add command enables you to initiate toggle coverage at any time from the command line. Upon the next running of the simulation, toggle coverage data is collected according to the arguments you employ (for example, the -full argument enables collection of extended toggle coverage statistics).");
MGCAddSnippet(879, "Enable toggle coverage by selecting ToolsToggle CoverageAdd or ToolsToggle CoverageExtended from the Main window menu. These selections allow you to enable toggle coverage for Selected Signals, Signals in Region, or Signals in Design.");
MGCAddSnippet(880, "You can limit the toggle coverage count for a toggle node.");
MGCAddSnippet(881, "Because of the complexity of state machines, FSM designs can contain a higher than average level of defects. It is important, therefore, to analyze the coverage of FSMs in RTL before going to the next stages of synthesis in the design cycle. ");
MGCAddSnippet(882, "The code coverage feature of Questa SIM explicitly understands the existence of SystemVerilog classes, both parameterized and non-parameterized. Code coverage data is collected separately for each elaborated class type and each specialization of a parameterized class. Data is not collected separately for each constructed dynamic class object, only the sum of all objects of a given elaborated type. Data is collected separately for each instance of a module when the class is declared within the module. ");
MGCAddSnippet(883, "When code coverage is enabled for an entire design, or for the purposes of debugging a particular segment of the design, you can use coverage exclusions to exclude coverage for individual design units, files, lines of code, objects, and so on.");
MGCAddSnippet(884, "Exclusions can be instance or file specific.");
MGCAddSnippet(885, "Excluded coverage objects are designated in the GUI by a green  E  in the appropriate coverage column. ");
MGCAddSnippet(886, "Exclusions are automatically applied to certain code constructs. An example is assertion code, which is normally not considered part of the  design . It is not normally desired to have assertions participate in code coverage.");
MGCAddSnippet(887, "Questa SIM includes several mechanisms for excluding coverage from the UCDB.");
MGCAddSnippet(888, "Enable two-step exclusions to avoid GUI lag when adding many exclusions individually. The two-step exclusions mode postpones the application of exclusions until you manually execute them.");
MGCAddSnippet(889, "You can use the coverage exclude command with specific arguments to exclude individual metrics. ");
MGCAddSnippet(890, "You can exclude either the true or false branch of an  if  statement by excluding the lines where the branch occurs. ");
MGCAddSnippet(891, "You can explicitly exclude branches which are implicit at the end of an if/ elsif/elsif tree, but only if there is no trailing  else  at the end of the tree. ");
MGCAddSnippet(892, "The coverage exclude command supports exclusion of the all false branch in case statements. The all false branch is bound to the item number of the case head itself, in the same way as the all false branch for if statements. ");
MGCAddSnippet(893, "To exclude coverage data in a given source file, use the coverage exclude command.");
MGCAddSnippet(894, "Questa SIM supports the use of source code pragmas to selectively turn coverage off and on for individual code coverage metrics. ");
MGCAddSnippet(895, "Questa SIM supports pragmas for branch, expression, statement, toggle, and FSM coverage. ");
MGCAddSnippet(896, "Verilog and VHDL pragmas are enforced at different levels and also have other usage differences.");
MGCAddSnippet(897, "The coverage on|off pragma has two forms; one for general exclusions of specific coverage types, or for all types if none are specified, and another for fine-grained exclusion, used to exercise very precise control over exclusions in complex code constructs.");
MGCAddSnippet(898, "Using coverage pragmas in long source files or included files during development can result in nested pragmas, which can lead to unintended or confusing coverage behavior. Synthesis pragmas can also effect coverage. ");
MGCAddSnippet(899, "Adaptive Exclusion enables you to generate an exclusion DO file that you can use to apply coverage exclusions even after changes in your design. ");
MGCAddSnippet(900, "The adaptive exclusion DO file marks intended exclusions for later use even when design changes alter file line number information.");
MGCAddSnippet(901, "You use the vopt, vsim, and coverage report or vcover report commands to generate an adaptive exclusion. You do not need to append any options to the vsim command other than the ‑coverage argument required for code coverage.");
MGCAddSnippet(902, "Toggle coverage as it relates to exclusions is more complex to configure than other coverage types, because the toggle command precedes the introduction of code coverage in Questa SIM. Questa SIM offers two independent flows for excluding toggle coverage.");
MGCAddSnippet(903, "The toggle disable command is intended to be used as follows:");
MGCAddSnippet(904, "You can use any one of three pragmas to exclude toggle nodes.");
MGCAddSnippet(905, "You can use the  <list>  specifier in the  coverage toggle_ignore  pragma to exclude bus bits.");
MGCAddSnippet(906, "Toggles that have been previously excluded using pragmas can be re-enabled (in the compiler/simulator flow) with either the  coverage exclude -code t -pragma -clear  or  coverage exclude -pragma -clear -togglenode  commands. If the compiled database includes a set of pragma-excluded toggle nodes, these CLI commands override any pragma exclusions and include the specified toggles in coverage statistics.");
MGCAddSnippet(907, "You can exclude individual VHDL and SystemVerilog enums or ranges of enums from toggle coverage and reporting by specifying enum exclusions in source code pragmas or by using the ‑exclude argument to the toggle add command.");
MGCAddSnippet(908, "In Questa SIM, you can exclude any transition or state of an FSM from the coverage reports, either with the coverage exclude command at the command line, or by pragma. ");
MGCAddSnippet(909, "You can use the coverage exclude command to exclude the specified transitions from coverage reports.");
MGCAddSnippet(910, "You can use coverage pragmas to selectively turn coverage off and on for FSM state variables and their associated transitions.");
MGCAddSnippet(911, "You can specify files and line numbers, or condition and expression FEC truth table rows, to exclude from coverage statistics. You can use vsim s Tcl command, coverage report, to create a .do file that contains these exclusions.");
MGCAddSnippet(912, "The Questa SIM default coverage collection for RTL constructs includes a covermode option that enables you to control coverage collection of your constructs to meet coverage closure goals.");
MGCAddSnippet(913, "The covermode option provides user-controlled coverconstructs. A coverconstruct corresponds to a particular HDL code construct that you can instrument for coverage collection. ");
MGCAddSnippet(914, "A covermode corresponds to a set of coverconstructs considered for coverage collection. ");
MGCAddSnippet(915, "Some code coverage options interact with each other. This section describes each covermode and its corresponding coverconstructs and provides examples.");
MGCAddSnippet(916, "You can reate a coverage report from the command line, or with menu selections in the GUI.");
MGCAddSnippet(917, "By default, the coverage report contains a summary of coverage information for the indicated design unit, file, or instance. The summary includes code coverage numbers for each coverage type.");
MGCAddSnippet(918, "A code coverage  profile  is a sequence of coverage items (statements, branches, conditions and expressions) associated with their respective file/line/item numbers. ");
MGCAddSnippet(919, "Multiple coverage items on a single line within a report are numbered, from left to right in ascending order. If a branch statement occurs on the same line as another type of coverage object (such as an assignment) in the source code, enabling or disabling branch coverage can cause the item numbers for the coverage objects to change from one coverage report to the next.");
MGCAddSnippet(920, "The coverage report command produces textual output of coverage statistics or exclusions of the current simulation.");
MGCAddSnippet(921, "The toggle report command displays a list of all nodes that have not transitioned to both 0 and 1 at least once, and the counts for how many times each node toggled for each state transition type. The command also displays a summary of the number of nodes checked, the number that toggled, the number that did not toggle, and a percentage that toggled.");
MGCAddSnippet(922, "Use the toggle report command to display information on nodes that have not toggled.");
MGCAddSnippet(923, "The simulator collapses certain ports that are connected to the same signal in order to improve performance. Collapsed signals do not appear in the toggle coverage report.");
MGCAddSnippet(924, "The ordering of nodes in the report can vary depending on how you specify the signal list.");
MGCAddSnippet(925, "You can specify a default coverage mode that persists from one Questa SIM session to the next.");
MGCAddSnippet(926, "You can output coverage reports in XML format. ");
MGCAddSnippet(927, "You can output coverage reports in HTML format. ");
MGCAddSnippet(928, "You can output coverage reports for specific tests in all formats, except XML. ");
MGCAddSnippet(929, "The optimization process removes constructs in your design that are not functionally essential. ");
MGCAddSnippet(930, "It is possible to achieve 100% coverage in an optimized design, even if certain statements or constructs have been optimized away, because at the lowest level, all coverage calculations are of the form  Total Hits / Total Possible Hits = % Coverage . ");
MGCAddSnippet(931, "The CoverOpt modelsim.ini variable corresponds to the number options of the vlog/vcom -coveropt command line option. The valid settings are 1 through 5. The lower the number, the fewer optimizations are enabled. Fewer optimizations translate into greater design visibility, but slower performance.");
MGCAddSnippet(932, "Questa SIM performance is affected by code coverage for designs using various IP. ");
MGCAddSnippet(933, "A Finite State Machine (FSM) reflects the changes a state-based design has gone through from the start of simulation to the present. Transitions indicate state changes and are described by the conditions required to enable them. Because of the complexity of FSMs, designs containing them can contain a high number of defects. It is important, therefore, to analyze the FSMs in RTL before going to the next stages of synthesis in the design cycle. ");
MGCAddSnippet(934, "Questa SIM recognizes VHDL and Verilog FSMs. ");
MGCAddSnippet(935, "Questa SIM recognizes FSMs in your design during the compilation stages prior to simulation. The simulation stage collects coverage metrics about which states and transitions were used while simulating the test bench with the DUT. ");
MGCAddSnippet(936, "A multi-state transition is also known as a state sequence.");
MGCAddSnippet(937, "You can enable the recognition and collection of coverage metrics for FSMs in your design through the use of command arguments in your simulation flow.");
MGCAddSnippet(938, "You can use the GUI or coverage report command to create a text report of coverage metrics for FSMs in your design.");
MGCAddSnippet(939, "You can enable the creation of debug information for FSMs in your design through the use of command arguments in your simulation flow.");
MGCAddSnippet(940, "The GUI presents coverage metrics in several windows within the GUI. This section describes the windows and the metrics they display.");
MGCAddSnippet(941, "Multiple command arguments are available for FSM management.");
MGCAddSnippet(942, "The vcom/vlog/vopt commands write a note to the transcript whenever they recognize an FSM.");
MGCAddSnippet(943, "The vcom/vlog/vopt commands write a note to the transcript for every recognized FSM when you use the -fsmverbose switch. ");
MGCAddSnippet(944, "FSM coverage reports are useful for examining your FSM coverage.");
MGCAddSnippet(945, "This chapter discusses methods for using VHDL, PSL, and SystemVerilog assertions and cover directives for design verification with Questa SIM. It is organized into four sections.");
MGCAddSnippet(946, "The use of assertions and cover directives falls into the category of  white box  testing – they specify and validate the expected behavior of a design. Assertions and cover directives are written directly into the design in order to observe the values of signals and states, possibly over a span of time. This allows the verification tool to observe (and log) when particular events occur or assumptions are violated.");
MGCAddSnippet(947, "Writing assertions, like writing RTL code, requires knowledge of which constructs are more efficient than others in terms of how they affect simulation performance. This section provides a few key guidelines that will help you improve simulation throughput, as well as a few key things you should avoid. ");
MGCAddSnippet(948, "PSL 1.1 provides for named directives via the use of a label. You are not allowed to have a label that duplicates another symbol in the same scope. In other words, you cannot explicitly label a PSL directive with a name that already exists (as, say, a signal).");
MGCAddSnippet(949, "The SystemVerilog bind construct allows you to bind a Verilog design unit to another Verilog design unit, to a VHDL design unit, or to a SystemC module. This is especially useful for binding SystemVerilog assertions to your VHDL, Verilog, SystemC and mixed designs during verification. ");
MGCAddSnippet(950, "Designers use assume directives to constrain static verification. Because they are intended for formal tools, assume directives have no meaning in simulation. However, by default, Questa SIM simulates assume directives as if they are assert directives and displays them in the Assertions window.");
MGCAddSnippet(951, "The various tasks required to configure assertions may be invoked via the command line or the GUI.");
MGCAddSnippet(952, "You can enable assertions with a command or with a GUI selection.");
MGCAddSnippet(953, "You can enable the collection of fine grained memory usage data for assertions and cover directives. This feature can be used to quickly identify assertions and cover directives that consume the most memory and also are performance intensive. It helps identify assertions and cover directives that should be reviewed and rewritten in order to reduce the number of threads for better performance.");
MGCAddSnippet(954, "You control message logging for SystemVerilog assertions via severity tasks ($fatal, $error, $info, $warning) in an action block. You can determine which messages actually print in Questa SIM by changing variables in the modelsim.ini file or via the Runtime Options dialog.");
MGCAddSnippet(955, "By default, a severity level of Failure causes a simulation break. You can change this default action permanently by editing a modelsim.ini variable, or you can edit the severity for the current simulation only.");
MGCAddSnippet(956, "You enable or disable assertion failure and pass logging with commands, by editing the appropriate modelsim.ini variables, or by using the GUI.");
MGCAddSnippet(957, "The assertion failure limit determines how many times Questa SIM processes an assertion before disabling it for the duration of the simulation. By default, the failure limit is set to  unlimited.  In other words, assertions will not be disabled during the simulation. You can change the permanent default by editing a modelsim.ini variable or by using the assertion fail command. You may also set the assertion failure limit for the current simulation using the GUI.");
MGCAddSnippet(958, "You can set the action that will take place during simulation when an assertion passes or fails, when an assertion evaluation starts, and when an assertion antecedent is matched. ");
MGCAddSnippet(959, "After compiling the design, you may want to edit the default configuration for individual cover directives. Follow these steps to edit the default values.");
MGCAddSnippet(960, "When configuring cover directives, you may assign weights and set a minimum threshold of coverage.");
MGCAddSnippet(961, "You can assign weights to cover directives. Weighting affects the aggregated coverage statistics in the currently selected design region. A directive with a weight of 2 has twice the effect of a directive with a weight of 1. Conversely, assigning a directive a weight of 0 would omit the directive from the statistics calculation. ");
MGCAddSnippet(962, "The AtLeast count is a minimum threshold of coverage that gives you some confidence that the run was meaningful. You do not need to set this threshold on every directive, but you should understand which minimal thresholds make for a useful simulation run based on your design and the objectives of the verification session.");
MGCAddSnippet(963, "Cover directives that are evaluated frequently during simulation can adversely affect runtime efficiency.");
MGCAddSnippet(964, "If any assertions were compiled, the vsim command automatically invokes the assertion engine. ");
MGCAddSnippet(965, "The -assertcounts argument for vsim allows you to generate assertion counts without the performance impact of using ‑assertdebug.");
MGCAddSnippet(966, "The following tasks can be used for analyzing assertions and cover directives:");
MGCAddSnippet(967, "The Assertions window displays simulation data about assertions.");
MGCAddSnippet(968, "The Cover Directives window displays information about cover directives. ");
MGCAddSnippet(969, "The assertion profile command generates a fine grained profile of memory usage for assertions and cover directives. The results are displayed in the Memory, Peak Memory, Peak Memory Time, and Cumulative Threads columns of the Assertions and Cover Directives windows.");
MGCAddSnippet(970, "You can view assertions and cover directives in the Wave window just like any other signal in your design.");
MGCAddSnippet(971, "Questa SIM provides a number of GUI display options for viewing assertions and cover directives data.");
MGCAddSnippet(972, "The Assertions window can display assertion directives in hierarchical (tree) mode or in the flattened form.");
MGCAddSnippet(973, "Display options allow you to display cover directives in a Recursive Mode or in a Show All Contexts mode. ");
MGCAddSnippet(974, "You can filter the Assertions and Cover Directives data displayed by selecting AssertionsFilterSetup or Cover DirectivesFilterSetup, depending on which window is active.");
MGCAddSnippet(975, "You can change the coverage directive waveform in the Wave window so it displays in count mode format, which shows the instantaneous waveform value as a decimal integer. ");
MGCAddSnippet(976, "Questa SIM s compare feature allows you to compare assertions (which includes any assertion-like object such as concurrent and immediate assertions, cover directives, and endpoints.) There is no cross-compare with assertion types outside the set listed, and assertion compare is further limited to like types only. That is, both the reference and test items must be of the same type.");
MGCAddSnippet(977, "You can set up and run an assertion compare using the compare commands or the menu-based Waveform Comparison Wizard. ");
MGCAddSnippet(978, "There are two types of assertion differences — instantaneous differences and range differences.");
MGCAddSnippet(979, "An assertion object is composed of child signals. It is the evaluation of these child signals that determine the assertion event (START/PASS/FAIL). If you choose to expand the assertion, the difference marker is propagated to the child signals as well, but this may not necessarily mean a change in value on the child signal at that specific time — the difference could have occurred earlier.");
MGCAddSnippet(980, "You can save assertion and cover directive metrics to the Unified Coverage Database (UCDB) with the coverage save command. ");
MGCAddSnippet(981, "If the -code argument is not specified with the coverage exclude command, all assertions and cover directives, as well as all code coverage types, will be excluded from the coverage database.");
MGCAddSnippet(982, "You can create reports on assertions and cover directives using dialogs accessible through the GUI or via commands entered at the command line prompt. SVA immediate and concurrent assertions, VHDL immediate assertions, and PSL assertions are all included in the assertion report. The Assertion Type column in Assertions window distinguishes the immediate and concurrent assertions. ");
MGCAddSnippet(983, "Use the Assertions report dialog to save an ASCII file of assertion coverage results.");
MGCAddSnippet(984, "You can specify an alternative output file for recording assertion messages by invoking vsim with the -assertfile <filename> switch. By default assertion messages are output to the file specified by the TranscriptFile variable in the modelsim.ini file. ");
MGCAddSnippet(985, "The use of PSL assertions differs from the use SystemVerilog assertions because PSL assertions can be embedded in your code or supplied in an external file, while SystemVerilog assertions are always embedded in your code. ");
MGCAddSnippet(986, "PSL directives (assert, cover, and so on) are supported in procedural blocks (always and initial). These directives are treated as if they were written outside and no inferences are made from the procedural blocks.");
MGCAddSnippet(987, "Common tasks associated with coding PSL assertions include embedding them in your code, writing them to an external file, putting HDL code inside PSL statements, and others.");
MGCAddSnippet(988, "One way of looking at assertions is as design documentation. In other words, anywhere you would normally write a comment to capture pre-conditions, constraints or other assumptions as well as to document the proper functionality of a module, process, or subprogram, use assertions to capture the information instead.");
MGCAddSnippet(989, "Verilog and VHDL statements may be placed in either embedded PSL meta-comments or in external vunits. When they are embedded in your code, you must use PSL block meta‑comment tags. ");
MGCAddSnippet(990, "PSL assertions in an external file are grouped into vunits.");
MGCAddSnippet(991, "The  ifdef VHDL_DEF and  ifdef VLOG_DEF macros allow you to share a single .psl file between VHDL and Verilog versions of a model. Use these macros inside the .psl file to bracket vunits written in both VHDL and Verilog. ");
MGCAddSnippet(992, "You can insert VHDL library and use clauses directly in external PSL assertion files. This lets you access packages such as Signal Spy even if the design unit (to which the vunit is attached) does not reference the package. ");
MGCAddSnippet(993, "PSL assertions in Questa SIM may be clocked or unclocked.");
MGCAddSnippet(994, "Questa SIM supports unclocked properties of the following form:");
MGCAddSnippet(995, "Any PSL assertion that is not individually clocked and appears below a default clock statement will be clocked by the default clock. ");
MGCAddSnippet(996, "The default clock also applies to partially clocked properties. ");
MGCAddSnippet(997, "You need to be very careful when writing multi-clocked properties that also have a default clock, or you may produce unexpected results. ");
MGCAddSnippet(998, "The PSL ended() construct is a built-in function whose value is set to TRUE for the simulation time unit whenever its sequence is matched. HDL code can read the value of this builtin.");
MGCAddSnippet(999, "Common tasks for compiling and simulating PSL assertions in your design include compiling embedded PSL assertions as well as external assertions files, applying the assertions during elaboration and optimizations, simulating, and then making any needed changes.");
MGCAddSnippet(1000, "Embedded PSL assertions are compiled automatically by default. If you have embedded PSL assertions that you do not want to compile, use the -nopsl argument with the vlog or vcom commands. ");
MGCAddSnippet(1001, "To compile assertions in an external file, invoke the compiler with the -pslfile argument and specify the assertions file name. ");
MGCAddSnippet(1002, "You can also specify an external PSL vunit file with the -pslfile_vh or -pslfile_vl switches for the vopt command. ");
MGCAddSnippet(1003, "If you make any changes to embedded assertions, you need to re-compile the design unit. If you make changes to an external PSL assertions file, you need to compile both the external PSL file and the design unit file to which the vunit binds in the same vlog/vcom invocation.");
MGCAddSnippet(1004, "Questa SIM supports the simple subset of PSL constructs and semantics as described in the IEEE Std 1850-2005, except the following:");
MGCAddSnippet(1005, "The following concepts are important for understanding how to use SVA assertions and cover directives.");
MGCAddSnippet(1006, "Action blocks may contain immediate assertion statements. ");
MGCAddSnippet(1007, "Questa SIM supports deferred assertions, a special kind of immediate assertions, as well as deferred immediate assume and cover directives. ");
MGCAddSnippet(1008, "SystemVerilog assertion coverage is performed with either or both of the following two cover directives.");
MGCAddSnippet(1009, "Questa SIM compiles SystemVerilog assertions along with other SystemVerilog code when either the source file ends in .sv or when you specify the -sv argument with the vlog command.");
MGCAddSnippet(1010, "Using the optional ‑assertdebug argument with the vsim command instructs Questa SIM to examine all assertions and display assertion details in the Assertions window. ");
MGCAddSnippet(1011, "The Assertions window displays information about assertion failures, passes, starts, and antecedents. ");
MGCAddSnippet(1012, "For analyzing assertion problems, the Assertion Thread Viewer can be configured to record detailed data of assertion states during simulation. This allows you to analyze temporal expressions to determine when and where they are not holding. ");
MGCAddSnippet(1013, "Optionally, ATV recording may be enabled or disabled during a simulation when the simulator has stopped. To enable, use the atv log -enable command as follows.");
MGCAddSnippet(1014, "You can save assertion and cover directive metrics to the Unified Coverage Database (UCDB). ");
MGCAddSnippet(1015, "If you used the -assertdebug argument with the vsim command when you invoked the simulator, you can view the details of assertion failures in the Assertion Debug pane of the Wave window. The steps to view assertion failures are as follows.");
MGCAddSnippet(1016, "If you used the -assertdebug argument with the vsim command when you invoked the simulator, the Assertion Active Thread Monitor will display an ActiveCount object in the Wave window for each assertion and cover directive. This object tracks the number of currently active assertion or cover directive threads for the given instance. Expanding it will show individual threads (based on start time) starting and stopping. ");
MGCAddSnippet(1017, "Assertion thread viewing is enabled for all assertions specified with the atv log command, before the simulation is run. After running a simulation, an ATV window can be opened a number of different ways.");
MGCAddSnippet(1018, "The ATV window normally consists of four panes.");
MGCAddSnippet(1019, "The Expression pane is a hierarchical representation of the assertion. From bottom to top, each term in the assertion statement is represented following the left to right order of the original expression. From left to right, the hierarchy of expression statements is represented with the highest order terms on the left and the child terms on the right. Each term that has children can be expanded or collapsed in the viewer by clicking on the  +  and  –  symbols. To expand or collapse all terms, right-click anywhere in the Expression Pane and select Expand All Terms or Collapse All Terms.");
MGCAddSnippet(1020, "The thread viewer pane is on the right, and shows the progress of the assertion threads over time for a given thread instance and starting time. Sub-threads that fork off of the main thread are shown, as well as boolean checks, waits, and thread terminations. ");
MGCAddSnippet(1021, "To display the Local Variables Pane in the ATV window do one of the following.");
MGCAddSnippet(1022, "To display the Design Objects pane in the ATV window do one of the following.");
MGCAddSnippet(1023, "Actions you can do to change what is seen in the ATV window include:");
MGCAddSnippet(1024, "The ATV window allows you to find which sub-expression caused an HDL expression to fail. ");
MGCAddSnippet(1025, "The Expressions Pane displays all clock expressions in the assertion expression hierarchy. ");
MGCAddSnippet(1026, "You can expand and contract the expression hierarchy in the expression pane by clicking a plus sign,  + , to expand and a minus sign,  – , to contract. When doing this, the threads in the thread viewer pane will also expand and contract to exactly follow the expression pane. ");
MGCAddSnippet(1027, "You can highlight any thread in the Thread Viewer Pane to differentiate it from the other threads by simply clicking on it with the left mouse button. Highlighting appears as a bold purple line. Depending on where the thread is clicked, any sub-threads that are forked and occur to the right of the click-point will also be highlighted. Going left, parent thread events which lead up to the current thread and selection point will also be highlighted. Any parent thread forks, other than the one which leads to the selected thread, will not be highlighted. ");
MGCAddSnippet(1028, "Hovering the mouse over any GUI elements of the ATV Window reveals information about assertion thread or directive status. ");
MGCAddSnippet(1029, "The ATV window allows you to annotate local variables in the highlighted thread of the Thread Viewer Pane using one of the following methods.");
MGCAddSnippet(1030, "Functional coverage is user-defined coverage – in contrast with code coverage, which is automatically inferred from the source. At the most abstract level, functional coverage specifies some values to observe at certain times in a design or test bench, and counts how many times those values occur. ");
MGCAddSnippet(1031, "The SystemVerilog functional coverage flow in Questa SIM is broken down into three main steps: compilation of design files, simulation, and data analysis. ");
MGCAddSnippet(1032, "SystemVerilog offers a set of facilities for configuring covergroups, coverpoints, and crosses through the option and type_option structures. These structures can be used to control various aspects of SystemVerilog simulations, using guidelines which apply to each of the settings.");
MGCAddSnippet(1033, "Control functional coverage behavior in Questa SIM with the change command from the command line interface, or from within a .do file, to adjust the value of variables contained in option and type_option structures.");
MGCAddSnippet(1034, "Questa SIM supports several methods for enabling/disabling the collection of functional coverage. During live simulation, you can turn off the collection of coverage statistics for covergroups, coverpoints, and crosses from within the source code, using any of these methods: ");
MGCAddSnippet(1035, "SystemVerilog provides the following built-ins, available for use with Questa SIM.");
MGCAddSnippet(1036, "The SystemVerilog LRM defines two built-in methods, get_coverage() and get_inst_coverage(), applied at the covergroup, coverpoint, and cross scope. Both of these built-ins return a coverage metric as a floating point number that represents achieved coverage as a percentage (where 100.0 is the maximum possible coverage). Refer to IEEE Std 1800-2012 LRM, Section 19.8 for details on these methods.");
MGCAddSnippet(1037, "The SystemVerilog LRM defines the $get_coverage() built-in system function as the overall coverage of all coverage group types. The variable type_option.weight at the covergroup scope is used to weight the contribution an individual covergroup makes to the overall cumulative (or type) coverage. ");
MGCAddSnippet(1038, "The LRM refers to cumulative coverage and type coverage as the same thing; this document uses the term type-based coverage. The LRM sometimes uses coverage and instance coverage interchangeably; this document uses instance-based coverage. ");
MGCAddSnippet(1039, "The coverage system default behavior for SystemVerilog covergroups (Questa SIM version 6.6 and higher) is compliant with the latest IEEE Std1800-2009 clarifications and changes. ");
MGCAddSnippet(1040, "The example code shown below demonstrate how options are set.");
MGCAddSnippet(1041, "The option.per_instance covergroup option has a clarified meaning in IEEE Std 1800-2009. Coverage database behavior is explicitly allowed to be vendor-specific, so the Questa SIM simulator always saves the instance in the database and reports the instances. Without that information, post-process merging would be crippled with a strict interpretation of the LRM. ");
MGCAddSnippet(1042, "The merge_instances option was introduced in IEEE Std 1800-2009. The merge_instances value determines the algorithm for computing the coverage score for a covergroup type and is defined in the LRM. ");
MGCAddSnippet(1043, "The Questa SIM simulator s interpretation of option.per_instance was as an enabler for instance-based coverage as well as whether instances appeared in the report and database. This has been clarified in SystemVerilog 2009. By  enabler  we mean essentially whether the get_inst_coverage() method can provide instance based coverage, which can be different than the type (cumulative) coverage from the get_coverage() method. This enabling functionality is now set with option.get_inst_coverage, which applies only when type_option.merge_instances is equal to 1 (by default it is set to 0). ");
MGCAddSnippet(1044, "Several changes have occurred over the past several releases of Questa. ");
MGCAddSnippet(1045, "This section describes the default behavior of the Questa SIM tool, with a note at the end about how to achieve this in fully-compliant IEEE Std 1800-2012.");
MGCAddSnippet(1046, "Type-based coverage is easy to understand for the case where all instances have the same number of bins, and the same values map to the same bins. However, SystemVerilog covergroups that are parameterized when they are constructed carry additional implications for type-based coverage. Type-based coverage may be calculated for covergroups that have different numbers of bins because they were constructed differently. ");
MGCAddSnippet(1047, "You can write covergroups in template classes, resulting in each parameterized class instance of a template class creating separate covergroup type scopes. However, this leads to low coverage of those covergroup type scopes, due to the fact that parameterized class instances are specifically optimized though their covergroups, and are still general. As such, it is not possible to cover all parts of a general covergroup residing under a specifically parameterized class.");
MGCAddSnippet(1048, "The testplan specification uses the projected view for specifying paths in the Link column for linking a testplan to any projected covergroup item (covergroup type, covergroup instance, coverpoint type, coverpoint instance, cross type, cross instance, or bin). ");
MGCAddSnippet(1049, "SystemVerilog coverage statistics are displayed in the Covergroups and Structure (sim) windows.");
MGCAddSnippet(1050, "You can view functional coverage statistics in the Covergroups window to evaluate assess the state of the verification process.");
MGCAddSnippet(1051, "Certain columns of data appear in this window that are specifically related to functional coverage statistics within the Structure window.");
MGCAddSnippet(1052, "You can create functional coverage reports using dialogs accessible through the GUI or by entering commands at the command line prompt.");
MGCAddSnippet(1053, "You can save a functional coverage text report using any of the following methods.");
MGCAddSnippet(1054, "You can create an HTML report of the functional coverage statistics that will appear in your browser by selecting ToolsCoverage ReportHTML, which opens the Coverage HTML Report dialog.");
MGCAddSnippet(1055, "The -cvgbintstamp argument for the vsim command enables Questa SIM to record the simulation time step (timestamp) whenever a covergroup bin is covered during a simulation run. ");
MGCAddSnippet(1056, "You can filter functional coverage data displayed in the GUI — including the Assertions, Cover Directives and Covergroups windows.");
MGCAddSnippet(1057, "Two commands produce textual reports of functional coverage statistics.");
MGCAddSnippet(1058, "While post-processing a UCDB (Coverage View), or during live simulation, you can exclude functional coverage from view in the GUI or reports.");
MGCAddSnippet(1059, "You can exclude functional coverage items from reports or from displaying in the GUI with the coverage exclude command.");
MGCAddSnippet(1060, "When you exclude a coverpoint or cross bin, all associated cross bins from all crosses where the coverpoint participates directly or hierarchically (cross of crosses) will also be excluded if the ‑transitive argument is given in the coverage exclude command.");
MGCAddSnippet(1061, "While post-processing (Coverage View) a UCDB, as well as in live simulation, you can remove the covergroup instances from the GUI and/or reports.");
MGCAddSnippet(1062, "Assertion and cover directive names are important for identification in Questa SIM reports and coverage windows, as well as for restoring in simulation with $load_coverage_db(). Questa SIM assigns names to any unnamed assertion and cover directives, but these assigned names can and do change as changes are made to the source files in which they are located.");
MGCAddSnippet(1063, "Covergroup instance names are important for identification in Questa SIM reports and coverage windows, as well as for restoring in simulation with $load_coverage_db(). Covergroup instance names are stored in the option.name field of the built-in covergroup structure. You may assign these names in SystemVerilog, in which case names should be unique. This is not an absolute requirement, though it is recommended.");
MGCAddSnippet(1064, "There are a couple of unexpected cases in covergroup naming conventions that occur with the embedded covergroup (the covergroup in a class):");
MGCAddSnippet(1065, "Coverpoint bin names are components of the coverage database primary key used to identify covergroup bins. Unambiguous identification of database items is important both for simulation coverage analysis and downstream verification management such as database merging and cross-tool methodologies. ");
MGCAddSnippet(1066, "By default, no coverage information is saved into a Unified Coverage DataBase (UCDB) for later post-processing applications — regardless of whether coverage statistics were collected for a simulation — unless you explicitly save it, or if you use vsim -coverstore to save a coverstore.");
MGCAddSnippet(1067, "You can save functional coverage data (both covergroup coverage and cover directive coverage) into the UCDB for all simulations.");
MGCAddSnippet(1068, "You can save functional coverage data into the UCDB for only the current simulation.");
MGCAddSnippet(1069, "To load a functional coverage database into simulation, use the $load_coverage_db(), a standard SystemVerilog built-in system task, which loads covergroup data once it has been saved. It loads the data from a specified UCDB file into the current simulation. In cases where there are differences in design hierarchy or covergroups between the loaded design and the saved UCDB file, the $load_coverage_db system task loads as much data as possible. ");
MGCAddSnippet(1070, "When you load a coverage database in simulation, using $load_coverage_db, Questa SIM requires that you set option.per_instance equal to 1 in all instances. Use the SVCovergroupPerInstanceDefault, in the modelsim.ini file, to set option.per_instance for all covergroup instances in the design.");
MGCAddSnippet(1071, "When merging coverage databases offline using vcover merge, the following parameters must be the same for a given scope: ");
MGCAddSnippet(1072, "SystemVerilog supports automated test bench development with random constraints, giving you the ability to automatically generate test benches for functional verification. SystemVerilog provides an object-oriented method for specifying constraints on random test bench values. Questa SIM then processes these constraints using a constraint solver, which generates random values that meet those constraints. Constraint solver profiling allows you to see how much time is spent in which constraints, and which are the most expensive constraints to solve. It also profiles CPU time spent in  Regions  of the solver as opposed to every function call.");
MGCAddSnippet(1073, "In many modern electronic designs, exhaustive testing is impossible because the space of all possible inputs is too large. A simulator could not possibly reproduce all possible input vectors in any reasonable simulation time. Moreover, exhaustive testing may not be desirable because the set of interesting design states is much smaller than the set of possible inputs.");
MGCAddSnippet(1074, "The default constraint solver engine is  AUTO , which instructs Questa SIM to attempt to select the best solver engine for a randomize() scenario based on the mix of random variables and constraints.");
MGCAddSnippet(1075, "The SystemVerilog class data abstraction is ideally suited for building random stimulus. ");
MGCAddSnippet(1076, "To generate new random values, you use the randomize() virtual method. ");
MGCAddSnippet(1077, "The modelsim.ini file contains numerous variables whose settings control solver behavior for randomization. You can also use attributes that correspond to these variables when calling randomize() to apply their control only to that call. Using an attribute allows you to override the variable setting on a per-randomize basis. ");
MGCAddSnippet(1078, "Attributes for randomize() follow the definitions provided in the Verilog standard, IEEE Std 1364-2005 and IEEE Std 1364-2001. ");
MGCAddSnippet(1079, "SystemVerilog size constraints for random dynamic arrays are supported by randomize(). A dynamic array with a size constraint may be resized by a call to randomize().");
MGCAddSnippet(1080, "Contradicting constraints, such as x > 5 and x < 3, causes the randomize() function to fail (the return value of the function is 0). When a randomize () failure occurs due to contradicting constraints and if the SolveFailSeverity and SolveFailDebug modelsim.ini variables are set to non-zero values, Questa SIM generates a constraint contradiction report for randomize() calls that fail due to having no solutions. This report enables debugging of randomize() failures.");
MGCAddSnippet(1081, "You can use the solveengine attribute of randomize() to select the best constraint solver  engine  for a particular randomization.");
MGCAddSnippet(1082, "SystemVerilog constraints restrict the range of random variables and allow you to specify relationships between those variables. ");
MGCAddSnippet(1083, "Command line control options allow you to alter the behavior of certain constraints during randomize() to generate significant differences in solution distribution. ");
MGCAddSnippet(1084, "You may encounter situations in which the solver fails to randomize or solve the specified constraints. ");
MGCAddSnippet(1085, "Either the  profile on  command or the  vsim -autoprofile  command will enable basic constraint solver profiling, which records performance information related to SystemVerilog randomize() calls invoked during simulation. When solver profiling is enabled, the constraint solver report ( profile report -solver  command) includes profile data.");
MGCAddSnippet(1086, "You can specify random sequence generation compatibility with a prior Questa SIM letter release (for the SystemVerilog solver). ");
MGCAddSnippet(1087, "In System Verilog, various constructs make use of random numbers that are supplied by Random Number Generators (RNGs). A random number generator consists of a generation algorithm and an associated internal state referred to as the randstate. ");
MGCAddSnippet(1088, "Every SystemVerilog class instance and every process (thread) has its own randstate. Each process has an associated class instance of type process. The randstate of a SystemVerilog process is that of its associated process class instance.");
MGCAddSnippet(1089, "In SystemVerilog, each thread has its own unique RNG state. The seed of each child thread is initialized from the parent RNG. Questa SIM gives you the ability to seed the root RNG with either a specific integer or a random number.");
MGCAddSnippet(1090, "The predictability of a sequence of random values is referred to as random stability.");
MGCAddSnippet(1091, "In some cases running a simulation with different options may yield unexpected differences. When the differences are due to different 'random' values, debugging the cause of the difference can be difficult. The cause may be due to user code. The RNG Trace feature is intended to help in identifying the cause(s) of the difference.");
MGCAddSnippet(1092, "When code conditionally causes RNG operations it can result in random instability—behavior unrelated to the condition changes. A common way to avoid this kind of random instability is to use the get_randstate and set_randstate methods.");
MGCAddSnippet(1093, "The RNG Trace feature provides an intuitive tool for analyzing and debugging simulation differences due to divergences in process or object RNG utilization. ");
MGCAddSnippet(1094, "The RNG Trace feature provides an intuitive tool for analyzing and debugging simulation differences due to divergences in process or object RNG utilization. When you enable RNG Trace, the tool generates diagnostic output whenever the RNG of a process or class instance changes.");
MGCAddSnippet(1095, "RNG Trace can be controlled with the TCL variables listed here.");
MGCAddSnippet(1096, "When RNG Trace reporting is enabled, the tool generates output whenever the RNG of a process (initial, always, or fork) changes.");
MGCAddSnippet(1097, "Questa SIM creates a temporary RNG (context) for a fork-join. The thread that executes the fork seeds this RNG, which provides random seed values for the child threads of the fork. In this way execution of a fork statement always gets a single value from the RNG of the parent thread (independent of the number of child threads). This yields better random stability because if the Verilog code is modified to add an additional child thread, the RNG randstate after the fork statement is still the same.");
MGCAddSnippet(1098, "A call to new() to construct a new class instance results in RNG activity.");
MGCAddSnippet(1099, "The RNG Trace report includes the file and line number of RNG operations, but not call stack information. The call stack, however, can help you debug random stability issues when the calling process matches a specific randstate. You can view the call stack by re-running the simulation and setting a breakpoint for a particular randstate. ");
MGCAddSnippet(1100, "The RNG Trace feature can help with debugging and identifying random instability issues. It records all operations that modify the randstate of a process or class. Comparing (diff) trace files between two simulations can help in the stability analysis.");
MGCAddSnippet(1101, "Questa SIM supports the use of  const cast  expressions in constraints. This is valuable when you want to treat an expression as a constant that would otherwise be considered random.");
MGCAddSnippet(1102, "Solver record and replay enables you to simulate a testbench in which the solver does not analyze and solve the constraint. It only assigns previously solved values from a previous run.");
MGCAddSnippet(1103, "Solver record logs the solved values of random variables evaluated by randomize() calls during simulation to a solver recording file. Solver replay reads the contents of the solver recording file and applies the stored values of random variables to randomize() calls during simulation.");
MGCAddSnippet(1104, "Solver record logs the solved values of random variables evaluated by randomize() calls during simulation to a solver recording file. Solver replay reads the contents of a solver recording file and applies the stored values of random variables to randomize() calls during simulation");
MGCAddSnippet(1105, "The simulator generates various solver reports at the Transcript window, which contain information about random variables, constraints blocks, constraints, and testcases.");
MGCAddSnippet(1106, "Questa SIM provides you with tools for managing your verification environment through coverage and use of the unified coverage database. ");
MGCAddSnippet(1107, "Verification Management within Questa SIM is a set of functionality which allows you to manage your test environment.");
MGCAddSnippet(1108, "The flow described below represents a typical design verification process as it can be applied in the Questa SIM environment.");
MGCAddSnippet(1109, "The Unified Coverage DataBase (UCDB) is a single persistent form for various kinds of verification data, notably: coverage data of all kinds, and some other information useful for analyzing verification results. ");
MGCAddSnippet(1110, "The calculation of Total Coverage which appears in various windows and reports depends on several factors, discussed in the following sections.");
MGCAddSnippet(1111, "A summary of all coverage types in one aggregated total is available in many places throughout the GUI and CLI. ");
MGCAddSnippet(1112, "The calculation of coverage in terms of how the items are binned is expressed in this section.");
MGCAddSnippet(1113, "Aggregated coverage data is displayed in Total Coverage column of the Structure (sim) window. ");
MGCAddSnippet(1114, "The Browser window's Total Coverage column is calculated similarly to the Total Coverage column in the Structure window.");
MGCAddSnippet(1115, "In the Tracker window's Coverage column, two distinct cases of coverage calculations are presented: one occurs when the section is a leaf testplan section, another when the section is a non-leaf testplan section.");
MGCAddSnippet(1116, "Most commands related to coverage are used in one of three simulation use modes that correspond to the type of coverage analysis required.");
MGCAddSnippet(1117, "Raw UCDB coverage data can be saved, merged with coverage statistics from the current simulation or from previously saved coverage data, and viewed at a later date using Coverage View mode. ");
MGCAddSnippet(1118, "Elemental to managing your verification is the collection of data from tests run, and an understanding of the data that has been collected. The following sections outline the details of data collection and the UCDB database itself.");
MGCAddSnippet(1119, "When you run tests, the coverage data which you instruct the simulator to save is placed in the Unified Coverage DataBase (UCDB).");
MGCAddSnippet(1120, "The naming of test UCDBs can be either implicit (default), or explicit (set by you). ");
MGCAddSnippet(1121, "Optionally, you can save the coverage data to a UCDB for post-process viewing and analysis.");
MGCAddSnippet(1122, "You can rerun tests and execute sets of commands from the command execution functionality of the Verification Browser.");
MGCAddSnippet(1123, "When you save a set of coverage data into the UCDB, that data is written into individual test data records, one for each test that is run. ");
MGCAddSnippet(1124, "The test record contains  layers  of information. Each test record contains test record attributes (fields) which, in turn, contain two sub-sets of attributes. Specifically, these are:");
MGCAddSnippet(1125, "Each field in the UCDB test data record contains an attribute with a default value based on your simulation. ");
MGCAddSnippet(1126, "Once you have run tests and collected coverage, the real task of analyzing the coverage can begin. Managing the coverage data which has been collected and stored in one or more UCDBs is critical to the task. ");
MGCAddSnippet(1127, "When you have multiple sets of coverage data, from multiple tests of the same design, you can combine the results into a single UCDB by merging the UCDB files. ");
MGCAddSnippet(1128, "An alternative merge use model is provided which reduces data storage and provides better merge performance. It is called a Coverstore merge. ");
MGCAddSnippet(1129, "The vcover merge command allows you to merge multiple coverage data files offline, without first loading a design.");
MGCAddSnippet(1130, "Otherwise, they will be merged as separate coverage items. Therefore, before merging some UCDBs, paths might need to be altered. ");
MGCAddSnippet(1131, "As a design changes over a period of time, you may want to merge UCDB files generated earlier with newer UCDBs generated from the same design. ");
MGCAddSnippet(1132, "To allow merging of coverage results in a multi-user environment, irrespective of the paths of the source files, Questa SIM incorporates the concept of file signatures.");
MGCAddSnippet(1133, "The vcover parallelmerge command performs a merge on a UCDB or CoverStore database using parallel processes, automatically merging intermediate merge results, and producing the final merged results.");
MGCAddSnippet(1134, "There is one requirement for the successful set-up and use of the parallel merge process:");
MGCAddSnippet(1135, "The parallel merge process can be run in three main modes of operation.");
MGCAddSnippet(1136, "There are three stages to the parallel merge process.");
MGCAddSnippet(1137, "The vcover parallelmerge arguments used to build the merge list are the following.");
MGCAddSnippet(1138, "The number of files which are distributed and split into parallel processes is determined by the mode of operation:");
MGCAddSnippet(1139, "Several types of warnings can occur during a merge operation.");
MGCAddSnippet(1140, "In some cases, the tool issues a warning message (#6846), which indicates that a resulting merged file cannot completely represent the information contained in the individual UCDBs. ");
MGCAddSnippet(1141, "Questa SIM requires that test data records created within a merged UCDB are unique. In a situation such as the merging of UCDB files that exist in different directories, but which have test records whose names are identical, you can get a warning message (#6854).");
MGCAddSnippet(1142, "By default, Questa SIM performs checks on source code stability when merging code coverage. Code coverage results are merged based on line numbers, and merged results can be significantly wrong if line numbers have changed between versions of the source. ");
MGCAddSnippet(1143, "It is possible, and can sometimes be useful to edit the contents of a UCDB. ");
MGCAddSnippet(1144, "Several issues related to the merge algorithm are important to note.");
MGCAddSnippet(1145, "You can choose one of two levels of information preserved in the merged database: the test associated or totals algorithm. ");
MGCAddSnippet(1146, "Because a test-associated merge (vcover merge -testassociated) does not perfectly preserve information, it can be misleading in some circumstances. ");
MGCAddSnippet(1147, "The decision on how to merge a set of UCDB files depends upon where and how the you store the data and databases being merged. ");
MGCAddSnippet(1148, "You can view and anlyze your verification data through the graphical user interface.");
MGCAddSnippet(1149, "It is possible to add your own attributes to a specified test record. ");
MGCAddSnippet(1150, "Data related to the management of your verification data can be viewed in the Verification Browser and Verification Tracker windows (LayoutVMgmt or ViewVerification Management).");
MGCAddSnippet(1151, "You can view both UCDB (.ucdb) and rank result (.rank) files in the Verification Browser window.");
MGCAddSnippet(1152, "Remove UCDB files from the Verification Browser window. ");
MGCAddSnippet(1153, "UCDB files from previously saved simulations are only viewable in Coverage View mode (post-processing). You can invoke Coverage View mode on any of your .ucdb files in the Test Browser or at the command line. This allows you to view saved and/or merged coverage results from earlier simulations. ");
MGCAddSnippet(1154, "You can customize the display of columns in the Verification Browser window or Tracker window, and then save these views for later use. ");
MGCAddSnippet(1155, "The following information is critical to successful ranking and the role ranking plays in viewing and analyzing verification data.");
MGCAddSnippet(1156, "Ranking seeks to order tests with respect to their contribution to the coverage metric, such as Total Coverage. The default ordering of the tests within the ranking report (.rank) is from most (top) to least (bottom). All tests which do not contribute to increased coverage numbers are not included in the ranked results. ");
MGCAddSnippet(1157, "Ranktest now provides a way to selectively group tests based on attribute values, such that ranktest will treat them as one combined object. ");
MGCAddSnippet(1158, "The rank process creates a ranked list of tests based on the input goals: each row in the Browser displays the test and its cumulative contribution to coverage made by it as well as the tests listed above it, in each column. For example, looking at the Statement coverage column in test row three: the value shown represents the statement coverage achieved by the first three tests combined. ");
MGCAddSnippet(1159, "Merged results can and do differ from Rank report coverage results.");
MGCAddSnippet(1160, "You can rank the most effective tests from the Tracker, Structure, Covergroups, or Instance windows, by selecting the Test AnalysisRank Most Effective Tests menu item.");
MGCAddSnippet(1161, "Test-associated ranking performs a merge and proceeds to rank based upon a test-associated merge result, whereas iterative ranking ranks individual non-merge tests by performing an iteration of merges on the file system. Therefore, if you have a merged test included in your ranking, make sure that the merged file was produced using a test-associated merge (vcover merge run with the -testassociated switch).");
MGCAddSnippet(1162, "You can generate ASCII text or HTML reports of coverage using menu selections in the GUI or with command line commands. ");
MGCAddSnippet(1163, "You can use menu selections in the GUI or the coverage report command to create three types of reports to display the coverage metrics in your design.");
MGCAddSnippet(1164, "At the command line: use the coverage report command. Within the GUI: use the Coverage Text Report dialog box. ");
MGCAddSnippet(1165, "You can create on-screen coverage reports in HTML that include functional coverage consolidated views.");
MGCAddSnippet(1166, "The following sections relate to HTML reporting, and provide information on how to perform specific tasks for HTML reporting.");
MGCAddSnippet(1167, "Some toggle nodes in the report appear with a notation of  [canonical] . This denotes that the togglenode is an alias of a canonical node elsewhere in the design. Canonical means a common name for the overall net. All aliases point to the canonical name, which is equivalent to all aliases.");
MGCAddSnippet(1168, "For all covergroups, coverpoints and crosses, the value of option/type_option is displayed in the HTML report whenever it differs from the default value specified in the SystemVerilog LRM.");
MGCAddSnippet(1169, "Information about which tests hit which bins (also known as,  tests-bins-hits ) is tracked and displayed by the HTML report when enabled to do so. Enable the viewing of this information by applying the -testhitdata argument to the coverage/vcover report s -html command. ");
MGCAddSnippet(1170, "HTML coverage reports present cross coverage data in a compact view that condenses the display of bins with zero hits, and illustrates the presence of coverage holes. The compact view aids you in identifying large coverage holes, and shortens coverage reports. ");
MGCAddSnippet(1171, "Create a coverage exclusion report within the GUI as follows.");
MGCAddSnippet(1172, "There are several tasks related to the filtering of data from the UCDB.");
MGCAddSnippet(1173, "Use a filter to display only the desired coverage information in various Verification Management and coverage windows. ");
MGCAddSnippet(1174, "You can set the display to view only certain items in a UCDB.");
MGCAddSnippet(1175, "The filter can be applied using the same Filter Setup dialog.");
MGCAddSnippet(1176, "One powerful feature for tracing verification requirements is the ability to filter your coverage results by attributes. You can add these attributes to a testplan for this purpose.");
MGCAddSnippet(1177, "Two commands can be used to retrieve the content of test attributes: coverage attribute and vcover attribute, depending on whether you are in live simulation or Coverage View mode.");
MGCAddSnippet(1178, "Often ECOs (Engineering Change Orders) can occur late in the design cycle, when a design is highly stable. Only small sections of the design are affected by changes. You can use various Verification Management tools to analyze which tests most effectively cover those few areas and re-run those specific tests to demonstrate satisfactory coverage numbers. ");
MGCAddSnippet(1179, "C Debug allows you to interactively debug FLI/PLI/VPI/DPI/SystemC/C/C++ source code with the GNU Debugger (gdb), which is open‑source debugging software. ");
MGCAddSnippet(1180, "Questa SIM ships with the gdb versions 6.3 and 7.9.1, and C Debug uses whichever version is required to function with your platform's version of the simulator. Testing has shown these versions to be the most reliable for SystemC applications. However, for FLI/PLI/VPI applications, you can also use a current installation of gdb if you prefer. ");
MGCAddSnippet(1181, "Before viewing your SystemC/C/C++ source code, you must set up the C Debug path and options. ");
MGCAddSnippet(1182, "You can run C Debug from a DO file but you should be aware of a configuration issue where it takes C Debug a few moments to start-up. ");
MGCAddSnippet(1183, "Breakpoints in C Debug work much like normal HDL breakpoints. You can create and edit them with Questa SIM commands (bp, bd, enablebp, and disablebp) or within a Source window in the GUI. ");
MGCAddSnippet(1184, "To step in C Debug you use the same buttons and commands that you use when working with an HDL-only design.");
MGCAddSnippet(1185, "End a SystemC debugging session from the GUI or from the command line.");
MGCAddSnippet(1186, "Questa SIM can automatically locate and set breakpoints at all currently known function entry points.");
MGCAddSnippet(1187, "Auto step mode automatically identifies and sets breakpoints at registered function calls (that is, PLI/VPI system tasks and functions and callbacks and FLI subprograms and callbacks and processes created with mti_CreateProcess). ");
MGCAddSnippet(1188, "The Auto step mode allows you to automatically set up breakpoints for debugging.");
MGCAddSnippet(1189, "The Auto find bp command locates and sets breakpoints at function entry points. ");
MGCAddSnippet(1190, "Key tasks and concepts for the initialization mode.");
MGCAddSnippet(1191, "Initialization mode allows you to examine and debug functions that are called during elaboration (that is, while your design is in the process of loading). When you select this mode, the simulator sets special breakpoints for foreign architectures and PLI/VPI modules that allow you to set breakpoints in the initialization functions. When the design finishes loading, the special breakpoints are automatically deleted, and any breakpoints that you set are disabled (unless you specify Keep user init bps in the C debug setup dialog).");
MGCAddSnippet(1192, "There are two kinds of FLI functions you may encounter in initialization mode. The first is a foreign architecture and the second is a foreign function. ");
MGCAddSnippet(1193, "The simulator produces messages in initialization mode depending on your registration method of callback functions in PLI; using a veriusertfs array to define all usertf entries or adding an init_usertfs function to explicitly register each usertfs entry. ");
MGCAddSnippet(1194, "VPI functions are registered via routines placed in a table named vlog_startup_routines. ");
MGCAddSnippet(1195, "Instructing C Debug to complete the design load without stopping.");
MGCAddSnippet(1196, "The Stop on quit mode allows you to debug functions that are called when the simulator exits. ");
MGCAddSnippet(1197, "The following table provides a brief description of the commands that you can invoke when C Debug is running. Follow the links to the Reference Manual for complete command syntax. ");
MGCAddSnippet(1198, "The Questa SIM statistical sampling profiler provides instance specific execution so you can easily identify areas in your simulation where performance can be improved. The profiler can be used at all levels of design simulation—Functional, RTL, and Gate‑Level—and has the potential to save hours of regression test time. In addition, ASIC and FPGA design flows benefit from the use of this tool.");
MGCAddSnippet(1199, "The profiler provides an interactive graphical representation of CPU usage on a per instance basis. It shows you what part of your design is consuming resources (CPU cycles), allowing you to more quickly find problem areas in your code. ");
MGCAddSnippet(1200, "The profiler s statistical sampling profiler samples the current simulation at a user-determined rate (every <n> milliseconds of real or  wall-clock  time, not simulation time) and records what is executing at each sample point. The advantage of statistical sampling is that an entire simulation need not be run to get good information about what parts of your design are using the most simulation time. A few thousand samples, for example, can be accumulated before pausing the simulation to see where simulation time is being spent.");
MGCAddSnippet(1201, "The profile save and profile open commands allow writing and reading of profile data to/from a profile database file (.pdb extension suggested). ");
MGCAddSnippet(1202, "You can enable the statistical sampling profiler from the graphic interface (with menu picks) or through the command line. ");
MGCAddSnippet(1203, "The statistical sampling profiler must be enabled prior to running the simulation.");
MGCAddSnippet(1204, "Statistical sampling occurs during the execution of a Questa SIM run command. With profiling enabled, all subsequent run commands will collect performance statistics. Profiling results are cumulative—each run command performed with profiling enabled will add new information to the data already gathered. To clear this data, choose ToolsProfileClear Profile Data or use the profile clear command.");
MGCAddSnippet(1205, "You can turn off profiling with any one of three methods.");
MGCAddSnippet(1206, "You can run the profiler on Windows with a design that contains FLI/PLI/VPI code.");
MGCAddSnippet(1207, "The utility of the data supplied by the profiler depends in large part on how your code is written. In cases where a single model or instance consumes a high percentage of simulation time, the statistical sampling profiler quickly identifies that object, allowing you to implement a change that runs faster.");
MGCAddSnippet(1208, "The profiler provides four views of the collected data: Ranked, Design Units, Call Tree and Structural. All four views are enabled by selecting the corresponding ViewProfilingsub-menu item. ");
MGCAddSnippet(1209, "The Ranked window displays the results of the statistical performance profiler for each function or instance. By default, ranked profiler results are sorted by values in the In% column, which shows the percentage of the total samples collected for each function or instance. ");
MGCAddSnippet(1210, "The Design Units window displays the profiler results, aggregated for the different design units. This window provides information similar to the Structural window, but organized by design unit, rather than hierarchically.");
MGCAddSnippet(1211, "By default, the Calltree window sorts profiler results according to the Under(%) column, which shows the percentage of the total samples collected for each function or instance and all supporting routines or instances. ");
MGCAddSnippet(1212, "The Structural profile window displays instance-specific performance profile information in a hierarchical structure format. The Structural profile window contains the same information found in the Calltree window but adds an additional dimension with which to categorize performance samples. It shows how call stacks are associated with different instances in the design.");
MGCAddSnippet(1213, "The Profiler increases visibility into simulation performance with dynamic links to the Source window and the Profile Details window. ");
MGCAddSnippet(1214, "The Ranked, Design Unit, Calltree, and Structural windows are all dynamically linked to Source window. You can double-click any function or instance in these windows to bring up that object in a Source window with the selected line displayed.");
MGCAddSnippet(1215, "If you use C code in your design via SystemC, the Verilog PLI/VPI, or the Questa SIM FLI, you can use the performance profiler to determine the impact of these C modules on simulator performance. Compiling your C code with debug symbols enables the profiler to report functions accurately. ");
MGCAddSnippet(1216, "Each of the Profiler windows provides find and filter functions to assist you in isolating and examining specific results. ");
MGCAddSnippet(1217, "Questa SIM allows you to easily create performance profile reports using the Profile Report dialog or the profile report command.");
MGCAddSnippet(1218, "Questa SIM collects data on memory usage (capacity) while the simulation is running. You can display this data in the Capacity window of the graphical user interface.");
MGCAddSnippet(1219, "When you invoke Questa SIM, you can use the vsim command arguments to select one of the following levels of capacity analysis before loading your design: ");
MGCAddSnippet(1220, "Questa SIM collects data as either a coarse-grain analysis or a fine-grain analysis of memory capacity. The main difference between the two levels is the specificity of the capacity data collected — coarse-grain is a summary and fine-grain is detailed.");
MGCAddSnippet(1221, "The coarse-grain analysis data is enabled by default when you run the vsim command. The purpose of this analysis is to provide a simple summary of the number of objects, the memory allocated for each class of design objects, the peak memory allocated, and the time at which peak memory occurred. ");
MGCAddSnippet(1222, "When you enable a fine-grain analysis, Questa SIM collects detailed capacity data that you can use to dig deeper into the area where memory consumption is problematic. The details about each type of object are further quantified. ");
MGCAddSnippet(1223, "Fine-grain analysis is enabled by using the -capacity argument with the vsim command.");
MGCAddSnippet(1224, "You can use the capstats command or the vsim -capstats argument to print a consolidated report of the complete memory usage of your design. Both the command and the argument work on fully optimized designs. ");
MGCAddSnippet(1225, "The Capacity window displays a tabular listing of memory capacity data.");
MGCAddSnippet(1226, "You can add capacity information to the Wave window like any other signal. Simply drag-and-drop a capacity type from the Objects window to the Wave window, or use the add wave command.");
MGCAddSnippet(1227, "Questa SIM allows you to easily generate text-based reports of capacity data using the write report command.");
MGCAddSnippet(1228, "By default, coarse-grain analysis data is saved into a UCDB file, along with the simulation coverage data using the coverage save command. You can report this data from UCDB file using the vcover report command or the vcover stats command.");
MGCAddSnippet(1229, "Although it is not the same as reporting memory capacity, the assertion profile command generates a fine grained profile report of memory usage for assertions and cover directives. ");
MGCAddSnippet(1230, "The Questa SIM random constraint solver stores performance information about the SystemVerilog randomize() calls invoked during simulation and reports on how much time is spent in which constraints, and which constraints are the most expensive to solve. ");
MGCAddSnippet(1231, "The Verilog language allows access to any signal from any other hierarchical block without having to route it through the interface. This means you can use hierarchical notation to either write or read the value of a signal in the design hierarchy from a test bench. Verilog can also reference a signal in a VHDL block or reference a signal in a Verilog block through a level of VHDL hierarchy. ");
MGCAddSnippet(1232, "Signal Spy procedures for VHDL are provided in the VHDL Utilities Package (util) within the modelsim_lib library. ");
MGCAddSnippet(1233, "Strings that you pass to Signal Spy commands are not language-specific and should be formatted as if you were referring to the object from the command line of the simulator. Thus, you use the simulator's path separator. For example, the Verilog LRM specifies that a Verilog hierarchical reference to an object always has a period (.) as the hierarchical separator, but the reference does not begin with a period. ");
MGCAddSnippet(1234, "Signal Spy supports the following SystemVerilog types and user-defined SystemC types. ");
MGCAddSnippet(1235, "The signal spy calls enumerated below include the syntax and arguments for the VHDL procedure, the Verilog task, and the SystemC function for each call.");
MGCAddSnippet(1236, "The disable_signal_spy call disables the associated init_signal_spy. The association between the disable_signal_spy call and the init_signal_spy call is based on specifying the same src_object and dest_object arguments to both. The disable_signal_spy call can only affect init_signal_spy calls that had their control_state argument set to  0  or  1 .");
MGCAddSnippet(1237, "The enable_signal_spy() call enables the associated init_signal_spy call. The association between the enable_signal_spy call and the init_signal_spy call is based on specifying the same src_object and dest_object arguments to both. The enable_signal_spy call can only affect init_signal_spy calls that had their control_state argument set to  0  or  1 . ");
MGCAddSnippet(1238, "The init_signal_driver() call drives the value of a VHDL signal, Verilog net, or SystemC (called the src_object) onto an existing VHDL signal or Verilog net (called the dest_object). This allows you to drive signals or nets at any level of the design hierarchy from within a VHDL architecture or Verilog or SystemC module (for example, a test bench).");
MGCAddSnippet(1239, "The init_signal_spy() call mirrors the value of a VHDL signal, SystemVerilog or Verilog register/net, or SystemC signal (called the src_object) onto an existing VHDL signal, Verilog register, or SystemC signal (called the dest_object). This allows you to reference signals, registers, or nets at any level of hierarchy from within a VHDL architecture or Verilog or SystemC module (for example, a test bench). ");
MGCAddSnippet(1240, "The signal_force() call forces the value specified onto an existing VHDL signal, Verilog register/register bit/net, or SystemC signal (called the dest_object). This allows you to force signals, registers, bits of registers, or nets at any level of the design hierarchy from within a VHDL architecture or Verilog or SystemC module (for example, a test bench). ");
MGCAddSnippet(1241, "The signal_release() call releases any force that was applied to an existing VHDL signal, SystemVerilog or Verilog register/register bit/net, or SystemC signal (called the dest_object). This allows you to release signals, registers, bits of registers, or nets at any level of the design hierarchy from within a VHDL architecture or Verilog or SystemC module (for example, a test bench). ");
MGCAddSnippet(1242, "This chapter describes JobSpy™, a tool for monitoring and controlling batch simulations and simulation farms. ");
MGCAddSnippet(1243, "There are four basic steps in setting up and using JobSpy.");
MGCAddSnippet(1244, "The first step to setup JobSpy is to set the JOBSPY_DAEMON environment variable.");
MGCAddSnippet(1245, "You must start the JobSpy daemon prior to launching any simulation jobs. The daemon tracks jobs by setting up a communication pipe with each running simulation. ");
MGCAddSnippet(1246, "As an alternative to using a TCP/IP port, you can instruct the JobSpy Daemon to communicate with simulation jobs via a directory and file structure. Although a directory location is not technically a Daemon, for ease of use we will be referring to it as one in this document. ");
MGCAddSnippet(1247, "The JobSpy command-line interface is accessible from a shell prompt or within the Questa SIM GUI.");
MGCAddSnippet(1248, "You can perform a select number of simulator commands on jobs via JobSpy. ");
MGCAddSnippet(1249, "JobSpy includes a GUI called Job Manager that you can invoke from within Questa SIM or separately as a stand-alone tool. The Job Manager shows all active simulations in real time and provides convenient access to JobSpy commands.");
MGCAddSnippet(1250, "You can start Job Manager with a command from a shell prompt or with Questa SIM GUI menu selections.");
MGCAddSnippet(1251, "You can invoke simulation commands in Job Manager via a right-click menu or from the prompt in the Interactive Job Session window. ");
MGCAddSnippet(1252, "The Interactive Job Session pane provides a command line for interacting with jobs. Commands you enter affect the job currently selected in the Running Jobs portion of the dialog box. ");
MGCAddSnippet(1253, "The View Transcript and View Waveform commands display files (transcript and <name>.wlf, respectively) that are output by the simulator. ");
MGCAddSnippet(1254, "You may want to check simulation results while your simulation jobs are still running. You can do this via the GUI or by using the savewlf command.");
MGCAddSnippet(1255, "From the command line, there are three steps to viewing waveforms.");
MGCAddSnippet(1256, "When you suspend a job via JobSpy, the simulation license is released by default. You can change this behavior by modifying the MTI_RELEASE_ON_SUSPEND environment variable. By default the variable is set to 10 (in seconds), which releases the license 10 seconds after receiving a suspend signal. If you change the value to 0 (off), simulation licenses will not be released upon job suspension.");
MGCAddSnippet(1257, "Checkpointing allows you to save the state of a simulation and restore it at a later time. ");
MGCAddSnippet(1258, "Load-sharing software, such as Platform Computing s LSF or Sun s Grid Engine, centralize management of distributed computing resources. JobSpy can access and monitor simulation runs that were submitted to these load-managing products. ");
MGCAddSnippet(1259, "Some additional steps are required to configure load-sharing software for checkpointing vsim jobs. The configuration depends on which load-sharing software you run.");
MGCAddSnippet(1260, "Configuring LSF for Checkpointing requires that you set two environment variables.");
MGCAddSnippet(1261, "Flowtracer does not support checkpointing of vsim jobs.");
MGCAddSnippet(1262, "To checkpoint vsim jobs with Grid Engine, you must create a Checkpoint Object and make the settings in the following procedure.");
MGCAddSnippet(1263, "The Questa SIM Waveform Editor offers a simple method for creating design stimulus. You can generate and edit waveforms in a graphical manner and then drive the simulation with those waveforms. ");
MGCAddSnippet(1264, "You can use Waveform Editor before or after loading a design. Regardless of which method you choose, you will select design objects and use them as the basis for created waveforms.");
MGCAddSnippet(1265, "Here are the basic steps for using waveform editor prior to loading a design.");
MGCAddSnippet(1266, "Here are the basic steps for using waveform editor after loading a design.");
MGCAddSnippet(1267, "Waveform Editor includes a Create Pattern wizard that walks you through the process of creating waveforms. ");
MGCAddSnippet(1268, "The wave create command gives you the ability to generate clock, constant, random, repeater, and counter waveform patterns from the command line. You can then modify the waveform interactively in the GUI and use the results to drive simulation. See the wave create command in the Command Reference for correct syntax, argument descriptions, and examples.");
MGCAddSnippet(1269, "You can edit waveforms interactively with menu commands, mouse actions, or by using the wave edit command. ");
MGCAddSnippet(1270, "There are several methods for selecting edges or sections of a waveform. The table and graphic below describe the various options.");
MGCAddSnippet(1271, "You may find that you cannot select the exact range you want because the mouse moves more than one unit of simulation time (for example, 228 ns to 230 ns). If this happens, zoom in on the Wave display and you should be able to select the range you want.");
MGCAddSnippet(1272, "When you click just to the right of a waveform edge in the waveform pane, the cursor automatically snaps to the nearest edge. This behavior is controlled by the Snap Distance setting in the Wave window preferences dialog. ");
MGCAddSnippet(1273, "There are mouse and keyboard shortcuts for moving and stretching edges.");
MGCAddSnippet(1274, "You need not save the waveforms in order to use them as stimulus for a simulation. ");
MGCAddSnippet(1275, "Once you have created and edited the waveforms, you can save the data to a stimulus file that can be used to drive a simulation now or at a later time. ");
MGCAddSnippet(1276, "The method for loading the stimulus file depends upon what type of format you saved. ");
MGCAddSnippet(1277, "When you import a previously saved EVCD file, Questa SIM attempts to map the signals in the EVCD file to the signals in the loaded design by matching signals based on name and width. ");
MGCAddSnippet(1278, "The Waveform Compare feature compares two or more waveforms and displays the differences in the Wave window. This feature can be used in tandem with Waveform Editor. The combination is most useful in situations where you know the expected output of a signal and want to compare visually the differences between expected output and simulated output. ");
MGCAddSnippet(1279, "When you create and edit waveforms in the Wave window, Questa SIM tracks the underlying Tcl commands and reports them to the transcript. You can save those commands to a DO file that can be run at a later time to recreate the waveforms.");
MGCAddSnippet(1280, "This chapter covers the Questa SIM implementation of SDF (Standard Delay Format) timing annotation. Included are sections on VITAL SDF and Verilog SDF, plus troubleshooting.");
MGCAddSnippet(1281, "Questa SIM supports SDF versions 1.0 through 4.0 (IEEE 1497), except the NETDELAY and LABEL statements. The simulator s built-in SDF annotator automatically adjusts to the version of the file. ");
MGCAddSnippet(1282, "How you specify your SDF file differs depending on whether you are using the three-step or the two-step optimization flow for your design simulation.");
MGCAddSnippet(1283, "The instance paths in the SDF file are relative to the instance to which the SDF is applied. Usually, this instance is an ASIC or FPGA model instantiated under a test bench. ");
MGCAddSnippet(1284, "As an alternative to the command line options, you can specify SDF files in the Start Simulation dialog box under the SDF tab.");
MGCAddSnippet(1285, "Errors issued by the SDF annotator while loading the design prevent the simulation from continuing, whereas warnings do not. ");
MGCAddSnippet(1286, "The sdfcom command compiles SDF files. Compiled SDF can be annotated to Verilog and VHDL regions, including those regions hierarchically underneath SystemC modules. However, compiled SDF cannot be targeted to a SystemC node directly (even if the intended annotation objects underneath the SystemC node are Verilog and/or VHDL). ");
MGCAddSnippet(1287, "You can specify compiled SDF files on the vsim command line with the -sdfmin, ‑sdftyp, and -sdfmax arguments. Alternatively, they may be specified as the filename in a $sdf_annotate() system task in the Verilog source.");
MGCAddSnippet(1288, "The IEEE Std 1076.4-2000, IEEE Standard for VITAL ASIC Modeling Specification describes how cells must be written to support SDF annotation. The following summary reviews how SDF constructs are mapped to associated VHDL generic names, and may help you understand simulator error messages. VHDL SDF annotation works on VITAL cells only. ");
MGCAddSnippet(1289, "An SDF file contains delay and timing constraint data for cell instances in the design. The annotator must locate the cell instances and the placeholders (VHDL generics) for the timing data. Each type of SDF timing construct is mapped to the name of a generic as specified by the VITAL modeling specification. The annotator locates the generic and updates it with the timing value from the SDF file. It is an error if the annotator fails to find the cell instance or the named generic. ");
MGCAddSnippet(1290, "If the simulator finds the cell instance but not the generic, an error message is issued.");
MGCAddSnippet(1291, "Verilog designs can be annotated using either the simulator command line options or the $sdf_annotate system task (also commonly used in other Verilog simulators). The command line options annotate the design immediately after it is loaded, but before any simulation events take place. The $sdf_annotate task annotates the design at the time it is called in the Verilog source code. This provides more flexibility than the command line options. ");
MGCAddSnippet(1292, "The $sdf_annotate task annotates the design when it is called in the Verilog source code. ");
MGCAddSnippet(1293, "The annotator matches SDF constructs to corresponding Verilog constructs in the cells. Usually, the cells contain path delays and timing checks within specify blocks. For each SDF construct, the annotator locates the cell instance and updates each specify path delay or timing check that matches. An SDF construct can have multiple matches, in which case each matching specify statement is updated with the SDF timing value. ");
MGCAddSnippet(1294, "The simulator processes RETAIN delays based on the definitions in an SDF file, the transition of the signal, and your use of command line arguments.");
MGCAddSnippet(1295, "Timing check ports and path delay input ports can have optional edge specifications.");
MGCAddSnippet(1296, "Timing check ports and path delays can have optional conditions. ");
MGCAddSnippet(1297, "The SDF TIMESCALE construct specifies time units of values in the SDF file. The annotator rounds timing values from the SDF file to the time precision of the module that is annotated. For example, if the SDF TIMESCALE is 1ns and a value of .016 is annotated to a path delay in a module having a time precision of 10ps (from the timescale directive), then the path delay receives a value of 20ps. The SDF value of 16ps is rounded to 20ps. Interconnect delays are rounded to the time precision of the module that contains the annotated MIPD.");
MGCAddSnippet(1298, "Annotation of a mixed VHDL and Verilog design is very flexible. VHDL VITAL cells and Verilog cells can be annotated from the same SDF file. This flexibility is available only by using the simulator s SDF command line options. The Verilog $sdf_annotate system task can only annotate Verilog cells. ");
MGCAddSnippet(1299, "An interconnect delay represents the delay from the output of one device to the input of another. Questa SIM can model single interconnect delays or multisource interconnect delays for Verilog, VHDL/VITAL, or mixed designs. ");
MGCAddSnippet(1300, "Questa SIM offers a number of options for disabling timing checks on a global or individual basis. ");
MGCAddSnippet(1301, "Questa SIM provides a number of tools for troubleshooting designs that use SDF files.");
MGCAddSnippet(1302, "By far, the most common mistake in SDF annotation is to specify the wrong instance to the simulator s SDF options. The most common case is to leave off the instance altogether, which is the same as selecting the top-level design unit. This is generally wrong because the instance paths in the SDF are relative to the ASIC or FPGA model, which is usually instantiated under a top-level test bench. ");
MGCAddSnippet(1303, "SDF annotation of RECREM or SETUPHOLD matching only a single setup, hold, recovery, or removal timing check will result in a Warning message.");
MGCAddSnippet(1304, "Another common error is to specify the component or module name rather than the instance label. ");
MGCAddSnippet(1305, "If you leave off the instance altogether, then the simulator issues a message for each instance path in the SDF that is not found in the design. ");
MGCAddSnippet(1306, "Questa SIM allows you to create a report about unannotated or partially-annotated specify path objects, path delays and timing checks, to better understand a design that uses SDF files.");
MGCAddSnippet(1307, "The basic function of SDF annotation is to map SDF timing statements to the corresponding statements in the specify block of the module. The SDF annotation warning  Failed to find matching specify module path  indicates that there is a mismatch between the SDF data and the module timing information available to Questa SIM.");
MGCAddSnippet(1308, "The Value Change Dump (VCD) file format is supported for use by Questa SIM and is specified in the IEEE 1364-2005 standard. A VCD file is an ASCII file that contains information about value changes on selected variables in the design stored by VCD system tasks. This includes header information, variable definitions, and variable value changes. ");
MGCAddSnippet(1309, "Questa SIM provides two general methods for creating a VCD file.");
MGCAddSnippet(1310, "This procedure produces a four-state VCD file with variable changes in 0, 1, x, and z with no strength information.");
MGCAddSnippet(1311, "This procedure produces an extended VCD (EVCD) file with variable changes in all states and strength information and port driver data.");
MGCAddSnippet(1312, "Verilog designs are case-sensitive, so Questa SIM maintains case when it produces a VCD file. However, VHDL is not case-sensitive, so Questa SIM converts all signal names to lower case when it produces a VCD file. ");
MGCAddSnippet(1313, "If a checkpoint occurs while Questa SIM is writing a VCD file, the entire VCD file is copied into the checkpoint file. Since VCD files can be very large, it is possible that disk space problems may occur. Consequently, Questa SIM issues a warning in this situation.");
MGCAddSnippet(1314, "You can use an extended VCD file as stimulus to re-simulate your design. ");
MGCAddSnippet(1315, "When simulating with inputs from an extended VCD file, you can simulate only one design unit at a time. In other words, you can apply the VCD file inputs only to the top level of the design unit for which you captured port data.");
MGCAddSnippet(1316, "Replacing instances with output values from a VCD file lets you simulate without the instance s source or even the compiled object. ");
MGCAddSnippet(1317, "The -vcdstim argument for the vcd dumpports command ensures the order that port names appear in the VCD file matches the order that they are declared in the instance s module or entity declaration. ");
MGCAddSnippet(1318, "Questa SIM VCD commands map to IEEE Std 1364 VCD system tasks and appear in the VCD file along with the results of those commands. The table below maps the VCD commands to their associated tasks. ");
MGCAddSnippet(1319, "VCD commands are supported for SystemC signals and signal ports.");
MGCAddSnippet(1320, "Questa SIM can produce compressed VCD files using the gzip compression algorithm. Since we cannot change the syntax of the system tasks, we act on the extension of the output file name. If you specify a .gz extension on the filename, Questa SIM will compress the output.");
MGCAddSnippet(1321, "The following example code shows the VHDL source, a set of simulator commands, and the resulting VCD output.");
MGCAddSnippet(1322, "The design is a simple shifter device represented by the following VHDL source code. ");
MGCAddSnippet(1323, "At simulator time zero, the designer executes the following commands.");
MGCAddSnippet(1324, "The Questa SIM vcd2wlf command is a utility that translates a .vcd file into a .wlf file that can be displayed in Questa SIM using the vsim-view argument. This command only works on VCD files containing positive time values.");
MGCAddSnippet(1325, "Some ASIC vendors  toolkits read a VCD file format that provides details on port drivers. This information can be used, for example, to drive a tester. For more information on a specific toolkit, refer to the ASIC vendor s documentation. ");
MGCAddSnippet(1326, "The resolved values written to the VCD file depend on which options you specify when creating the file.");
MGCAddSnippet(1327, "By default, Questa SIM generates VCD output according to the IEEE Std 1364™‑2005, IEEE Standard for Verilog® Hardware Description Language. This standard states that the values 0 (both input and output are active with value 0) and 1 (both input and output are active with value 1) are conflict states. The standard then defines two strength ranges:");
MGCAddSnippet(1328, "If you force a value on a net that does not have a driver associated with it, Questa SIM uses the port direction shown in the following table to dump values to the VCD file. When the port is an inout, the direction cannot be determined.");
MGCAddSnippet(1329, "Mentor Graphics has created an additional VHDL data type for use in mixed-language designs, in case you need access to the full Verilog state set. The vl_logic type is an enumeration that defines the full set of VHDL values for Verilog nets, as defined for Logic Strength Modeling in IEEE 1364™‑2005. ");
MGCAddSnippet(1330, "You may wish to ignore strength ranges and have Questa SIM handle each strength separately. ");
MGCAddSnippet(1331, "Tcl is a scripting language for controlling and extending Questa SIM. Within Questa SIM you can develop implementations from Tcl scripts without the use of C code. Because Tcl is interpreted, development is rapid; you can generate and execute Tcl scripts  on the fly  without stopping to recompile or restart Questa SIM. In addition, if Questa SIM does not provide a command you need, you can use Tcl to create your own commands.");
MGCAddSnippet(1332, "Using Tcl with Questa SIM gives you these features:");
MGCAddSnippet(1333, "For quick reference information on Tcl, choose the following from the Questa SIM main menu: ");
MGCAddSnippet(1334, "The following eleven rules define the syntax and semantics of the Tcl language. ");
MGCAddSnippet(1335, "The Tcl if command executes scripts conditionally. Note that in the syntax below the question mark (?) indicates an optional argument.");
MGCAddSnippet(1336, "The Tcl set command returns or sets the values of variables.");
MGCAddSnippet(1337, "Placing a command in square brackets ([ ]) will cause that command to be evaluated first and its results returned in place of the command. For example:");
MGCAddSnippet(1338, "A semicolon character (;) works as a separator for multiple commands on the same line. It is not required at the end of a line in a command sequence.");
MGCAddSnippet(1339, "With Tcl, multiple-line commands can be used within scripts and on the command line. The command line prompt will change (as in a C shell) until the multiple-line command is complete.");
MGCAddSnippet(1340, "An important thing to remember when using Tcl is that anything put in braces ({}) is not evaluated immediately. This is important for if-then-else statements, procedures, loops, and so forth.");
MGCAddSnippet(1341, "When you are comparing values, the following hints may be useful:");
MGCAddSnippet(1342, "When a $<var_name> is encountered, the Tcl parser will look for variables that have been defined either by Questa SIM or by you, and substitute the value of the variable.");
MGCAddSnippet(1343, "To pass commands to the UNIX shell or DOS window, use the Tcl exec command:");
MGCAddSnippet(1344, "For complete information on Tcl commands, select HelpTcl Man Pages. ");
MGCAddSnippet(1345, "Unlike other variables that must be explicitly set, simulator state variables return a value relative to the current simulation. Simulator state variables can be useful in commands, especially when used within Questa SIM DO file scripts. The variables are referenced in commands by prefixing the name with a dollar sign ($).");
MGCAddSnippet(1346, "Variable values may be referenced in simulator commands by preceding the variable name with a dollar sign ($). For example, to use the now and resolution variables in an echo command type:");
MGCAddSnippet(1347, "For the when command, special processing is performed on comparisons involving the now variable. If you specify  when {$now=100}... , the simulator will stop at time 100 regardless of the multiplier applied to the time resolution.");
MGCAddSnippet(1348, "You can read values from the modelsim.ini file with the following function:");
MGCAddSnippet(1349, "You can set values for the modelsim.ini file with the WritePrivateProfileString Tcl function.");
MGCAddSnippet(1350, "In Tcl, a  list  is a set of strings in braces separated by spaces. Several Tcl commands are available for creating lists, indexing into lists, appending to lists, getting the length of lists and shifting lists, as shown in the following table.");
MGCAddSnippet(1351, "These additional commands enhance the interface between Tcl and Questa SIM. Only brief descriptions are provided in the following table.");
MGCAddSnippet(1352, "Questa SIM Tcl time commands make simulator-time-based values available for use within other Tcl procedures. ");
