MGCAddSnippet(1357, "Questa SIM DO files are simply scripts that contain Questa SIM and, optionally, Tcl commands. You invoke these scripts with the ToolsTCLExecute Macro menu selection or the do command.");
MGCAddSnippet(1358, "You can create DO file scripts, like any other Tcl script, by doing one of the following.");
MGCAddSnippet(1359, "You can increase the flexibility of DO file scripts by using parameters. Parameters specify values that are passed to the corresponding parameters $1 through $9 in the script. For example say the DO file  testfile  contains the line bp $1 $2. The command below would place a breakpoint in the source file named design.vhd at line 127:");
MGCAddSnippet(1360, "To delete a file from a .do script, use the Tcl file command.");
MGCAddSnippet(1361, "If you want to make DO file script parameters optional (that is, be able to specify fewer parameter values with the do command than the number of parameters referenced in the DO file script), you must use the argc simulator state variable. The argc simulator state variable returns the number of parameters passed. The examples below show several ways of using argc. ");
MGCAddSnippet(1362, "The following diagram shows how control flows from one DO file to another and out to the command line interface for input from the user. ");
MGCAddSnippet(1363, "If you are executing a script when your simulation hits a breakpoint or causes a run-time error, Questa SIM interrupts the script and returns control to the command line. The commands in the following table may be useful for handling such events. (Any other legal command may be executed as well.)");
MGCAddSnippet(1364, "If a command in a script returns an error, Questa SIM does the following:");
MGCAddSnippet(1365, "Either the do command or Tcl source command can execute a DO file, but they behave differently.");
MGCAddSnippet(1366, "The Tcl Debugger, TDebug, works by parsing and redefining Tcl/Tk-procedures, inserting calls to `td_eval' at certain points, which takes care of the display, stepping, breakpoints, variables and so forth. The advantages are that TDebug knows which statement in which procedure is currently being executed and can give visual feedback by highlighting it. All currently accessible variables and their values are displayed as well. Code can be evaluated in the context of the current procedure. Breakpoints can be set and deleted with the mouse. ");
MGCAddSnippet(1367, "Select ToolsTCLTcl Debugger to run the debugger. Make sure you use the Questa SIM and TDebug menu selections to invoke and close the debugger. ");
MGCAddSnippet(1368, "Select ToolsTCLTcl Debugger to open the TDebug chooser.");
MGCAddSnippet(1369, "To set/unset a breakpoint, double-click inside the listing. The breakpoint will be set at the innermost available expression that contains the position of the click. Conditional or counted breakpoints are not supported.");
MGCAddSnippet(1370, "You can customize TDebug by setting up a file named .tdebugrc in your home directory. ");
MGCAddSnippet(1371, "The Tools menu in the Main window contains a selection for the TclPro Debugger from Scriptics Corporation. This debugger and any available documentation can be acquired from Scriptics. Once acquired, do the following steps to use the TclPro Debugger:");
MGCAddSnippet(1372, "The modelsim.ini file is the default initialization file and contains control variables that specify reference library paths, optimization, compiler and simulator settings, and various other functions. This chapter covers the contents and modification of the modelsim.ini file.");
MGCAddSnippet(1373, "The modelsim.ini file is located in your install directory and is organized into the following sections.");
MGCAddSnippet(1374, "When first installed, the modelsim.ini file is protected as a Read-only file. In order to make and save changes to the file, you must first turn off the Read-only attribute in the modelsim.ini Properties dialog box.");
MGCAddSnippet(1375, "Once the Read-only attribute has been turned off, you can make changes to the values of the variables in the file. ");
MGCAddSnippet(1376, "You can make changes to the working environment during a work session by loading an alternate initialization file that replaces the default modelsim.ini file. This file overrides the file and path specified by the MODELSIM environment variable. ");
MGCAddSnippet(1377, "The Runtime Options dialog box writes changes to the active modelsim.ini file that affect the current session. To access, choose SimulateRuntime Options in the Main window. The dialog contains three tabs - Defaults, Message Severity, and WLF Files.");
MGCAddSnippet(1378, "The modelsim.ini variables are listed in order alphabetically. The following information is given for each variable.");
MGCAddSnippet(1379, "This variable instructs the Verilog compiler to accept only lower case pragmas in Verilog source files.");
MGCAddSnippet(1380, "This variable enables logging a VHDL access variable—both the variable value and any access object that the variable points to during the simulation. ");
MGCAddSnippet(1381, "This variable enables recognition of synthesis and coverage pragmas with a user specified prefix. If this argument is not specified, pragmas are treated as comments and the previously excluded statements included in the synthesized design. All regular synthesis and coverage pragmas are honored.");
MGCAddSnippet(1382, "This variable enables/disables support for checkpointing foreign C++ libraries.");
MGCAddSnippet(1383, "This variable specifies whether vcom adds the declaration of REAL_VECTOR to the STANDARD package. This is useful for designers using VHDL-AMS to test digital parts of their model.");
MGCAddSnippet(1384, "This variable immediately closes files previously opened in the APPEND mode as soon as there is either an explicit call to file_close, or when the file variable's scope is closed. You can override this variable by specifying vsim -noappendclose at the command line.");
MGCAddSnippet(1385, "This variable specifies an alternative file for storing VHDL/PSL/SVA assertion messages. ");
MGCAddSnippet(1386, "This variable enables tracking of currently active assertion threads for a given instance.");
MGCAddSnippet(1387, "This variable limits the number of active assertion threads displayed for a given instance.");
MGCAddSnippet(1388, "This variable enables extended count information for assertions. ");
MGCAddSnippet(1389, "This variable specifies that assertion passes are reported and enables debug options such as assertion thread viewing (ATV), HDL failed expression analysis, extended count information, and causality traceback.");
MGCAddSnippet(1390, "This variable enables VHDL/PSL/SVA assertions.");
MGCAddSnippet(1391, "This variable enables execution of assertion pass actions for vacuous passes in action blocks.");
MGCAddSnippet(1392, "This variable sets an action for a PSL/SVA failure event.");
MGCAddSnippet(1393, "This variable prints SVA concurrent assertion local variable values corresponding to failed assertion threads when you run vsim -assertdebug.");
MGCAddSnippet(1394, "This variable enables transcript logging for PSL assertion failure events.");
MGCAddSnippet(1395, "This variable sets a limit for the number of times Questa SIM responds to a VHDL/PSL/SVA assertion failure event. Questa SIM disables an assertion after reaching the limit.");
MGCAddSnippet(1396, "This variable enables logging of SystemVerilog and PSL assertion pass events.");
MGCAddSnippet(1397, "This variable sets a limit on the number of threads logged for each assertion. If the number of threads logged for an assert directive exceeds the limit, the assertion is either killed or switched off as specified by the AssertionThreadLimitAction variable. ");
MGCAddSnippet(1398, "This variable controls the action taken once the assert limit set by the AssertionThreadLimit variable has been reached. ");
MGCAddSnippet(1399, "This variable controls how many thread start times will be preserved for ATV viewing for a given assertion instance. ");
MGCAddSnippet(1400, "This variable is used to control automatic code coverage exclusions. By default, assertions and FSMs are excluded from the code coverage. For FSMs, all transitions to and from excluded states are also automatically excluded. When  all  is selected, code coverage is enabled for both assertions and FSMs.");
MGCAddSnippet(1401, "Automatically perform logical-to-physical mapping for physical libraries that appear in -L/-Lf options with file system path delimiters (for example, '.' or '/'). The tail of the file system path name will be the logical library name. ");
MGCAddSnippet(1402, "This variable runs batch (non-GUI) simulations. The simulations are executed via scripted files from a Windows command prompt or UNIX terminal and do not provide for interaction with the design during simulation. The BatchMode variable will be ignored if you use the -batch, -c, -gui, or -i options to vsim. Refer to BatchMode for more information about running batch simulations.");
MGCAddSnippet(1403, "This variable enables automatic creation of a transcript file when the simulator runs in batch mode. All transcript data is sent to stdout when this variable is disabled and the simulator is run in batch mode (BatchMode = 1, or vsim -batch). ");
MGCAddSnippet(1404, "This variable instructs Questa SIM to perform VHDL default binding at compile time rather than load time. ");
MGCAddSnippet(1405, "This variable stops the simulator when the severity of a VHDL assertion message or a SystemVerilog severity system task is equal to or higher than the value set for the variable. ");
MGCAddSnippet(1406, "This variable stops the simulator when the severity of a tool message is equal to or higher than the value set for the variable. ");
MGCAddSnippet(1407, "This variable defines the simulator s behavior when encountering unrecognized plusargs. The simulator checks the syntax of all system-defined plusargs to ensure they conform to the syntax defined in the Reference Manual. By default, the simulator does not check syntax or issue warnings for unrecognized plusargs (including accidentally misspelled, system-defined plusargs), because there is no way to distinguish them from a user-defined plusarg. ");
MGCAddSnippet(1408, "This variable specifies that checkpoint files are written in compressed format.");
MGCAddSnippet(1409, "This variable turns on limited synthesis rule compliance checking, which includes checking only signals used (read) by a process and understanding only combinational logic, not clocked logic.");
MGCAddSnippet(1410, "This variable enables visibility into and tracking of class instances.");
MGCAddSnippet(1411, "This variable enables code coverage.");
MGCAddSnippet(1412, "This variable adds the contents of the $CODELINK_HOME/sim/ms.cmd file to the vsim command line. This file contains information required by Questa Codelink during the loading of a simulation. If you do not have $CODELINK_HOME set, a warning will be issued and the simulation will continue. ");
MGCAddSnippet(1413, "This variable specifies the name of a file in which to store the Main window command history.");
MGCAddSnippet(1414, "Specifies a file of common encryption directives for the vencrypt and vhencrypt commands.");
MGCAddSnippet(1415, "This variable specifies a directory for compiler temporary files instead of  work/_temp. ");
MGCAddSnippet(1416, "This variable controls the number of VHDL files open concurrently. This number should be less than the current limit setting for maximum file descriptors.");
MGCAddSnippet(1417, "This variable enables coverage statistic collection.");
MGCAddSnippet(1418, "Enables or disables storage of elaborated parameter overrides to each instance in the UCDB.");
MGCAddSnippet(1419, "This variable specifies the minimum number of times a functional coverage directive must evaluate to true.");
MGCAddSnippet(1420, "This variable enables code coverage of Verilog modules defined by `celldefine and `endcelldefine compiler directives.");
MGCAddSnippet(1421, "This variable enables clock optimization builtins for code coverage. When these clock optimizations are enabled, some branches of VHDL code may be excluded from code coverage, and given a code of ECOP (when not hit). ");
MGCAddSnippet(1422, "This variable controls the set of HDL cover constructs that will be considered for coverage collection.");
MGCAddSnippet(1423, "This variable enables deglitching of statement, branch, condition, and expression code coverage in combinatorial, non-clocked processes. ");
MGCAddSnippet(1424, "This variable controls the period of statement, branch, condition, and expression code coverage deglitching in combinatorial, non-clocked processes. If a process is entered more than once during any period of length  <n> <time_unit> , only the last execution during that period will be added into the coverage data for that process. For a new pass to be counted, it must occur at a time greater than the previous pass plus the deglitch period.");
MGCAddSnippet(1425, "This variable specifies that all PSL/SVA coverage directives in the current simulation are enabled.");
MGCAddSnippet(1426, "This variable excludes VHDL code coverage data collection from the OTHERS branch in both Case statements and Selected Signal Assignment statements.");
MGCAddSnippet(1427, "This variable controls the collection of code coverage for focused expression and condition coverage statistics.");
MGCAddSnippet(1428, "This variable specifies the number of cover directive hits before the directive is auto disabled.");
MGCAddSnippet(1429, "This variable enables transcript logging for functional coverage directive messages.");
MGCAddSnippet(1430, "This variable controls the set of cover constructs that are being considered for coverage collection.");
MGCAddSnippet(1431, "This variable controls the default level of optimizations for compilations with code coverage. ");
MGCAddSnippet(1432, "This variable controls the collection of code coverage for rapid expression and condition coverage statistics. Disabling (0) REC collection converts non-masking conditions in FEC tables to matching input patterns. ");
MGCAddSnippet(1433, "This variable specifies whether you want the VHDL 'H' and 'L' input values on conditions and expressions to be automatically converted to  1  and  0 , respectively.");
MGCAddSnippet(1434, "This variable Enables code coverage reporting of branch conditions that have been optimized away due to a static or null condition. The line of code is labeled EA in the Source Window and EBCS in the hits column in a Coverage Report. ");
MGCAddSnippet(1435, "This variable enables short-circuiting of expressions when coverage is enabled.");
MGCAddSnippet(1436, "This variable controls the collection of code coverage statistics in VHDL subprograms.");
MGCAddSnippet(1437, "This variable sets a limit on the number of threads logged for each cover directive. If the number of threads logged for a cover directive exceeds the limit, the assertion is either killed or switched off as specified by the CoverThreadLimitAction variable. ");
MGCAddSnippet(1438, "This variable controls the action taken once the cover directive limit set by the CoverThreadLimit variable has been reached. ");
MGCAddSnippet(1439, "This variable specifies the relative weighting for functional coverage directives.");
MGCAddSnippet(1440, "This variable specifies the version of the desired GNU compiler supported and distributed by Questa SIM, such as with the entry:");
MGCAddSnippet(1441, "This variable adds any specified C++ compiler options to the sccom command line at the time of invocation.");
MGCAddSnippet(1442, "This variable should point directly to the location of the g++ executable, such as:");
MGCAddSnippet(1443, "This variable controls whether the Verilog system task $fopen or vpi_mcd_open() will create a non-existent directory when opening a file in append (a), or write (w) modes.");
MGCAddSnippet(1444, "This variable enables automatic creation of missing work libraries. ");
MGCAddSnippet(1445, "This variable controls coverage collection for any coverage item (coverpoint, cross, or the entire covergroup) when 0 is assigned as its option.weight. ");
MGCAddSnippet(1446, "Specifies the length of the symmetric session key used by the encryption commands vencrypt and vhencrypt.");
MGCAddSnippet(1447, "This variable specifies the dataset separator for fully-rooted contexts, for example:");
MGCAddSnippet(1448, "This variable defines the kind of force used when not otherwise specified.");
MGCAddSnippet(1449, "This variable determines the default type for a library created with the vlib command.");
MGCAddSnippet(1450, "This variable allows a numeric radix to be specified as a name or number. For example, you can specify binary as  binary  or  2  or octal as  octal  or  8 .");
MGCAddSnippet(1451, "This variable controls the display of enumeric radices.");
MGCAddSnippet(1452, "This variable sets the default behavior for the restart command.");
MGCAddSnippet(1453, "This variable instructs Questa SIM to open VHDL87 files on first read or write, else open files when elaborated.");
MGCAddSnippet(1454, "This variable controls where the simulator outputs system task messages. The display system tasks displayed with this functionality include: $display, $strobe, $monitor, $write as well as the analogous file I/O tasks that write to STDOUT, such as $fwrite or $fdisplay.");
MGCAddSnippet(1455, "This variable specifies the compiler version from the list of support GNU compilers (i.e., 4.5.0, 4.7.4).");
MGCAddSnippet(1456, "This variable specifies an explicit location to a gcc compiler for use with automatically generated DPI export wrappers.");
MGCAddSnippet(1457, "This variable enables DPI out-of-the-blue Verilog function calls. It is also used to enable debugging support for a SystemC thread. The C functions must not be declared as import tasks or functions.");
MGCAddSnippet(1458, "This variable collapses vectors (VCD id entries) in dumpports output.");
MGCAddSnippet(1459, "This variable enables the parsing of embedded PSL statements in VHDL files.");
MGCAddSnippet(1460, "Enables DPI export calls from the SystemC start_of_simualtion() callback. ");
MGCAddSnippet(1461, "This variable, used in conjunction with the SVCoverpointExprVariablePrefix variable, creates variables containing the effective values of Coverpoint expressions. The current settings for both expression variables are displayed in the Object view.");
MGCAddSnippet(1462, "This variable enables support of SystemVerilog 3.1a $typeof() function. This variable has no impact on Verilog 1364-2005 designs.");
MGCAddSnippet(1463, "This variable initializes enum variables in SystemVerilog using either the default value of the base type or the leftmost value. ");
MGCAddSnippet(1464, "This variable changes the severity of the listed message numbers to  error. ");
MGCAddSnippet(1465, "This variable specifies an alternative file for storing error messages. By default, error messages are output to the file specified by the TranscriptFile variable in the modelsim.ini file. If the ErrorFile variable is specified, all error messages will be stored in the specified file, not in the transcript.");
MGCAddSnippet(1466, "This variable enables the resolving of ambiguous function overloading in favor of the  explicit  function declaration (not the one automatically created by the compiler for each type declaration). Using this variable makes Questa Sim compatible with common industry practice.");
MGCAddSnippet(1467, "This variable specifies one of three modes for extended toggle coverage. ");
MGCAddSnippet(1468, "This variable changes the severity of the listed message numbers to  fatal . ");
MGCAddSnippet(1469, "This variable limits the number of counts that are tracked for Focused Expression Coverage. Specifically, when a bin has reached the specified count, coverage will ignore further tracking of the inputs linked to the bin.");
MGCAddSnippet(1470, "This variable increases or decreases the limit on the size of FEC expressions and conditions considered for coverage. A higher FecEffort value allows more expressions/conditions to be considered for coverage, though as a result, the compile, optimization and simulation times may increase.");
MGCAddSnippet(1471, "This variable increases or decreases the limit on the size of FEC/UDP expressions and conditions considered for coverage. A higher FecUdpEffort value allows more expressions/conditions to be considered for coverage, though as a result, the compile, optimization and simulation times may increase.");
MGCAddSnippet(1472, "This variable sets the size in bytes for flat library file pages. Very large libraries may benefit from a larger value, at the expense of disk space.");
MGCAddSnippet(1473, "This variable sets the percentage of total pages deleted before library cleanup can occur. This setting is applied together with FlatLibPageDeleteThreshold.");
MGCAddSnippet(1474, "Set the number of pages deleted before library cleanup can occur. This setting is applied together with FlatLibPageDeletePercentage.");
MGCAddSnippet(1475, "This variable sets the path to the library containing VHDL floating and fixed point packages.");
MGCAddSnippet(1476, "This variable controls the iteration of events when a VHDL signal is forced to a value.");
MGCAddSnippet(1477, "This variable controls whether untyped Verilog parameters in mixed-language designs that are initialized with unsigned values between 2*31-1 and 2*32 are converted to VHDL generics of type INTEGER or ignored. If mapped to VHDL Integers, Verilog values greater than 2*31-1 (2147483647) are mapped to negative values. Default is to map these parameter to generic of type INTEGER. ");
MGCAddSnippet(1478, "This variable controls recognition of FSM Implicit Transitions.");
MGCAddSnippet(1479, "This variable controls the recognition of asynchronous reset transitions in FSMs.");
MGCAddSnippet(1480, "This variable controls the recognition of FSMs with a single-bit current state variable.");
MGCAddSnippet(1481, "This variable controls the recognition of FSMs where a current-state or next-state variable has been assigned  X  in a case statement.");
MGCAddSnippet(1482, "This variable sets the memory threshold for SystemVerilog garbage collection. ");
MGCAddSnippet(1483, "This variable sets the memory threshold for SystemVerilog garbage collection when class debug mode is enabled with vsim -classdebug. ");
MGCAddSnippet(1484, "This variable controls the format of the old-style VHDL for … generate statement region name for each iteration. ");
MGCAddSnippet(1485, "This variable specifies the maximum number of iterations permitted for a generate loop; restricting this permits the implementation to recognize infinite generate loops.");
MGCAddSnippet(1486, "This variable specifies the maximum depth permitted for a recursive generate instantiation; restricting this permits the implementation to recognize infinite recursions.");
MGCAddSnippet(1487, "Controls parsing of identifiers input to the simulator. If this variable is on (value = 1), either VHDL extended identifiers or Verilog escaped identifier syntax may be used for objects of either language kind. This provides backward compatibility with older .do files, which often contain pure VHDL extended identifier syntax, even for escaped identifiers in Verilog design regions.");
MGCAddSnippet(1488, "For the vopt flow, this variable instructs Questa SIM to load the specified shared objects library with global symbol visibility. Essentially, setting this variable is required if the SystemC top is elaborated in vopt and is depending on the symbols from a common library being loaded with the GlobalSharedObjectList variable for vsim (or using vsim -gblso).  For vsim, this variable instructs Questa SIM to load the specified PLI/FLI shared objects with global symbol visibility. Essentially, setting this variable exports the local data and function symbols from each shared object as global symbols so they become visible among all other shared objects. Exported symbol names must be unique across all shared objects.");
MGCAddSnippet(1489, "This variable turns on Verilog hazard checking (order-dependent accessing of global variables).");
MGCAddSnippet(1490, "This variable sets the path to the library containing IEEE and Synopsys arithmetic packages.");
MGCAddSnippet(1491, "This variable instructs Questa SIM to disable runtime error messages.");
MGCAddSnippet(1492, "This variable instructs Questa SIM to disable runtime failure messages.");
MGCAddSnippet(1493, "This variable instructs Questa SIM to disable runtime note messages.");
MGCAddSnippet(1494, "This variable instructs the compiler to ignore synthesis and coverage pragmas with the specified prefix name. The affected pragmas will be treated as regular comments.");
MGCAddSnippet(1495, "This variable instructs ModelSim to ignore the REAL_VECTOR declaration in package STANDARD when compiling with vcom -2008. For more information refer to the REAL_VECTOR section in HelpTechnotesvhdl2008migration technote.");
MGCAddSnippet(1496, "This variable instructs Questa SIM to disable SystemVerilog assertion messages for Error severity and suppresses output of elaboration system $error tasks.");
MGCAddSnippet(1497, "This variable instructs Questa SIM to disable SystemVerilog assertion messages for Fatal severity (for vsim command) and suppresses output of elaboration system $fatal tasks (for vsim and vopt commands). ");
MGCAddSnippet(1498, "This variable instructs Questa SIM to disable SystemVerilog assertion messages for Info severity and suppresses output of elaboration system $info tasks.");
MGCAddSnippet(1499, "This variable instructs Questa SIM to disable SystemVerilog assertion messages for Warning severity and suppresses output of elaboration system $warning tasks.");
MGCAddSnippet(1500, "This variable instructs Questa SIM to ignore VITAL compliance checking errors.");
MGCAddSnippet(1501, "This variable instructs Questa SIM to disable runtime warning messages.");
MGCAddSnippet(1502, "This variable instructs Questa SIM to run continuous assignments before other normal priority processes that are scheduled in the same iteration. This event ordering minimizes race differences between optimized and non-optimized designs and is the default behavior. ");
MGCAddSnippet(1503, "This variable limits the number of times an include file can be called during compilation. This prevents cases where an include file could be called repeatedly.");
MGCAddSnippet(1504, "This variable controls how subprogram output parameters of array and record types are treated.");
MGCAddSnippet(1505, "This variable specifies a limit on simulation kernel iterations allowed without advancing time.");
MGCAddSnippet(1506, "Specifies the location of the common and toolblock files used by the vencrypt and vhencrypt commands.");
MGCAddSnippet(1507, "This variable controls whether  large object  warning messages are issued or not. Warning messages are issued when the limit specified in the variable LargeObjectSize is reached.");
MGCAddSnippet(1508, "This variable specifies the relative size of log, wave, or list objects in bytes that will trigger  large object  messages. This size value is an approximation of the number of bytes needed to store the value of the object before compression and optimization.");
MGCAddSnippet(1509, "This variable specifies the location of one or more resource libraries containing a precompiled package. The behavior of this variable is identical to specifying the -L <libname> command line option with vlog or vsim. ");
MGCAddSnippet(1510, "This variable controls the license file search.");
MGCAddSnippet(1511, "This variable specifies a maximum limit for the number of Cross (bin) products reported against a Cross when a XML or UCDB report is generated. The warning is issued if the limit is crossed.");
MGCAddSnippet(1512, "This variable limits the number of  bin_rhs  values associated with cross bins in the XML version of the coverage report for a SystemVerilog design. It also limits the values saved to a UCDB.");
MGCAddSnippet(1513, "This variable limits the maximum number of Coverpoint bins allowed in the whole design.");
MGCAddSnippet(1514, "This variable limits the maximum number of Coverpoint bins allowed in any instance of a Covergroup.");
MGCAddSnippet(1515, "This variable issues a warning when the number of Coverpoint bins in the design exceeds the value specified by <n>.");
MGCAddSnippet(1516, "This variable issues a warning when the number of Coverpoint bins in any instance of a Covergroup exceeds the value specified by <n>.");
MGCAddSnippet(1517, "This variable defines the format of VHDL/PSL/SVA assertion messages as well as normal error messages.");
MGCAddSnippet(1518, "This variable defines the format of messages for VHDL/PSL/SVA assertions that trigger a breakpoint.");
MGCAddSnippet(1519, "This variable defines the format of messages for VHDL/PSL/SVA assertions that trigger a breakpoint.");
MGCAddSnippet(1520, "This variable defines the format of all error messages. If undefined, MessageFormat is used unless the error causes a breakpoint in which case MessageFormatBreak is used.");
MGCAddSnippet(1521, "This variable defines the format of messages for VHDL/PSL/SVA Fail assertions.");
MGCAddSnippet(1522, "This variable defines the format of messages for VHDL/PSL/SVA Fatal assertions.");
MGCAddSnippet(1523, "This variable defines the format of messages for VHDL/PSL/SVA Note assertions.");
MGCAddSnippet(1524, "This variable defines the format of messages for VHDL/PSL/SVA Warning assertions.");
MGCAddSnippet(1525, "This variable supports mixed ANSI and non-ANSI port declarations and task/function declarations. ");
MGCAddSnippet(1526, "This variable sets the path to the library containing Mentor Graphics VHDL utilities such as Signal Spy.");
MGCAddSnippet(1527, "This variable limits the number of times warning messages will be displayed. The default limit value is five.");
MGCAddSnippet(1528, "This variable controls where the simulator outputs elaboration and runtime messages. ");
MGCAddSnippet(1529, "This variable sets the path to the location of the Advanced Verification Methodology libraries.");
MGCAddSnippet(1530, "This variable sets the path to the location of the Open Verification Methodology libraries.");
MGCAddSnippet(1531, "This variable sets the path to the location of Power Aware libraries.");
MGCAddSnippet(1532, "This variable sets the path to the location of Unified Power Format (UPF) libraries.");
MGCAddSnippet(1533, "This variable sets the path to the location of the Universal Verification Methodology libraries.");
MGCAddSnippet(1534, "This variable controls whether Verilog files are compiled separately or concatenated into a single compilation unit.");
MGCAddSnippet(1535, "This variable specifies the location of the installation of Questa Verification IPs (which previously were known as Multi-View Verification Components (MVC)).");
MGCAddSnippet(1536, "This variable changes case statement static errors to warnings.");
MGCAddSnippet(1537, "This variable controls inclusion of debugging info within design units.");
MGCAddSnippet(1538, "This variable controls the reporting of range and length violations detected within subprograms as errors (instead of as warnings). ");
MGCAddSnippet(1539, "This variable controls run time index checks.");
MGCAddSnippet(1540, "This variable disables errors caused by aggregates that are not locally static.");
MGCAddSnippet(1541, "This variable disables run time range checking. In some designs this results in a 2x speed increase.");
MGCAddSnippet(1542, "This variable changes the severity of the listed message numbers to  note .");
MGCAddSnippet(1543, "This variable disables acceleration of the VITAL packages.");
MGCAddSnippet(1544, "This variable disables VITAL level 0 and VITAL level 1 compliance checking.");
MGCAddSnippet(1545, "This variable disables warnings generated within the accelerated numeric_std and numeric_bit packages.");
MGCAddSnippet(1546, "Controls visibility of VHDL component configurations during compile. ");
MGCAddSnippet(1547, "This variable instructs the simulator to use a previous style of naming (pre-6.6) for VHDL for … generate statement iteration names in the design hierarchy.");
MGCAddSnippet(1548, "This variable controls the behavior of Questa SIM when it encounters either an assertion failure, a $finish, or an sc_stop() in the design code. Stopping can aid post-simulation debug by allowing you to examine the state of the design prior to exiting.");
MGCAddSnippet(1549, "This variable prints pending deferred assertion messages. Deferred assertion messages may be scheduled after the $finish in the same time step. Deferred assertions scheduled to print after the $finish are printed to the Transcript before exiting. They are printed with severity level NOTE because it is not known whether the assertion is still valid due to being printed in the active region instead of the reactive region where they are normally printed.");
MGCAddSnippet(1550, "This variable disables optimization for the IEEE std_logic_1164 package.");
MGCAddSnippet(1551, "This variable sets the path to the location of the pre-compiled Open Source VHDL Verification Methodology library.");
MGCAddSnippet(1552, "This variable may be set to zero (0) to disable parallel processing during vopt code generation phase. Normally a heuristic is used to set this value.");
MGCAddSnippet(1553, "This variable specifies the character used for hierarchical boundaries of HDL modules. This variable does not affect file system paths. The argument to PathSeparator must not be the same character as DatasetSeparator. This variable setting is also the default for the SignalSpyPathSeparator variable.");
MGCAddSnippet(1554, "This variable forces display of an error message (rather than a warning) on a variety of conditions. It overrides the NoCaseStaticError and NoOthersStaticError variables.");
MGCAddSnippet(1555, "This variable specifies the VPI object model behavior within vsim.");
MGCAddSnippet(1556, "This variable instructs the VHDL compiler either to preserve the case of letters in basic VHDL identifiers or to convert uppercase letters to lowercase.");
MGCAddSnippet(1557, "This variable instructs the simulator to print out simulation statistics at the end of the simulation before it exits. Statistics are printed with relevant units in separate lines. The Stats variable overrides the PrintSimStats if the two are both enabled.");
MGCAddSnippet(1558, "This variable prints the attribute placed upon SV packages during package import when true (1). The attribute will be ignored when this variable entry is false (0). The attribute name is  package_load_message.  The value of this attribute is a string literal.");
MGCAddSnippet(1559, "This variable enables protect directive processing.");
MGCAddSnippet(1560, "This variable affects PSL directives with top level  always/never  properties. As per strict IEEE Std 1850-2005, an always/never property can either pass or fail. However, by default, Questa SIM reports multiple passes and/or failures, which corresponds to multiple attempts made while executing a top level  always/never  property. With this variable, you can force a single attempt to start at the beginning of simulation. The directive will either match (pass), fail, or vacuously-match (provided it is not disabled/aborted). If the  always/never  property fails, the directive is immediately considered a failure and the simulation will not go further. If there is no failure (or disable/abort) until end of simulation then a match (pass) is reported. By default, this feature is off and can only be explicitly turned on using this variable or vsim ‑psloneattempt.");
MGCAddSnippet(1561, "This variable allows you to specify the number of clock ticks that will represent infinite clock ticks. It only affects PSL strong operators, namely eventually!, until! and until_!. If at End of Simulation an active strong-property has not clocked this number of clock ticks, neither pass nor fail (that is, vacuous match) is returned; else, respective fail/pass is returned. The default value is '0' (zero) which effectively does not check for clock tick condition. This feature can only be explicitly turned on using this variable or vsim ‑pslinfinitethreshold.");
MGCAddSnippet(1562, "This variable turns off  loading…  messages.");
MGCAddSnippet(1563, "This variable instructs the compiler to not generate any default bindings when compiling with vcom and when elaborating with vsim. All instances are left unbound unless you specifically write a configuration specification or a component configuration that applies to the instance. You must explicitly bind all components in the design through either configuration specifications or configurations. If an explicit binding is not fully specified, defaults for the architecture, port maps, and generic maps will be used as needed. ");
MGCAddSnippet(1564, "This variable specifies the simulator resolution. The argument must be less than or equal to the UserTimeUnit and must not contain a space between value and units.");
MGCAddSnippet(1565, "This variable specifies the default simulation length in units specified by the UserTimeUnit variable.");
MGCAddSnippet(1566, "This variable activates optimizations on expressions that do not involve signals, waits, or function/procedure/task invocations.");
MGCAddSnippet(1567, "This variable creates a log file for sccom.");
MGCAddSnippet(1568, "This variable prints the name of each sc_module encountered during compilation.");
MGCAddSnippet(1569, "This variable enables a check for multiple writers on a SystemC signal.");
MGCAddSnippet(1570, "This variable determines when the sc_main thread exits. This variable is used to turn off the execution of remainder of sc_main upon quitting the current simulation session. Disabling this variable (0) has the following effect: If the cumulative length of sc_main() in simulation time units is less than the length of the current simulation run upon quit or restart, sc_main() is aborted in the middle of execution. This can cause the simulator to crash if the code in sc_main is dependent on a particular simulation state.  On the other hand, one drawback of not running sc_main until the end is potential memory leaks for objects created by sc_main. By default, the remainder of sc_main is executed regardless of delays. ");
MGCAddSnippet(1571, "This variable sets the stack size for the sc_main() thread process.");
MGCAddSnippet(1572, "This variable sets the stack size for the sc_thread process and the implicitly created DPI-SC thread.");
MGCAddSnippet(1573, "This variable displays warning messages for many of the deprecated features in Annex C of the IEEE Std 1666-2005, and Std 1666-2011, Standard SystemC Language Reference Manual.");
MGCAddSnippet(1574, "This variable sets the default time unit for SystemC simulations.");
MGCAddSnippet(1575, "This variable changes the precise name used by SCV to specify  phase  transactions in the WLF file. ");
MGCAddSnippet(1576, "This variable allows the declaration of a VHDL configuration to occur in a different library than the entity being configured. Strict conformance to the VHDL standard (LRM) requires that they be in the same library.");
MGCAddSnippet(1577, "This variable instructs Questa SIM to generate a warning whenever an unknown plus argument is encountered.");
MGCAddSnippet(1578, "This variable instructs Questa SIM to display lint warning messages.");
MGCAddSnippet(1579, "This variable instructs Questa SIM to display PSL warning messages.");
MGCAddSnippet(1580, "This variable shows source line containing error.");
MGCAddSnippet(1581, "This variable enables VITAL compliance-check warnings.");
MGCAddSnippet(1582, "This variable enables unbound-component warnings.");
MGCAddSnippet(1583, "This variable enables process-without-a-wait-statement warnings.");
MGCAddSnippet(1584, "This variable enables null-range warnings.");
MGCAddSnippet(1585, "This variable enables no-space-in-time-literal warnings.");
MGCAddSnippet(1586, "This variable enables multiple-drivers-on-unresolved-signal warnings.");
MGCAddSnippet(1587, "This variable controls the display of immediate assertions with constant expressions. By default, immediate assertions with constant expressions are displayed in the GUI, in reports, and in the UCDB.");
MGCAddSnippet(1588, "This variable sets the format for Breakpoint and Fatal error messages. When set to 1 (the default value), messages will display the name of the function, task, subprogram, module, or architecture where the condition occurred, in addition to the file and line number. Set to 0 to revert messages to the previous format.");
MGCAddSnippet(1589, "This variable instructs Questa SIM to display unassociated SystemC name warnings.");
MGCAddSnippet(1590, "This variable instructs Questa SIM to display un-debuggable SystemC type warnings.");
MGCAddSnippet(1591, "This variable calls the write format restart command upon exit and executes the .do file created by that command. This variable should be set to the name of the file to be written, or the value  ‑‑disable-auto-save  to disable this feature. If the filename contains the pound sign character (#), then the filename will be sequenced with a number replacing the #. For example, if the file is  restart#.do , then the first time it will create the file  restart1.do  and the second time it will create  restart2.do , and so forth.");
MGCAddSnippet(1592, "Set this variable to 1 cause the signal_force VHDL and Verilog functions use the default radix when processing the force value. Prior to 10.2 signal_force used the default radix and now it always uses symbolic unless the value explicitly indicates a base radix.");
MGCAddSnippet(1593, "This variable specifies a unique path separator for the Signal Spy functions. The argument to SignalSpyPathSeparator must not be the same character as the DatasetSeparator variable.");
MGCAddSnippet(1594, "This variable instructs Questa SIM to assume directives are simulated as if they were assert directives. ");
MGCAddSnippet(1595, "This variable controls whether or not SVA and VHDL immediate assertion directives will be simulated.");
MGCAddSnippet(1596, "This variable controls whether or not PSL assertion directives will be elaborated. ");
MGCAddSnippet(1597, "This variable controls whether or not SVA concurrent assertion directives will be elaborated.");
MGCAddSnippet(1598, "This variable reduces the size of design libraries by minimizing the amount of debugging symbol files generated at compile time. Default is to generate debugging symbol database file for all design-units.");
MGCAddSnippet(1599, "This variable specifies the maximum size randomize() will allow a dynamic array to be resized. If randomize() attempts to resize a dynamic array to a value greater than SolveArrayResizeMax, an error will be displayed and randomize() will fail. ");
MGCAddSnippet(1600, "This variable modifies the severity of suppressible index, out-of-bounds, null-dereference, solve/before constraint errors. ");
MGCAddSnippet(1601, "This variable specifies which solver engine to use when evaluating randomize calls. ");
MGCAddSnippet(1602, "This variable enables debugging SystemVerilog randomize() failures. By default, (SolveFailDebug - 1) Questa SIM generates a constraint contradiction report for randomize() calls that fail due to having no solutions when SolveFailSeverity is set to a non-zero value. The report displays the minimum set of constraints that caused the randomize() call to fail.");
MGCAddSnippet(1603, "Defines the severity of messages that result when a SystemVerilog call to randomize() and randomize(null) fails. When you specify a single argument, the severity applies to both randomize() and randomize(null). When you specify two arguments (no space between them), the first applies to randomize() and the second applies to randomize(null). ");
MGCAddSnippet(1604, "This variable specifies the maximum number of evaluations that may be performed on the solution graph generated during randomize(). This value can be used to force randomize() to abort if the complexity of the constraint scenario (in time) exceeds the specified limit. The value is specified in 10000s of evaluations. ");
MGCAddSnippet(1605, "This variable specifies the maximum size of the solution graph that may be generated during a SystemVerilog call to randomize(). You can use this value to force randomize() to abort if the complexity of the constraint scenario exceeds the specified limit. The limit is specified in 1000s of nodes. ");
MGCAddSnippet(1606, "This variable allows you to specify random sequence generator compatibility with a prior letter release for the SystemVerilog solver. (It does not apply to the SystemC/SCV solver.) This option is used to get the same random sequences during simulation as a prior letter release.");
MGCAddSnippet(1607, "This variable allows you to specify the solver timeout threshold (in seconds), to improve the handling of randomize() timeouts. A randomize() call will fail if the CPU time required to evaluate any randset exceeds the specified timeout. ");
MGCAddSnippet(1608, "This variable specifies the size at which memories will automatically be marked as sparse memory. A memory with depth equal to or more than the sparse memory threshold gets marked as sparse automatically, unless specified otherwise in source code or by vlog +nonsparse, or vopt +nonsparse.");
MGCAddSnippet(1609, "This variable specifies the depth of stack frames returned by the level argument to the $stacktrace() function call. The depth specified is used when the optional  level  argument is not specified or its value is not a positive integer. ");
MGCAddSnippet(1610, "This variable specifies a simulation startup DO file.");
MGCAddSnippet(1611, "This variable controls the display of statistics messages in a logfile and stdout. Stats variable overrides PrintSimStats variable if both are enabled. ");
MGCAddSnippet(1612, "This variable sets the path to the VHDL STD library.");
MGCAddSnippet(1613, "This variable sets the path to the libraries for Mentor Graphics standard developer s kit.");
MGCAddSnippet(1614, "This variable suppresses warnings generated within the accelerated Synopsys std_arith packages.");
MGCAddSnippet(1615, "This variable suppresses the listed message numbers and/or message code strings (displayed in square brackets).");
MGCAddSnippet(1616, "This variable suppresses a prompt from the GUI asking if ModelSim file types should be applied to the current version.");
MGCAddSnippet(1617, "This is a read-only variable that shows the initial seed specified for the Random Number Generator (RNG) of the root thread in SystemVerilog. You cannot change its value directly in the  modelsim.ini file. ");
MGCAddSnippet(1618, "This variable sets the path to the SystemVerilog STD library.");
MGCAddSnippet(1619, "This variable controls the printing of user-defined assertion error messages along with severity information.");
MGCAddSnippet(1620, "This variable allows you to specify an override for the default value of the  get_inst_coverage  option for Covergroup variables. This is a compile time option which forces  get_inst_coverage  to a user specified default value and supersedes the SystemVerilog specified default value of '0' (zero).");
MGCAddSnippet(1621, "This variable is used to override both the default value of option.goal (100, unless otherwise set with the SVCovergroupGoalDefault compiler control variable), as well as any explicit assignments to covergroup, coverpoint, and cross option.goal placed in SystemVerilog.");
MGCAddSnippet(1622, "This variable is used in conjunction with the SVCovergroupGoal simulator control variable, and overrides the default value of the SystemVerilog covergroup, coverpoint, and cross option.goal (defined to be 100 in the IEEE Std 1800-2009). This variable does not override specific assignments in SystemVerilog source code. ");
MGCAddSnippet(1623, "This variable exists in the vsim sections of the modelsim.ini file.");
MGCAddSnippet(1624, "This variable is used to set the default value for SystemVerilog option.per_instance (defined to be 0 in the IEEE Std 1800-2009). It does not override explicit assignments to option.per_instance. ");
MGCAddSnippet(1625, "This variable is used to enable generation of more detailed information about the sampling of covergroup, cross, and coverpoints. It provides details about the number of times the covergroup instance and type were sampled, as well as details about why covergroup, cross, and coverpoint were not covered.");
MGCAddSnippet(1626, "This variable is used to override both the default value of type_option.strobe (0, unless otherwise set with the SVCovergroupStrobeDefault variable), as well as any user assignments for covergroup, coverpoint, and cross type_option.strobe, placed in SystemVerilog.");
MGCAddSnippet(1627, "This variable is used in conjunction with the SVCovergroupStrobe variable, and overrides the SystemVerilog covergroup type_option.strobe (defined to be 0 in the IEEE Std 1800-2009). It does not override explicit assignments to type_option.strobe. ");
MGCAddSnippet(1628, "This variable is used to override both the default value of type_option.goal (100, unless otherwise set with the SVCovergroupTypeGoalDefault variable), as well as any user assignments for covergroup, coverpoint, and cross type_option.goal, placed in SystemVerilog. ");
MGCAddSnippet(1629, "This variable is used to override the default value of the SystemVerilog covergroup, coverpoint, and cross type_option.goal (defined to be 100 in the IEEE Std 1800-2009). It does not override specific assignments in SystemVerilog source code. ");
MGCAddSnippet(1630, "This variable is used to disable coverage collection for any coverage item (coverpoint or cross or the entire covergroup), when 0 is assigned as its option.weight. Item will not be displayed in any coverage report, nor will it contribute to any coverage score computation.");
MGCAddSnippet(1631, "This variable is used to override both the default value of option.auto_bin_max (64), as well as any explicit assignments in source code to SystemVerilog covergroup option.auto_bin_max.");
MGCAddSnippet(1632, "When GenerateLoopIterationMax = 1, this variable sets the prefix in the name of the user-visible variable generated for the coverpoint expression sampled value.");
MGCAddSnippet(1633, "This variable sets the threshold value range beyond which a warning for SV Coverpoint wildcard bin size is issued. The default threshold is 4096 (12 wildcard bits).");
MGCAddSnippet(1634, "This variable is used to override all other settings for the number of missing values that will be printed to the coverage report. It overrides both the default value (0, unless otherwise set with the SVCrossNumPrintMissingDefault variable), as well as any user assignments placed in SystemVerilog.");
MGCAddSnippet(1635, "This variable is used in conjunction with SVCrossNumPrintMissing variable, and overrides the default value of the SystemVerilog covergroup option.cross_num_print_missing (defined to be 0 in the IEEE Std 1800-2009). ");
MGCAddSnippet(1636, "This variable enables SystemVerilog language extensions. The extensions enable non-LRM compliant behavior. ");
MGCAddSnippet(1637, "Defines one or more filename suffixes that identify a file as a SystemVerilog file. ");
MGCAddSnippet(1638, "This variable instructs the vlog compiler to compile in SystemVerilog mode. This variable does not exist in the default modelsim.ini file, but is added when you select Use SystemVerilog in the Compile Options dialog box > Verilog and SystemVerilog tab.");
MGCAddSnippet(1639, "This variable controls the formatting of '%p' and '%P' conversion specifications used in $display and similar system tasks. ");
MGCAddSnippet(1640, "Enables or disables non-LRM compliant SystemVerilog constrained random language extensions. ");
MGCAddSnippet(1641, "This variable sets the path to the accelerated arithmetic packages.");
MGCAddSnippet(1642, "This variable causes compilers to force data to be written to disk when files are closed. ");
MGCAddSnippet(1643, "This variable limits the toggle coverage count for a toggle node. After the limit is reached, further activity on the node will be ignored for toggle coverage. All possible transition edges must reach this count for the limit to take effect. For example, if you are collecting toggle data on 0->1 and 1->0 transitions, both transition counts must reach the limit. If you are collecting full data on 6 edge transitions, all 6 must reach the limit. If the limit is set to zero, then it is treated as unlimited.");
MGCAddSnippet(1644, "This variable controls the period of toggle deglitching.");
MGCAddSnippet(1645, "This variable is used to control whether Verilog fixed-size unpacked arrays, VHDL multi-dimensional arrays, and VHDL arrays-of-arrays are included for toggle coverage. ");
MGCAddSnippet(1646, "This variable is used to control the limit on the size of Verilog fixed-size unpacked arrays, VHDL multi-dimensional arrays, and VHDL arrays-of-arrays that are included for toggle coverage. Increasing the size of the limit has the effect of increasing the size of the array that can be included for toggle coverage.");
MGCAddSnippet(1647, "This variable sets the maximum number of unique VHDL integer values to record with toggle coverage.");
MGCAddSnippet(1648, "This variable sets the maximum number of unique SystemVerilog real values to record with toggle coverage.");
MGCAddSnippet(1649, "This variable controls the automatic inclusion of VHDL integer types in toggle coverage.");
MGCAddSnippet(1650, "This variable treats Verilog multi-dimensional packed vectors and packed structures as equivalently sized one_dimensional packed vectors for toggle coverage. ");
MGCAddSnippet(1651, "This variable controls the inclusion into toggle coverage numbers of ports only; when enabled, all internal nodes are not included in the coverage numbers. When disabled, both ports and internal nodes are included. In order for this variable to function properly, you must also use  vopt +acc=p . ");
MGCAddSnippet(1652, "This variable controls the inclusion of VHDL records in toggle coverage metrics. By default, VHDL records are included in coverage.");
MGCAddSnippet(1653, "This variable treats Verilog enumerated types as equivalently sized one-dimensional packed vectors for toggle coverage.");
MGCAddSnippet(1654, "This variable controls toggle coverage for SystemVerilog integer types (that is, byte, shortint, int, longint, but not enumeration types).");
MGCAddSnippet(1655, "This variable controls toggle coverage for SystemVerilog real value types.");
MGCAddSnippet(1656, "This variable limits the width of signals that are automatically added to toggle coverage with the +cover=t argument for vcom or vlog. The limit applies to Verilog registers and VHDL arrays. A value of 0 is taken as unlimited. ");
MGCAddSnippet(1657, "Specifies the file containing one or multiple toolblock directives to be used by the vencrypt and vhencrypt commands.");
MGCAddSnippet(1658, "This variable specifies a file for saving a command transcript. You can specify environment variables in the pathname.");
MGCAddSnippet(1659, "This variable specifies the default unified coverage database file name that is written at the end of the simulation. If this variable is set, the UCDB is saved automatically at the end of simulation. All coverage statistics are saved to the specified .ucdb file.");
MGCAddSnippet(1660, "This variable specifies a regular expression which, if matched when compared against all messages, prevents the status of that message from being propagated to the UCDB TESTSTATUS. If this variable is set, the matching regular expression is ignored for all messages which contain that match.");
MGCAddSnippet(1661, "This variable controls the inclusion or exclusion of unattempted (un-executed) immediate assertions from the coverage calculations shown in the UCDB and coverage reports.");
MGCAddSnippet(1662, "This variable controls VHDL files open for write.");
MGCAddSnippet(1663, "This variable allows you to manage the undefined symbols in the shared libraries currently being loaded into the simulator.");
MGCAddSnippet(1664, "This variable instructs Questa SIM to activate the conversion of regular Verilog identifiers to uppercase and allows case insensitivity for module names.");
MGCAddSnippet(1665, "This variable specifies the multiplier for simulation time units and the default time units for commands such as force and run. Generally, you should set this variable to default, in which case it takes the value of the Resolution variable. ");
MGCAddSnippet(1666, "This variable enables the use of SCV include files and verification library.");
MGCAddSnippet(1667, "Specify whether to display and report the value of the  cross_num_print_missing  option for the Cross in Covergroups. If not specified then  cross_num_print_missing  is ignored for creating reports and displaying covergroups in GUI. Default is 0, which means ignore  cross_num_print_missing.  ");
MGCAddSnippet(1668, "This variable controls automatic linking of the precompiled UVMC libraries shipped with Questa SIM. ");
MGCAddSnippet(1669, "This variable controls UVM-Aware debug features. These features work with either a standard Accelera-released open source toolkit or the pre-compiled UVM library package in Questa SIM.");
MGCAddSnippet(1670, "This variable sets the path to the library containing VHDL/Verilog type mappings.");
MGCAddSnippet(1671, "This variable specifies a list of dynamically loadable objects for Verilog interface applications.");
MGCAddSnippet(1672, "This variable enables support for VHDL language version.");
MGCAddSnippet(1673, "This variable turns off sharing of a package from a library between two or more PDUs. Each PDU will have a separate copy of the package. By default PDUs calling the same package from a library share one copy of that package. ");
MGCAddSnippet(1674, "This switch makes it possible for process variables to be recursively logged or added to the Wave and List windows (process variables can still be logged or added to the Wave and List windows explicitly with or without this switch). ");
MGCAddSnippet(1675, "This variable sets the path to the VITAL 2000 library.");
MGCAddSnippet(1676, "This variable instructs Questa SIM to disable SystemVerilog and Verilog 2001 support, making the compiler revert to IEEE Std 1364-1995 syntax.");
MGCAddSnippet(1677, "This variable controls whether a warning is issued when the change command changes the value of a VHDL constant or generic.");
MGCAddSnippet(1678, "This variable changes the severity of the listed message numbers to  warning .");
MGCAddSnippet(1679, "This variable controls the number of visible hierarchical regions of a signal name shown in the Wave Window.");
MGCAddSnippet(1680, "Controls whether the encryption commands encrypt the entire file by either ignoring or using all pragmas that are present in the input.");
MGCAddSnippet(1681, "This variable sets the default list of object types that are excluded when performing wildcard matches with simulator commands. The default WildcardFilter variables are loaded every time you invoke the simulator. ");
MGCAddSnippet(1682, "This variable prevents logging of very large non-dynamic objects when performing wildcard matches with simulator commands, for example,  log -r*  and  add wave * . Objects of size equal to or greater than the WildcardSizeThreshold setting will be filtered out of wildcard matches. The size is a simple calculation of the number of bits or items in the object.");
MGCAddSnippet(1683, "This variable controls whether warning messages are output when objects are filtered out due to the WildcardSizeThreshold variable.");
MGCAddSnippet(1684, "This variable sets the number of megabytes for the WLF reader cache. WLF reader caching caches blocks of the WLF file to reduce redundant file I/O.");
MGCAddSnippet(1685, "This variable controls when the WLF file records values.");
MGCAddSnippet(1686, "This variable enables WLF file compression.");
MGCAddSnippet(1687, "This variable specifies whether a WLF file should be deleted when the simulation ends.");
MGCAddSnippet(1688, "This variable controls overwrite permission for the WLF file. ");
MGCAddSnippet(1689, "This variable specifies the default WLF file name.");
MGCAddSnippet(1690, "This variable specifies whether the viewing of waveforms is optimized.");
MGCAddSnippet(1691, "This variable specifies the regions to save in the WLF file.");
MGCAddSnippet(1692, "This variable sets the number of megabytes for the WLF reader cache for the current simulation dataset only. WLF reader caching caches blocks of the WLF file to reduce redundant file I/O. This makes it easier to set different sizes for the WLF reader cache used during simulation, and those used during post-simulation debug. If the WLFSimCacheSize variable is not specified, the WLFCacheSize variable is used.");
MGCAddSnippet(1693, "This variable limits the WLF file by size (as closely as possible) to the specified number of megabytes; if both size (WLFSizeLimit) and time (WLFTimeLimit) limits are specified the most restrictive is used.");
MGCAddSnippet(1694, "This variable limits the WLF file by time (as closely as possible) to the specified amount of time. If both time and size limits are specified the most restrictive is used. ");
MGCAddSnippet(1695, "This variable specifies the update interval for the WLF file. After the interval has elapsed, the live data is flushed to the .wlf file, providing an up to date view of the live simulation. If you specify 0, the live view of the wlf file is correct, however the file update lags behind the live simulation.");
MGCAddSnippet(1696, "This variable specifies whether the logging of information to the WLF file is performed using multithreading.");
MGCAddSnippet(1697, "This variable defines the column width when wrapping output lines in the transcript file.");
MGCAddSnippet(1698, "This variable controls wrapping of output lines in the transcript file.");
MGCAddSnippet(1699, "This variable defines the column width when wrapping output lines in the transcript file.");
MGCAddSnippet(1700, "This variable sets the default fail count limit of X propagated assertions. ");
MGCAddSnippet(1701, "Several of the more commonly used modelsim.ini variables are further explained below.");
MGCAddSnippet(1702, "You can use environment variables in the modelsim.ini file. Insert a dollar sign ($) before the name of the environment variable so that its defined value is used. For example:");
MGCAddSnippet(1703, "By adding an  others  clause to your modelsim.ini file, you can have a hierarchy of library mappings. If the Questa SIM tools do not find a mapping in the modelsim.ini file, then they will search only the library section of the initialization file specified by the  others  clause. For example:");
MGCAddSnippet(1704, "You can use the TranscriptFile variable to keep a record of everything that is sent to the transcript from stdout: error messages, assertions, commands, command outputs, and so forth. ");
MGCAddSnippet(1705, "The system initialization file allows you to specify a command or a .do file that is to be executed after the design is loaded. For example:");
MGCAddSnippet(1706, "You can turn off assertion messages from your VHDL code by setting a variable in the modelsim.ini file. This option was added because some utility packages print a huge number of warnings.");
MGCAddSnippet(1707, "You can disable warnings from the Synopsys and numeric standard packages by adding the following lines to the [vsim] section of the modelsim.ini file.");
MGCAddSnippet(1708, "The force command has -freeze, -drive, and -deposit arguments. When none of these is specified, then -freeze is assumed for unresolved signals and -drive is assumed for resolved signals. But if you prefer -freeze as the default for both resolved and unresolved signals, you can change the defaults in the modelsim.ini file.");
MGCAddSnippet(1709, "The restart command has -force, -nobreakpoint, -nofcovers, -nolist, -nolog, and ‑nowave arguments. You can set any of these as defaults by entering the following line in the modelsim.ini file.");
MGCAddSnippet(1710, "You can specify which version of the 1076 Std Questa SIM follows by default using the VHDL93 variable.");
MGCAddSnippet(1711, "You can delay the opening of VHDL files with an entry in the modelsim.ini file if you wish. Normally VHDL files are opened when the file declaration is elaborated. If the DelayFileOpen option is enabled, then the file is not opened until the first read or write to that file.");
MGCAddSnippet(1712, "Pathnames to source files are recorded in libraries by storing the working directory from which the compile is invoked and the pathname to the file as specified in the invocation of the compiler. The pathname may be either a complete pathname or a relative pathname.");
MGCAddSnippet(1713, "Questa SIM tools that reference source files from the library locate a source file in two ways.");
MGCAddSnippet(1714, "Location maps are used to replace prefixes of physical pathnames in the library with environment variables. The location map defines a mapping between physical pathname prefixes and environment variables.");
MGCAddSnippet(1715, "The logical pathnames must begin with $ and the physical pathnames must begin with /. The logical pathname is followed by one or more equivalent physical pathnames. Physical pathnames are equivalent if they refer to the same physical directory (they just have different pathnames on different systems).");
MGCAddSnippet(1716, "When a pathname is stored, an attempt is made to map the physical pathname to a path relative to a logical pathname. ");
MGCAddSnippet(1717, "This appendix describes the messages and status information that Questa SIM displays in the Transcript window. ");
MGCAddSnippet(1718, "The Questa SIM message system helps you identify and troubleshoot problems while using the application. The messages display in a standard format in the Transcript window. ");
MGCAddSnippet(1719, "The format for messages consists of several fields. ");
MGCAddSnippet(1720, "Each message is identified by a unique MsgNum id consisting of four numerical digits. ");
MGCAddSnippet(1721, "You can suppress or change the severity of notes, warnings, and errors that come from vcom, vlog, and vsim commands. You cannot suppress Fatal or Internal messages or change their severity. ");
MGCAddSnippet(1722, "Questa SIM commands issue errors when you provide design files that have syntax errors due to typos or illegal code. You can work to debug these errors using this flow.");
MGCAddSnippet(1723, "You can suppress the display of a specific warning message or categories of warning messages that are trivial or not relevant to operation of a given command. For example, you can suppress warning messages about unbound components that you are not interested in seeing. ");
MGCAddSnippet(1724, "When Questa SIM exits a process, it displays a numerical exit code in the Transcript window. Each code corresponds to a status condition of the process or operation. ");
MGCAddSnippet(1725, "This section describes miscellaneous messages that may appear for various Questa SIM commands, processes, or design languages. ");
MGCAddSnippet(1726, "For designs written in SystemC, you use the sccom command. ");
MGCAddSnippet(1727, "The optional -pedanticerrors argument to vcom enforces strict compliance to the IEEE Std 1076-2002, IEEE Standard VHDL Language Reference Manual (LRM) in the cases listed below. The default behavior for these cases is to issue a warning message that is not suppressible. ");
MGCAddSnippet(1728, "The Questa Verification IP library contains a number of industry standard protocols that you can use to verify legal protocol activity. ");
MGCAddSnippet(1729, "The 60000 series documentation is included in the install.");
MGCAddSnippet(1730, "A 50000 series error can occur for a number of reasons, and depends on the connectivity of the Questa Verification IP within the testbench environment. ");
MGCAddSnippet(1731, "During a given simulation, a Questa Verification IP is translating information between different levels of abstraction, checking for protocol compliance, recording transaction streams, and so on.");
MGCAddSnippet(1732, "There are various methods and approaches to debugging a design, with the Questa SIM Wave window offering a visual interpretation of a simulation as it progresses with time. ");
MGCAddSnippet(1733, "Clicking on a transaction instance in the Wave window also highlights the  parent  and  child  relationships for that instance. More information on these relationships can be viewed in the Transaction View window by right-clicking on the instance and selecting  Transaction View  from the menu. ");
MGCAddSnippet(1734, "If a Questa Verification IP transmits a transaction at the highest level of abstraction then it  generates  the child transactions further down the hierarchy, and down to the wire level of the protocol. ");
MGCAddSnippet(1735, "A Questa Verification IP transmits and receives transactions using communication semantics. These semantics control the blocking and non-blocking of subsequent transactions being transmitted and received to model various protocol scenarios.");
MGCAddSnippet(1736, "A transaction has a simulation  start time  and an  end time . The  end time  indicates that the transaction has completed. If a transaction has completed and it is subsequently deemed to be illegal protocol, then the Questa Verification IP can make a decision about whether to tidy up internally in a silent manner. A  volatile  mechanism may be applied to the transaction so that the Questa Verification IP will report an error message instead of silently deleting the transaction.");
MGCAddSnippet(1737, "A Questa Verification IP can be regarded as a protocol interface that has  ends  for connecting a master, slave, clock generator, reset generator, etc, as TLM-connected, WLM-connected, or both. ");
MGCAddSnippet(1738, "Within the Questa SIM Wave window, all instances of MVC_Transaction, MVC_Message and MVC_Stripe are given a numerical identifier known as the Time Queue ID (TQ_id) which is unique within each type of MVC transaction stream. The TQ_id for a transaction stream type starts at  1  for the first instance and increments by  1  for each instance thereafter. ");
MGCAddSnippet(1739, "The first transaction instance displayed within a transaction stream may not have a TQ_id of  1 , and the TQ_id of subsequent instances in the stream may have incremented by more than  1  from one visible instance to the next. This is due to the deletion of instances that have failed to complete for a reason that is internal to the Questa Verification IP. ");
MGCAddSnippet(1740, "If a QuestaSim 50000 series error is produced during simulation it may include a transaction instance TQ_id number in the error message. ");
MGCAddSnippet(1741, "Context: The errors in this section are related to the transaction queue id. ");
MGCAddSnippet(1742, "A Questa Verification IP transaction is unique in that it can represent communication at multiple levels of abstraction. ");
MGCAddSnippet(1743, "The errors in this section are related to the transaction queue id.");
MGCAddSnippet(1744, "A Questa Verification IP transaction communicates with an TLM model by translating the transaction down to the signal level, and back to the transaction level.");
MGCAddSnippet(1745, "The errors in this section are related to the transaction queue id.");
MGCAddSnippet(1746, "A transaction instance that completes can subsequently fail to be a parent or child of other transaction instances, for reasons that are internal to the Questa Verification IP. These  failures  are a part of the normal internal operation of a Questa Verification IP and can be displayed as  deleted  transaction instances in the Wave window. These failed transaction instances have no detrimental effect on the operation of a Questa Verification IP, but it is useful to know of their existence when debugging your testbench and DUT.");
MGCAddSnippet(1747, "The errors in this section are related to the transaction queue id.");
MGCAddSnippet(1748, "A Questa Verification IP uses a number of standard communications semantics that define the mode of transmission, or observation of, a transaction across the protocol interface. A Questa Verification IP transaction type is defined as an MVC_transaction, an MVC_message or an MVC_stripe. Each transaction type supports a sub-set of the available communications semantics:");
MGCAddSnippet(1749, "An  activated  Questa Verification IP transaction is bi-directional and supports the transmission of the MVC_transaction type between a Questa Verification IP and a DUT. The Questa Verification IP provides the outbound information, with return information provided by the DUT to complete the transaction. ");
MGCAddSnippet(1750, "The three modes — Send, Sending, or Sent — of a Questa Verification IP transaction are uni-directional and support the transmission of the MVC_message and MVC_stripe types from a Questa Verification IP to a DUT. Each mode provides a different blocking mechanism for the internal queuing and transmission of subsequent transactions. The Questa Verification IP provides the outbound information to complete the transaction. ");
MGCAddSnippet(1751, "The three modes Receive, Receiving, or Received of a Questa Verification IP transaction are uni-directional and support the reception of the MVC_transaction, MVC_message and MVC_stripe transaction types from a DUT to a Questa Verification IP. Each mode provides a different blocking mechanism for the internal reception of subsequent transactions. The DUT provides the inbound information to complete the transaction. ");
MGCAddSnippet(1752, "The Questa Verification IP internal communication semantics may be constrained internally by the use of the  now  and  using  clauses to model specific protocol behavior.");
MGCAddSnippet(1753, "The errors in this section are communication related series 50000 errrors..");
MGCAddSnippet(1754, "The  start time  and  end time  reported for a Questa Verification IP MVC_Transaction, MVC_Message and MVC_Stripe relates to the simulation time that the transaction starts and completes on the protocol signals, respectively.");
MGCAddSnippet(1755, "A Questa Verification IP incorporates a  volatile  mechanism that is used to make a decision about whether to tidy up after a transaction has been deemed to be illegal protocol. The decision is made only when the transaction has completed; that is, it recognized the child transactions it needed to succeed, but was unable to satisfy the requirements of a parent transaction. This feature is commonly used to  catch  an MVC_Stripe that does not find a parent transaction.");
MGCAddSnippet(1756, "The errors in this section are related to the volatile clause.");
MGCAddSnippet(1757, "Activities within a Questa Verification IP perform tasks and processes to ensure adherence to a protocol specification, for example, initialization routines, time-outs, and so on. They may consume time, in that their execution advances simulation time. They can also be timeless in that their execution consumes no simulation time.");
MGCAddSnippet(1758, "The errors in this section are related to activities. ");
MGCAddSnippet(1759, "A Questa Verification IP incorporates a  throw  and  catch  mechanism that permits the termination of an existing transaction, and prevents the creation of a subsequent one. This feature is commonly used to model reset behavior.");
MGCAddSnippet(1760, "The error in this section is related to throw and catch errors.");
MGCAddSnippet(1761, "A Questa Verification IP is configured with an  abstraction level  for each end of its interface. An interface end is connected to a model, for example, master, slave, clock generator, reset generator, and so on. There are two defined levels of abstraction:");
MGCAddSnippet(1762, "An interface end that is WLM-connected will monitor wire-level signals changes, and attempt to recognize them into transaction objects. It expects an externally connected model to drive wire-level signals:");
MGCAddSnippet(1763, "An interface end that is TLM-connected drives the wire-level signals, as a consequence of a transaction being generated within the Questa Verification IP. It expects an externally connected model to:");
MGCAddSnippet(1764, "An interface end that is both WLM-connected and TLM_connected monitors and drives wire-level signals, respectively.");
MGCAddSnippet(1765, "The errors in this section are related to TLM and WLM connections. ");
MGCAddSnippet(1766, "This appendix describes the Questa SIM implementation of the Verilog interfaces:");
MGCAddSnippet(1767, "This chapter describes only the details of using the Verilog interfaces with Questa SIM Verilog and SystemVerilog.");
MGCAddSnippet(1768, "To use GCC compilers with C interfaces, you must acquire the gcc/g++ compiler for your given platform. ");
MGCAddSnippet(1769, "Each PLI application must register its system tasks and functions with the simulator, providing the name of each system task and function and the associated callback routines.");
MGCAddSnippet(1770, "Each VPI application must register its system tasks and functions and its callbacks with the simulator. To accomplish this, one or more user-created registration routines must be called at simulation startup. Each registration routine should make one or more calls to vpi_register_systf() to register user-defined system tasks and functions and vpi_register_cb() to register callbacks. The registration routines must be placed in a table named vlog_startup_routines so that the simulator can find them. The table must be terminated with a 0 entry.");
MGCAddSnippet(1771, "DPI applications do not need to be registered. However, each DPI imported or exported task or function must be identified using SystemVerilog  import  DPI-C   or  export  DPI-C  syntax. ");
MGCAddSnippet(1772, "Correct use of Questa SIM DPI depends on the flow presented in this section.");
MGCAddSnippet(1773, "You can specify C/C++ files on the vlog command line, and the command will invoke the correct C/C++ compiler based on the file type passed. For example, you can enter the following command:");
MGCAddSnippet(1774, "Legacy use flows may be in use for certain designs from previous versions of Questa SIM. ");
MGCAddSnippet(1775, "This issue can arise in your C code due to the way the C linker resolves symbols. It happens if a name you choose for a SystemVerilog export function happens to match a function name in a custom, or even standard C library (for example,  pow ). In this case, your C compiler will bind calls to the function in that C library, rather than to the export function in the SystemVerilog simulator.");
MGCAddSnippet(1776, "DPI uses C function linkage and can produce incorrect C++ names if you do not use the appropriate extern  C  declaration.");
MGCAddSnippet(1777, "In addition to the traditional method of importing HDL interface, and C library functions, a simplified method can be used: you can declare HDL interface functions as DPI-C imports. When you declare HDL interface functions as DPI-C imports, the C implementation of the import tf is not required. ");
MGCAddSnippet(1778, "You can optimize the passing of some array data types across a language boundary.");
MGCAddSnippet(1779, "DPI import and export TF's can be written with arguments of parameterized data types.");
MGCAddSnippet(1780, "Working in certain FLI or PLI C applications, you might want to interact with the simulator by directly calling Verilog DPI export functions. Such applications may include complex 3rd party integrations, or multi-threaded C test benches. Normally calls to export functions from PLI or FLI code are illegal. These calls are referred to as out-of-the-blue calls, since they do not originate in the controlled environment of a DPI import tf.");
MGCAddSnippet(1781, "In some instances you may need to share C/C++ code across different shared objects that contain PLI or DPI code. ");
MGCAddSnippet(1782, "Use the PLI Catalog File (PCAT file) to control autocompilation of PLI files or as a method of access control for system tasks and functions.");
MGCAddSnippet(1783, "The PLI Catalog encapsulates global or per-task access information for each system task or function, which allows the simulator to preserve visibility while retaining high levels of optimization.");
MGCAddSnippet(1784, "There are two flows for using a PCAT file in your PLI environment, where you specify only access information.");
MGCAddSnippet(1785, "The PCAT file specifies PLI linkage (calltf, checktf, sizetf, compiletf) as well as design access requirements used during PLI compilation. ");
MGCAddSnippet(1786, "The PLI Catalog file contains PLI linkage and access specifications used during the optimization and simulation stages of your Questa SIM flow.");
MGCAddSnippet(1787, "Use PCAT files to manage access information for and autocompilation of PLI files.");
MGCAddSnippet(1788, "You should use a PCAT file to for access control when you have a system task that requests a specific type of access to the design in order to function.");
MGCAddSnippet(1789, "Use a PLI Catalog (PCAT) file to aid the PLI Autocompile flow in linking PLI system tasks and functions (systf) into your simulation.");
MGCAddSnippet(1790, "The following platform-specific instructions show you how to compile and link your HDL interface C applications so that they can be loaded by Questa SIM. Various native C/C++ compilers are supported on different platforms. The gcc compiler is supported on all platforms.");
MGCAddSnippet(1791, "The information in this section applies to all UNIX platforms.");
MGCAddSnippet(1792, "Windows platforms for C are supported for Microsoft Visual Studio and MinGW.");
MGCAddSnippet(1793, "If your HDL interface application uses anything from a system library, you must specify that library when you link your HDL interface application.");
MGCAddSnippet(1794, "Questa SIM does not have direct support for any language other than standard C; however, C++ code can be loaded and executed under certain conditions.");
MGCAddSnippet(1795, "If app.so is not in your current directory you must tell Linux where to search for the shared object. You can do this one of two ways: ");
MGCAddSnippet(1796, "Windows platforms for C++ are supported for Microsoft Visual Studio and MinGW.");
MGCAddSnippet(1797, "Linux platforms are supported as follows. ");
MGCAddSnippet(1798, "PLI and VPI file loading is identical. DPI file loading uses switches to the vsim command.");
MGCAddSnippet(1799, "The PLI/VPI applications are specified as follows:");
MGCAddSnippet(1800, "This section applies only to external compilation flows. It is not necessary to use any of these options in the default autocompile flow (using vlog to compile).");
MGCAddSnippet(1801, "On Unix platforms you can load shared objects such that all symbols in the object have global visibility. To do this, use the -gblso argument to vsim when you load your PLI/VPI application. For example:");
MGCAddSnippet(1802, "The following example shows a small but complete PLI application for Linux.");
MGCAddSnippet(1803, "The following example is a trivial, but complete VPI application. A general VPI example can be found in <install_dir>/questasim/examples/verilog/vpi.");
MGCAddSnippet(1804, "The following example is a trivial but complete DPI application. For additional examples, see the <install_dir>/examples/systemverilog/dpi directory.");
MGCAddSnippet(1805, "The second argument to a PLI callback function is the reason argument. The values of the various reason constants are defined in the veriuser.h include file. See the IEEE Std 1364 for a description of the reason constants. The following details relate to Questa SIM Verilog, and may not be obvious in the IEEE Std 1364. Specifically, the simulator passes the reason values to the misctf callback functions under the following circumstances:");
MGCAddSnippet(1806, "A user-defined system function specifies the width of its return value with the sizetf callback function, and the simulator calls this function while loading the design. The following details on the sizetf callback function are not found in the IEEE Std 1364:");
MGCAddSnippet(1807, "Many of the object handles returned by the PLI ACC routines are pointers to objects that naturally exist in the simulation data structures, and the handles to these objects are valid throughout the simulation, even after the acc_close() routine is called. However, some of the objects are created on demand, and the handles to these objects become invalid after acc_close() is called. The following object types are created on demand in Questa SIM Verilog:");
MGCAddSnippet(1808, "Many third party PLI applications come with instructions on using them with Questa SIM Verilog. Even without the instructions, it is still likely that you can get it to work with Questa SIM Verilog as long as the application uses standard PLI routines. The following guidelines are for preparing a Verilog-XL PLI application to work with Questa SIM Verilog.");
MGCAddSnippet(1809, "The PLI ACC routines also provide limited support for VHDL objects in either an all VHDL design or a mixed VHDL/Verilog design.");
MGCAddSnippet(1810, "Questa SIM Verilog supports the following ACC routines:");
MGCAddSnippet(1811, "Questa SIM Verilog supports the following TF (task and function) routines;");
MGCAddSnippet(1812, "Questa SIM SystemVerilog supports all routines defined in the  svdpi.h  file defined in the IEEE Std 1800-2005. ");
MGCAddSnippet(1813, "The following PLI routines are not defined in IEEE Std 1364, but Questa SIM Verilog provides them for compatibility with Verilog-XL.");
MGCAddSnippet(1814, "The PLI function acc_fetch_paramval() cannot be used on 64-bit platforms to fetch a string value of a parameter. Because of this, the function acc_fetch_paramval_str() has been added to the PLI for this use. acc_fetch_paramval_str() is declared in acc_user.h. It functions in a manner similar to acc_fetch_paramval() except that it returns a char *. acc_fetch_paramval_str() can be used on all platforms.");
MGCAddSnippet(1815, "The foreign interface tracing feature is available for tracing PLI and VPI function calls. Foreign interface tracing creates two kinds of traces: a human-readable log of what functions were called, the value of the arguments, and the results returned; and a set of C‑language files that can be used to replay what the foreign interface code did.");
MGCAddSnippet(1816, "The purpose of the logfile is to aid you in debugging PLI or VPI code. The primary purpose of the replay facility is to send the replay files to support for debugging co-simulation problems, or debugging PLI/VPI problems for which it is impractical to send the PLI/VPI code. We still need you to send the VHDL/Verilog part of the design to actually execute a replay, but many problems can be resolved with the trace only.");
MGCAddSnippet(1817, "To invoke the trace, call vsim with the -trace_foreign argument.");
MGCAddSnippet(1818, "The checkpoint feature in Questa SIM captures the state of PLI/VPI/DPI code. ");
MGCAddSnippet(1819, "Questa SIM offers the optional C Debug feature, which allows you to interactively debug SystemC/C/C++ source code with the open-source gdb debugger. ");
MGCAddSnippet(1820, "Questa SIM goes through numerous steps as it initializes the system during startup. It accesses various files and environment variables to determine library mappings, configure the GUI, check licensing, and so forth. ");
MGCAddSnippet(1821, "When you invoke Questa SIM, it reads several files in file system and configuration environment. ");
MGCAddSnippet(1822, "The numberd items listed below describe the initialization sequence for Questa SIM. The sequence includes a number of conditional structures, the results of which are determined by the existence of certain files and the current settings of environment variables.");
MGCAddSnippet(1823, "When you install Questa SIM, the installation process creates and reads several environment variables for the operating system of your computer. Most of these variables have default values, which you can change to customize Questa SIM operation. ");
MGCAddSnippet(1824, "Questa SIM shell commands vcom, vlog, vsim, and vmap, do not expand environment variables in filename arguments and options. Instead, you should expand variables in the shell window in the usual manner before running these Questa SIM commands. The -f switch that most of these commands support performs environment variable expansion throughout the file. ");
MGCAddSnippet(1825, "Before compiling or simulating, you can specify values for a variety of environment variables to provide the functions described below. ");
MGCAddSnippet(1826, "In addition to the predefined variables shown above, you can define your own environment variables. This example shows a user-defined library path variable that you can reference by using the vmap command to add library mapping to the modelsim.ini file.");
MGCAddSnippet(1827, "Once you have set the MY_PATH variable is set, you can use it with the vmap command to add library mappings to the current modelsim.ini file.");
MGCAddSnippet(1828, "There are two ways you can reference environment variables within Questa SIM. ");
MGCAddSnippet(1829, "The temporary (temp) file named VSOUT is the communication mechanism between the simulator kernel and the Graphical User Interface. ");
MGCAddSnippet(1830, "This appendix provides information about using Questa SIM with the Synopsys SmartModels and Synopsys hardware modeling.");
MGCAddSnippet(1831, "You can use the Synopsys SWIFT-based SmartModel library with Questa SIM. The SmartModel library is a collection of behavioral models supplied in binary form with a procedural interface that is accessed by the simulator. ");
MGCAddSnippet(1832, "Questa SIM VHDL interfaces to a SmartModel through a foreign architecture. The foreign architecture contains a foreign attribute string that associates a specific SmartModel with the architecture. On elaboration of the foreign architecture, the simulator automatically loads the SmartModel library software and establishes communication with the specific SmartModel. ");
MGCAddSnippet(1833, "The VHDL SmartModel interface is basically a foreign architecture which contains a foreign attribute string which associates the SmartModel with the architecture. To enable the SmartModel interface you must follow the steps outlined in this section.");
MGCAddSnippet(1834, "The sm_entity tool automatically creates entities and foreign architectures for SmartModels. The flow for utilizing sm_entity in the creation of the interface is outlined here.");
MGCAddSnippet(1835, "The syntax for sm_entity is as follows.");
MGCAddSnippet(1836, "The entities generated by sm_entity only contain single-bit ports, never vectored ports. This is necessary because Questa SIM correlates entity ports with the SmartModel SWIFT interface by name. However, for ease of use in component instantiations, you can create a custom component declaration and component specification that groups ports into vectors. You can also rename and reorder the ports in the component declaration. You can also reorder the ports in the entity declaration, but you cannot rename them.");
MGCAddSnippet(1837, "The command channel lets you invoke SmartModel specific commands. Questa SIM provides access to the Command Channel from the command line. ");
MGCAddSnippet(1838, "Some models in the SmartModel library provide access to internal registers with a feature called SmartModel Windows. The simulator interface to this feature is described below.");
MGCAddSnippet(1839, "A memory model usually makes the entire register array available as a window. In this case, the window commands operate only on a single element at a time. The element is selected as an array reference in the window instance specification. For example, to read element 5 from the window memory mem:");
MGCAddSnippet(1840, "The SmartModel library provides an optional library of Verilog modules and a PLI application that communicates between a simulator's PLI and the SWIFT simulator interface.");
MGCAddSnippet(1841, "A hardware model allows simulation of a device using the actual silicon installed as a hardware model. The hardware modeling system is a network resource with a procedural interface that is accessed by the simulator. ");
MGCAddSnippet(1842, "The simulator interfaces to a hardware model through a foreign architecture. The foreign architecture contains a foreign attribute string that associates a specific hardware model with the architecture. On elaboration of the foreign architecture, the simulator automatically loads the hardware modeler software and establishes communication with the specific hardware model. ");
MGCAddSnippet(1843, "The simulator locates the hardware modeler interface software based on entries in the modelsim.ini initialization file. The simulator and the hm_entity tool (for creating foreign architectures) both depend on these entries being set correctly. ");
MGCAddSnippet(1844, "The hm_entity tool creates entities and foreign architectures for hardware models.");
MGCAddSnippet(1845, "The hm_entity tool automatically creates entities and foreign architectures for hardware models. ");
MGCAddSnippet(1846, "The hm_entity tool automatically creates entities and foreign architectures for hardware models. ");
MGCAddSnippet(1847, "The entities generated by hm_entity only contain single-bit ports, never vectored ports. However, for ease of use in component instantiations, you may want to create a custom component declaration and component specification that groups ports into vectors. You can also rename and reorder the ports in the component declaration. You can also reorder the ports in the entity declaration, but you can not rename them!");
MGCAddSnippet(1848, "The following simulator commands are available for hardware models. ");
